(494, 4, 'Over & Cookware Cleaner', 'over-and-cookware-cleaner', '<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> কড়াই,পাতিলের কড়া, পোড়া,কালো দাগ কিছুতেই উঠে না।আবার রান্নাঘরের প্রধান সমস্যা হল, প্রায়ই তেলকালি জমে। রান্নাঘরের হাড়ি, পাতিল,কড়াই,প্যান, দেয়াল, স্ল্যাব ইত্যাদি তেল চিটচিটে হয়ে যায়।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> খুব সহজেই অপরিষ্কার হয়ে যায় রান্নাঘর। এই ক্ষেত্রে একটু সতর্ক থাকা প্রয়োজন। রান্নাঘরের তেল চিটচিটে দাগ কীভাবে তুলব, এটা একটা চিন্তার বিষয় হয়ে ওঠে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> আজ তাই আপনাদের জন্য়ই কিছু সহজ টিপস ও ট্রিকস নিয়ে এলাম আমরা।</div>\r\n<div dir=\"auto\">কীভাবে তেল চিটচিটে রান্নাঘর পরিষ্কার করবেন বা কীভাবে</div>\r\n<div dir=\"auto\">Over &amp; Cookware Clean এর মাধ্যমে আমরা খুব সহজে যে কোন জিনিস পরিষ্কার রাখতে পারব</div>\r\n<div dir=\"auto\">👉 weight :500g</div>\r\n<div dir=\"auto\">👉&nbsp;Remove stainless steel stubborn germs</div>\r\n<div dir=\"auto\">👉&nbsp;Remove flavar</div>\r\n<div dir=\"auto\">👉&nbsp;Remove burnt stains</div>\r\n<div dir=\"auto\">👉&nbsp;Rust removal polishing</div>\r\n<div dir=\"auto\">👉&nbsp;Paste easy to use</div>\r\n<div dir=\"auto\">👉&nbsp;Prevent atomization</div>\r\n<div dir=\"auto\">👉&nbsp;Decontamination &amp; descaling</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2f/1/16/2668.png\" alt=\"♨\" width=\"16\" height=\"16\" /></span>99.9% effective</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2f/1/16/2668.png\" alt=\"♨\" width=\"16\" height=\"16\" /></span>size: 8.5x6.5x10cm</div>', 750, 450, 'SA-107', 0, 0, 1, '2022-10-06 14:55:06', '2022-11-08 17:25:01'),
(493, 4, 'Handy Mini Plastic Chopper with 3 Blades - Hand Blenders', 'handy-mini-plastic-chopper-with-3-blades-hand-blenders', '<p><strong>Handy Mini Plastic Chopper with 3 Blades - Hand Blenders</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">Type:Fruit &amp; Vegetable Tools</li>\r\n<li class=\"\">Fruit &amp; Vegetable Tools Type:Vegetable Choppers</li>\r\n<li class=\"\">Material:Plastic</li>\r\n<li class=\"\">Plastic Type:PC</li>\r\n<li class=\"\">Certification:EEC</li>\r\n<li class=\"\">Certification:CE / EU</li>\r\n<li class=\"\">Model Number:Manual Meat Choppers</li>\r\n<li class=\"\">Feature:Eco-Friendly</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i2.2326to8nto8nuM\">Feature:Stocked</li>\r\n<li class=\"\">Product size (L x W x H):12.50 x 12.50 x 8.30 cm / 4.92 x 4.92 x 3.27 inches</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.2326to8nto8nuM\">Feature:Chopping Food Machine</li>\r\n</ul>', 590, 450, 'SA-106', 0, 0, 1, '2022-10-06 14:02:24', '2022-10-07 15:03:19'),
(557, 6, 'Mintiml Beewax Wood Polish', 'mintiml-beewax-wood-polish', '<p><strong>Mintiml Beewax Wood Polish</strong></p>\r\n<div dir=\"auto\">মূল্যঃ ৬ টা পলিশ ৯৫০ টাকা সাথে ২ টা ফ্রী, ২ টা পলিশ ৪০০ টাকা সাথে ১ টা ফ্রী এবং ফার্নিচার পলিশ করার জন্য মার্কিন কাপড় ফ্রী</div>\r\n<div dir=\"auto\">👉&nbsp; আপনার বাসার ফার্নিচারগুলো কি পুরাতন হয়ে গেছ ? বহু বছর ধরে ধুলাবালি পড়ে চকচকে ভাব নষ্ট হয়ে গেছে ? আপনার পুরাতন ফার্নিচার গুলোকে ধুলাবালি থেকে মুক্ত রাখতে এবং নতুনের মত চকচকে করতে আমরা নিয়ে এসেছি উন্নত মানের ফার্নিচার পালিশ।&nbsp;</div>\r\n<div dir=\"auto\">👉&nbsp;আপনার পুরানো দাগযুক্ত/আঁচড়ানো কাঠের ফার্নিচার গুলোকে করে তুলবে নতুনের মত চকচকে। যে কোন পুরনো ফার্নিচার নতুনের মত চকচকে করে ফেলুন নিমিষেই NATURAL FURNITURE POLISH এর মাধ্যমে। <span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tea/1/16/1f970.png\" alt=\"🥰\" width=\"16\" height=\"16\" /></span></div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\">👉 </span>প্রডাক্ট এমন ভাবে বাননো যে,আপনি বাসায় নিয়ে ই ব্যবহার করতে পারবেন। অন্য কিছু মিশানো লাগবে না।</div>\r\n<div dir=\"auto\">👉&nbsp; তাই আজই নিজের সব ফার্নিচার নিজেই পলিশ করে নতুন এর মত ঊজ্জল করে তুলুন।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t10/1/16/2614.png\" alt=\"☔️\" width=\"16\" height=\"16\" /></span> ওয়াটার প্রুফ এবং দ্রুত শুকাবে। ( 100% Original Product)</div>\r\n<div dir=\"auto\">👉যে কোন কাঠ, বোর্ড, লেদার অথবা লেকার এর ফার্নিচার পলিশ করা যাবে।</div>\r\n<div dir=\"auto\">👉&nbsp;কাঠ ঘুনে ধরা থেকে রক্ষা করবে।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\">👉</span> ব্যবহার করা সহজ এবং নিরাপদ</div>\r\n<div dir=\"auto\">👉&nbsp;এটি সব ধরনের কাঠের উপর নিরাপদে ব্যবহার করা যাবে।</div>\r\n<div dir=\"auto\"><strong>ব্যবহার বিধি: </strong></div>\r\n<div dir=\"auto\">✌️ কৌটা অবশ্যই ভালো করে ঝাঁকিয়ে নিন।</div>\r\n<div dir=\"auto\">✌️ পলিশ শুরু করার আগে কাজের জায়গা কটনের এক টুকরো কাপড় দিয়ে মুছে পরিস্কার করে নিন।</div>\r\n<div dir=\"auto\">✌️এবার কটনের কাপড় পলিশে ভিজিয়ে নিয়ে ভালো করে পলিশ করে নিন।</div>\r\n<div dir=\"auto\">✌️ অপেক্ষা করুণ শুকানো পর্যন্ত, ভেজা অবস্থায় পলিশ নয়।</div>\r\n<div dir=\"auto\">✌️ শুকানোর পর আরো এক টুকরো কটনের পরিস্কার কাপড় দিয়ে মুছতে থাকুন ২/৩ বার, ভালো ফলাফলের জন্য আরো একবার পলিশ করুন। ✌️ ১০০% আপনার পলিশিং এ গ্লেজ না আসলে পণ্য রিটার্ন করুন, নিশ্চিন্তে।</div>', 250, 170, 'SA-169', 0, 0, 1, '2022-10-10 20:22:58', '2022-11-09 08:07:40'),
(546, 6, 'Alarm Security Lock', 'alarm-security-lock', '<p><strong>Alarm Security Lock</strong></p>\r\n<div dir=\"auto\"><strong>👉 </strong>অসৎ উদ্দেশ্যে লকের গায়ে সামান্য আঘাত করার সাথে সাথে উচ্চ শব্দে এলার্ম বেজে উঠবে।</div>\r\n<div dir=\"auto\"><strong>👉 </strong>সম্পূর্ণ স্টেইনলেস স্টিলের তৈরি তাই যথেষ্ট মজবুত।ই ডিভাইসটি ওয়াটার প্রুফ হওয়াতে বৃষ্টির পানিতে ভিজলেও মরিচা পড়ে নষ্ট হয়না।</div>\r\n<div dir=\"auto\"><strong>👉 </strong>ফল্স অ্যালার্ম প্রোটেক্টেড, আর তাই যে কেউ লক না ধরা পর্যন্ত বাজবে না।</div>\r\n<div dir=\"auto\"><strong>👉 </strong>দু&rsquo;ভাবেই ব্যবহারযোগ্য, আর তাই ব্যবহার করা যাবে এলার্ম বিহীন সাধারণ তালা হিসেবেও।</div>\r\n<div dir=\"auto\"><strong>👉 </strong>দীর্ঘস্থায়ী ব্যাটারি, তাই চলে বহুদিন।</div>\r\n<div dir=\"auto\"><strong>👉 </strong>ব্যাটারি সহজলভ্য হওয়ায় খুব সহজেই প্রতিস্থাপনযোগ্য। সাথে পাচ্ছেন একটি ব্যাটারি ফ্রি।</div>\r\n<div dir=\"auto\"><strong>👉 </strong>দিনের বেলায় ৪০-৫০ মিটার দূর থেকে এর সাউন্ড শুনতে পারবেন। এবং রাতের বেলায় ১০০ মিটার দূর থেকে এর সাউন্ড শুনতে পারবেন</div>', 850, 690, 'SA-158', 0, 0, 1, '2022-10-10 16:50:20', '2022-10-10 16:50:20'),
(547, 4, 'Portable Aluminum Laptop Stand', 'portable-aluminum-laptop-stand', '<ul class=\"\">\r\n<li class=\"\">Portable and foldable, easy to carry</li>\r\n<li class=\"\">Height adjustment meet different view angel</li>\r\n<li class=\"\">Hollow bottom for heat dissipation</li>\r\n<li class=\"\">Non-slip silicone bottom, stable placing</li>\r\n<li class=\"\">Folding size: 60x260mm</li>\r\n<li class=\"\">Size: Suit for 10 - 15 inch laptop and tablet</li>\r\n<li class=\"\">Function: Laptop heightening bracket and cooling pad</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.11ec9YG09YG0Ub\">MODEN DESIGN AND FULL ASSEMBLE: the laptop &amp; tablet stand is fully assembled and you can take and close it in 1 second.</li>\r\n<li class=\"\">Otherwise you have any question plzz contact us freely we will try to solve your problem</li>\r\n</ul>', 920, 750, 'SA-159', 0, 0, 1, '2022-10-10 17:06:50', '2022-10-10 17:06:50'),
(548, 7, 'USB Rechargeable Portable Juicer', 'usb-rechargeable-portable-juicer', '<p><strong>USB Rechargeable Portable Juicer&nbsp;</strong></p>\r\n<div dir=\"auto\">আপনাদের জন্য আমরা নিয়ে এসেছি ইউ.এস.বি রিচার্জেবল পোর্টেবল জুসার। এই ব্লেন্ডার দিয়ে প্রায় সবধরনের ফল খুব সহজে এবং ভালোভাবে ব্লেন্ড করতে পারেবন। রিচার্জেবল হওয়ায় কারেন্ট না থাকলেও বা ভ্রমণের সময় এটি ব্যবহার করে জুস তৈরি করতে পারবেন।</div>\r\n<div dir=\"auto\">পন্যের বিবরণঃ</div>\r\n<div dir=\"auto\">👉 USB রিচার্জেবল ব্লেন্ডার</div>\r\n<div dir=\"auto\">👉&nbsp;SUS 304 এসিড প্রুফ স্টেইনলেস স্টিল ব্লেড</div>\r\n<div dir=\"auto\">👉 নন-টক্সিক ফুড গ্রেড সিলিকন ম্যাটেরিয়াল</div>\r\n<div dir=\"auto\">👉 ফ্রুট বা ভেজিটেবল জুস তৈরি করার জন্য আদর্শ একটি পণ্য</div>\r\n<div dir=\"auto\">👉&nbsp;পরিষ্কার করা সহজ</div>\r\n<div dir=\"auto\">👉 ফুড গ্রেড ম্যাটেরিয়াল</div>\r\n<div dir=\"auto\">👉&nbsp;ফুল চার্জে 10-12 বার ব্যবহার করা যায়</div>\r\n<div dir=\"auto\">👉&nbsp;যে কোন স্থানে বহন করে নিয়ে যেতে পারবেন</div>\r\n<div dir=\"auto\">👉&nbsp;অন/অফ সুইচ</div>\r\n<div dir=\"auto\">👉 বটল ক্যাপাসিটি: 3৪0ML</div>\r\n<div dir=\"auto\">👉 মটর টাইপ: DC3.6V</div>\r\n<div dir=\"auto\">👉 মটর স্পিড: [hidden information]rpm</div>\r\n<div dir=\"auto\">👉 ব্যাটারি: 2000 mah, 3.7V</div>\r\n<div dir=\"auto\">👉 ম্যাটেরিয়াল: PP প্লাস্টিক</div>', 970, 790, 'SA-160', 0, 0, 1, '2022-10-10 17:25:53', '2022-10-10 17:25:53'),
(549, 7, 'Air Cooler Foldable Laptop Table', 'air-cooler-foldable-laptop-table', '<p><strong>Air Cooler Foldable Laptop Table&nbsp;</strong></p>\r\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" />&nbsp;T8 ল্যাপটপ টেবিলগুলা মার্কেটের সব থেকে বেস্ট কোয়ালিটি এ্যালুমিনিয়াম ল্যাপটপ টেবিল।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> &nbsp;ইহার সাইজ যে কোন ল্যাপটপ বা নোটবুকের জন্যই পারফেক্ট/ব্যবহার উপযোগী।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" />&nbsp;এই টেবিল ২১ ইঞ্চি পর্যন্ত ল্যাপটপ এবং ১৫ কেজি ধারন ক্ষমতা সম্পন্ন।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> T8 এ্যালুমিনিয়াম ল্যাপটপ টেবিলের সাথে থাকছে সংযুক্ত এবং সংযোজন/বিয়োজন মাউস প্যাড।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> এই মডেলে যুক্ত বড় ৬ পাখাওয়ালা কুলিং ফ্যান, যা ল্যাপটপের/পাওয়ার ব্যাংক/ডাইরেক্ট এ সি এ্যাডাপ্টার থেকে ইউ এস বি দ্বারা পাওয়ার নিয়ে চলবে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" />&nbsp;এই T8 এ্যালুমিনিয়াম ল্যাপটপ টেবিলটি বহন করা খবই সহজ, এটা আপনার জীবনযাপন আরও সহজ করে তুলবে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" />&nbsp;আপনি বিছানার উপর কাজ করতে পারবেন অথবা বিছানার উপর নিয়ে ইহার উপর ল্যাপটপ রেখে মুভি ও দেখতে পারবেন।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" />&nbsp;মেঝের উপর, এমনকি চলন্ত গাড়িতে ভ্রমনের সময় ও ব্যবহার করা যাবে।</div>\r\n</div>\r\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">\r\n<div dir=\"auto\"><strong>T8 ল্যাপটপ টেবিলের বৈশিষ্ট:</strong></div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> &nbsp;ফোল্ডেবল এবং পোর্টেবল।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> &nbsp;২১ ইঞ্চি পর্যন্ত ল্যাপটপ রাখা সম্ভব।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> ২ টি বড় ৬ পাখার কুলিং ফ্যান।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> &nbsp;১০০% এ্যালুমিনিয়াম।</div>\r\n</div>', 1900, 1600, 'SA-161', 0, 0, 1, '2022-10-10 17:36:52', '2022-10-10 17:36:52'),
(417, 6, 'Baby Rocking Chair', 'baby-rocking-chair', '<p><strong>Multifunctional Premium Baby Rocking Chair</strong></p>\r\n<div>\r\n<div class=\"\" dir=\"auto\">\r\n<div id=\"jsc_c_1j\" class=\"d2hqwtrz r227ecj6 ez8dtbzv gt60zsk1\" data-ad-comet-preview=\"message\" data-ad-preview=\"message\">\r\n<div class=\"alzwoclg cqf1kptm siwo0mpr gu5uzgus\">\r\n<div class=\"jroqu855 nthtkgg5\">\r\n<div class=\"m8h3af8h l7ghb35v kjdc1dyq kmwttqpk gh25dzvf n3t5jt4f\">\r\n<div dir=\"auto\">Soft plush fabrics with 6D mesh for baby&rsquo;s comfort</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp; Easily converts the rocker to a stationary seat for feeding or sleeping</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp; The baby easily falls asleep in the rocking chair</div>\r\n<div dir=\"auto\">( আপনার সোনামনি থাকবে নিরাপদে )</div>\r\n<div dir=\"auto\">মায়েদের ব্যাস্ত সময়ে বাচ্চাকে নিয়ন্ত্রণে রাখতে ব্যাবহার করুন বিশ্ববিখ্যাত খেলনা সহ বেবি রকিং চেয়ার ।</div>\r\n<div dir=\"auto\"><strong>পন্যের বিবরণ</strong></div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp;&nbsp;বয়স: 0 থেকে শুরু করে প্রায় ৪ বছর পর্যন্ত প্রায় সব বাচ্চাদের জন্য ।সহজেই খুলে রাখা যায় এবং মেশিন ওয়াসের জন্য উপযোগী ।</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp; বাচ্চার মাথা ও পিঠের সঠিক ভারসাম্য রক্ষা করে।</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp;&nbsp;ফ্যাব্রিক সীট শিশুর শরীরের রূপরেখা এবং ওজন সমানভাবে বিতরণ করে।</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp;&nbsp;ঘুম, বিশ্রাম এবং খেলা &ndash; এই তিন অবস্থানের জন্য বেবি বাউন্সার ব্যাবহারযোগ্য।</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp;&nbsp;সমতল ভাবে ভাঁজ করা যায় যা সংরক্ষণ ও ভ্রমণ এর জন্য সহায়ক।</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp;&nbsp;টয় যুক্ত খেলনা বাচ্চা আনন্দে ও হাসিখুশিতে খেলতে পারবে নিজে নিজেই ।</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp; চমৎকার একটি পন্য যা দিয়ে আপনার বাচ্চা আনন্দের সাথে খেলা করবে।</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp; বাচ্চা পা নাড়াচাড়া করলে এটাও বাওঞ্চ(দুলতে) করতে থাকবে ।</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp; এটা ব্যাবহারে আপনার বাচ্চা নিজে নিজে খেলতে থাকবে ঘণ্টার পর ঘণ্টা।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>', 1950, 1650, 'SA-31', 0, 0, 1, '2022-10-03 04:34:07', '2022-10-03 04:34:07'),
(483, 4, 'Electric Ruti Maker', 'electric-ruti-maker', '<p><strong>Electric Ruti Maker</strong></p>\r\n<p>AFFIX<br />ISO 9001:2015 Certified Company&nbsp;<br />👉 Easy to operate best Performance&nbsp;<br />👉 রুটি তৈরি করার ঝামেলা আর নয়। আপনাদের জন্য নিয়ে এসেছি ইলেকট্রনিক রুটি মেকার। সময় ও বিদ্ধুৎ সাশ্রয়ী এই পন্য টি আপনার বিশেষ করে যারা অফিস এ কাজ করেন তাদের জন্য আদর্শ।&nbsp;<br />👉 রুটি হলো সব বয়সীদের জন্য একটি উপকারী খাবার।এটি আমাদের অনেকের প্রাত্যহিক খাবারের মধ্যে একটি যা আমাদের শরীরের জন্যও উপকারী।কিন্তু, এটি তৈরি করা সময় সাপেক্ষ একটি প্রক্রিয়া।</p>\r\n<p>👉 তবে, এই প্রক্রিয়াটি সহজ ও অল্প সময়ে সম্পন্ন করতে পারবেন এই রুটি মেকার ব্যবহার এর মাধ্যম।</p>\r\n<p>👉 এই রুটি মেকারে শুধু আপনি রুটিই নয় আরো বানাতে পারবেন টোস্ট, আলু পুরি যা খুব সহজেই এবং অল্প সময়ে।&nbsp;<br />👉 Product name -Roti maker.<br />👉 Type &nbsp; &nbsp; &nbsp;-Electric.<br />👉 Power &nbsp; &nbsp;-900watts. &nbsp;<br />👉 Material &nbsp; &nbsp; -Steel.&nbsp;<br />👉 Colour &nbsp; &nbsp; -Black&amp;Steel. &nbsp;<br />যারা নতুন সংসার শুরু করতে যাচ্ছেন এবং যারা মা হতে যাচ্ছেন(গর্ভবতী) তাদের আর চিন্তা করার কোন কারণ নেই।আপনাদের সুবিধার জন্য রয়েছে ইলেকট্রনিক রুটি মেকার।<br />👉 1 year warrenty&nbsp;</p>', 2400, 2050, 'SA-96', 0, 0, 1, '2022-10-06 02:24:26', '2022-10-06 02:24:33'),
(484, 7, 'Kitchen Cleaner', 'kitchen-cleaner', '<p><strong>Kitchen Cleaner</strong></p>\r\n<p>👉&nbsp; Kitchen Cleaner স্প্রে দ্বারা আপনি আপনার রান্নাঘর, রান্নকরার প্রয়জনিও সরঞ্জাম, দেয়াল, লেদার, কমোড, টাইলস, বেসিন সব কিছু পরিস্কার করুন সহজেই</p>\r\n<p>👉&nbsp; আপনার বাসার যেকোনো কিছু পরিস্কার করতে ব্যাবহার করুন</p>\r\n<p>👉&nbsp; এটি হতে পারে আপনার তেল কাস্টে বা সব কিছু উঠানোর পারফেক্ট সলিউশন</p>\r\n<p>👉 এটা দিয়ে সব কিছুই পরিষ্কার করতে পারবেন।</p>\r\n<p>👉&nbsp; এটি ফোম তাই অল্প পরিমানে দিলেই কাজ করবে</p>', 690, 540, 'SA-97', 0, 0, 1, '2022-10-06 02:35:28', '2022-10-06 02:35:28'),
(485, 4, 'Drain Cleaning Spring Stick', 'drain-cleaning-spring-stick', '<p><strong>Drain Cleaning Spring Stick</strong></p>\r\n<div dir=\"auto\">Blendable Pipe Cleaner Hook Sewer Stick/ Drain Cleaner</div>\r\n<div dir=\"auto\"><strong>Product Descriptions:</strong></div>\r\n<div dir=\"auto\">👉&nbsp; Product Type: Pipe Cleaner/ Drain Cleaners</div>\r\n<div dir=\"auto\">👉&nbsp; Origin: China</div>\r\n<div dir=\"auto\">👉&nbsp; Size: 5 Feet</div>\r\n<div dir=\"auto\">👉&nbsp; long Shape: Solid</div>\r\n<div dir=\"auto\">👉&nbsp; Materials: PP + Wire</div>\r\n<div dir=\"auto\">👉&nbsp; Function 1: Pipe Cleaning</div>\r\n<div dir=\"auto\">👉&nbsp; Function 2: kitchen Cleaner</div>\r\n<div dir=\"auto\">👉&nbsp; Function 3: Drain Snake</div>\r\n<div dir=\"auto\">👉&nbsp; Function 4: Drain Unblocker</div>\r\n<div dir=\"auto\">👉&nbsp; Function 5: Dip Clogging</div>\r\n<div dir=\"auto\">👉&nbsp; Function 6: Clean The Drain</div>', 470, 350, 'SA-98', 0, 0, 1, '2022-10-06 02:48:25', '2022-10-06 02:48:25'),
(486, 4, 'Hot Powerful Sink Drain Cleaner', 'hot-powerful-sink-drain-cleaner', '<p><strong>Hot Powerful Sink Drain Cleaner</strong></p>\r\n<p>বেসিন, সিঙ্ক বা পাইপ লাইনে ময়লা জমে ব্লক হলে কার্যকরী সমাধান নিয়ে নিন।</p>\r\n<p>✅ ব্যাবহারের নিয়মঃ</p>\r\n<p>বেসিন বা সিংক থেকে পানি সরিয়ে দিন। বেসিন বা সিংক এর মুখে 50 গ্রাম এর মতো পাউডার ঢেলে দিন। এরপরে বেসিন বা সিংক এর মুখে হালকা গরম পানি ঢেলে দিন। এরপর 15-20 মিনিট অপেক্ষা করুন। এরপর বেশি করে পান দিয়ে ধুয়ে ফেলুন। প্রয়োজনে কয়েকবার ব্যবহার করুন।</p>', 540, 390, 'SA-99', 0, 0, 1, '2022-10-06 03:02:55', '2022-10-06 03:02:55'),
(487, 4, 'Mini Water Purifier & Filter', 'mini-water-purifier-and-filter', '<p><strong>Mini Water Purifier &amp; Filter</strong></p>\r\n<div dir=\"auto\">👉 এখন পানি ফিল্টার হবে ট্যাপ কলেই !</div>\r\n<div dir=\"auto\">👉 এতে আছে মেডিক্যাল রক যা পানির ময়লাকে চুম্বকের মতো টেনে নিয়ে পানিকে পরিষ্কার ও জীবাণুমুক্ত করে</div>\r\n<div dir=\"auto\">👉 ৩ স্তর বিশিষ্ট ফিল্টার ব্যবস্থা</div>\r\n<div dir=\"auto\">👉 বাসা বাড়ির রান্নাঘর/ বেসিন/ ওয়াশরুম এর ট্যাপ কলে</div>\r\n<div dir=\"auto\">👉 সহজেই স্থাপনযোগ্য</div>', 380, 290, 'SA-100', 0, 0, 1, '2022-10-06 03:37:19', '2022-10-06 03:37:19'),
(488, 4, 'Silicon Pot Cover', 'silicon-pot-cover', '<h1 class=\"product-name\">Silicon Pot Cover</h1>\r\n<ul class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.7485E4fRE4fRF6\">\r\n<li class=\"\">Silicon Food Cover Set of 6 pcs Can be stretched to suit a variety of different sizes.</li>\r\n<li class=\"\">Silicone material.BPA Free and reusable.</li>\r\n<li class=\"\">Can be used in microwave or refrigerators. Keep food fresh.</li>\r\n<li class=\"\">Strong adsorption,leak-proof.</li>\r\n<li class=\"\">Material : Food Grade Silicone</li>\r\n<li class=\"\">Size : Approx. Diam 19/15.5/13.5/11/9/6.5cm</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i2.7485E4fRE4fRF6\">Color : Multicolor</li>\r\n<li class=\"\">Packing: 6Pcs/set Silicone Stretch Lids</li>\r\n</ul>', 520, 400, 'SA-101', 0, 0, 1, '2022-10-06 03:55:28', '2022-10-06 03:55:28'),
(489, 6, 'Magic Silicon Hand Gloves', 'magic-silicon-hand-gloves', '<p>Magic Silicon Dish Washing Gloves.</p>\r\n<p>Material: rubber and latex</p>\r\n<p>Advantages: Resistant, flexible, unbreakable</p>\r\n<p>Origin: Malasiya</p>\r\n<p>Color: purple, Blue,sky blue</p>\r\n<p>&radic; গ্লাভসটি আপনার হাত ও হাতের আঙ্গুল রক্ষা করবে .</p>\r\n<p>&radic; এটি থালাবাসন ধোবার সময় হাতে এক্সট্রা গ্রিপ আনে ফলে থালাবাসন হাত থেকে পড়ে ভেঙ্গে যাওয়ার সম্ভবনা কমে যায়</p>\r\n<p>&radic; সাবান, ভিম ও কাপড় কাঁচা ডিটারজেন্টে থাকা ক্ষতিকারক ক্যামিকেল হতে আপনার হাতকে রক্ষা করে</p>\r\n<p>&radic; ঘর ধোয়া ও মোছার সময় হাতকে দিবে সুরক্ষা</p>\r\n<p>&radic; ওয়াশরুম, টয়লেট ক্লিন ইত্যাদি কাজেও হাতকে দিবে সুরক্ষা</p>\r\n<p>&radic; তাই আপনার হাতের সুরক্ষা, রান্নাবান্না ও কাপড়ধোয়ার সময় ব্যবহার করুন</p>', 370, 290, 'SA-102', 0, 0, 1, '2022-10-06 04:06:52', '2022-10-06 04:06:52'),
(490, 6, 'Manual Fruits Juicer', 'manual-fruits-juicer', '<p><strong>Manual Fruits Juicer</strong></p>\r\n<p><strong>পন্যের বিবরণ=</strong></p>\r\n<p>👉&nbsp;ম্যানুয়াল জুস মেকার</p>\r\n<p>👉 এখন এই হ্যান্ডি জুস মেকার এর সাহায্যে ঘরেই তৈরি করুন বিভিন্ন ফলের জুস</p>\r\n<p>👉 এটা চালাতে বিদ্যুৎ লাগে না</p>\r\n<p>👉 যেকোনো জুস তৈরি করতে ব্যবহার করতে পারবে</p>', 1200, 990, 'SA-103', 0, 0, 1, '2022-10-06 13:07:08', '2022-10-06 13:07:08'),
(491, 1, 'Wooden Ruti Maker', 'wooden-ruti-maker', '<p><strong>Wooden Ruti Maker</strong></p>\r\n<p>উডেন রুটি মেকার</p>\r\n<p>রুটি তৈরীর সহজ সমাধান। উডেন রুটি মেকারের সাহায্যে সিদ্ধ আটার<br />রুটি, কাচা আটার রুটি, লাল আটার রুটি, চালের আটার রুটি ও পরাটা তৈরী করা যায়।</p>\r\n<p>কার্যকারিতাঃ</p>\r\n<ul>\r\n<li>এ রুটি মেকার দিয়ে প্রায় 8.5&rdquo;-9&rdquo; রুটি তৈরি করা যায়।</li>\r\n<li>উডেন রুটি মেকার বিদ্যুৎ বিহীন পরিবেশ বান্ধব কাঠের তৈরি আধুনিক রুটি মেকার।</li>\r\n<li>এ রুটি মেকার দিয়ে প্রতি মিনিটে 15 টিরও বেশি রুটি বানাতে পারবেন।</li>\r\n<li>সকল প্রকার রুটি বানানো যায়। যেমনঃ বড় মাঝারি, ছোট, আটা, ময়দা, চাল, কলাই, সমুচা, সিংগারা, ফুচকা, পাপর, এবং দেশী-বিদেশী সকল প্রকার রেসিপির রুটি বানানো যায়।</li>\r\n<li>আপনি অল্প পরিশ্রমে অনেক বেশি রুটি বানাতে পারবেন।</li>\r\n<li>এই রুটি মেকার বাংলাদেশে তৈরি.</li>\r\n<li>এই রুটি মেকার অন্তত 8/10 বছর ব্যবহার করতে পারবেন।</li>\r\n</ul>', 1850, 1390, 'SA-104', 0, 0, 1, '2022-10-06 13:24:17', '2022-10-06 13:24:17'),
(492, 4, 'Nicher Dicer Plus', 'nicher-dicer-plus', '<p><strong>Nicher Dicer Plus</strong></p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> </strong>মাল্টি ফাংশন নাইসার ডাইসার প্লাস এর সাহায্যে আপনি রান্নাঘরের শাকসবজি, ফলমূল কাটা, স্লাইস করতে পারবেন।</p>\r\n<p><strong>প্রডাক্ট ডিটেলসঃ</strong></p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> </strong>সহজে নিজে নিজে ব্যবহার করা যায়।</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /></strong> সেফ ম্যাটেরিয়ালে তৈরী তাই আপনার হাত এবং ত্বকের জন্য নিরাপদ।</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> &nbsp;</strong>ব্যবহার করার জন্য প্যাকিং এর সাথে দেওয়া ইউজার ম্যানুয়াল দেখে করতে পারবেন</p>\r\n<p><strong>প্যাকেজে যা রয়েছে</strong></p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /></strong> ১টি ট্রান্সপারেন্ট ফুড বক্স, ৪টি ব্লেডের সেট ও ১টি ফুড ক্যাপচার টুল।</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> </strong>এই সেটে রয়েছে ১টি কাটিং টপ পিন গ্রিড।</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> </strong>১টি কভার কন্টেইনার।</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /></strong> ১টি ট্রান্সপারেন্ট কালেক্টর (ক্যাপাসিটি ১৫০০ মিলি.)</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> &nbsp;</strong>১টি ব্লেড অ্যাসেম্বলি।&nbsp;</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> &nbsp;</strong>১টি knife for quarters or eighths</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;</strong> ১টি প্লাগ কাটিং পাঞ্চ।</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> &nbsp;</strong>১টি সকল ব্লেড রাখার জন্য পার্ট কভার।</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;</strong> ১টি প্রোফেশনাল পিলার।</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> &nbsp;</strong>অরজিনাল প্রডাক্ট।</p>\r\n<p>&nbsp;</p>', 870, 690, 'SA-105', 0, 0, 1, '2022-10-06 13:48:32', '2022-10-06 13:48:32'),
(414, 4, 'Dancing Talking Cactus Plush Toy', 'dancing-talking-cactus-plush-toy', '<p>Dancing Talking Cactus Plush Toy</p>\r\n<p>বাচ্চাদের কান্না থামানোর জন্য আর কথা শিখানোর জন্য অনেক উপকারী একটা খেলনা</p>\r\n<p>✔️ কথা রিপিট করে</p>\r\n<p>✔️ ডান্স করে</p>\r\n<p>✔️ গান গায়</p>\r\n<p>শিশু বয়সে বাচ্চারা অনুকরণ করতে পছন্দ করে, শিশুমনে সে নিজের কানে যা শুনতে পায়, চোখে যা দেখতে পায় তাই অনুকরণ করে আনন্দ পায়</p>\r\n<p>👉 আপনি যা বলবেন তাই রিপিট করবে। খুবই আকর্ষনীয় একটা প্রোডাক্ট। বাচ্চাদের কান্না থামানোর জন্য আর কথা শিখানোর জন্য অনেক উপকারী একটা খেলনা! আপনার বাবুর জন্য এর চেয়ে মজার কিছু হতে পারে না, যা বলবে তা রিপিট করবে সাথে ডান্স,মিউজিক, লাইটিং ফ্রি তাই আজই আপনার বেবির জন্য অর্ডার করে ফেলুন। বেবীদের একা একা থাকার দিন শেষ।</p>\r\n<p>✅ Rechargeable ১ বার চার্জ করে বার বার ব্যবহার করতে পারবেন</p>\r\n<p>✅ এইটাতে আছে Voice Repeater,আপনি যা বলবেন, সেটাই Repeat করবে।</p>\r\n<p>✅ আর সুন্দর Lighting তো আছেই।</p>\r\n<p>&nbsp;</p>', 1200, 900, 'SA-28', 0, 0, 1, '2022-10-02 20:40:22', '2022-10-02 20:40:22'),
(579, 4, 'Original Men Anti-theft Waterproof Crossbody Bag', 'original-men-anti-theft-waterproof-crossbody-bag', '<h1 class=\"mb-2 fs-20 fw-600\">Original Men Anti-theft Waterproof Crossbody Bag</h1>\r\n<ul>\r\n<li><span data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i1.5b265e44ef5qKj\">Lining Material：Polyester</span></li>\r\n<li>\r\n<div data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i2.5b265e44ef5qKj\">Hardness：HARD</div>\r\n</li>\r\n<li>\r\n<div data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i3.5b265e44ef5qKj\">Pattern Type：Solid</div>\r\n</li>\r\n<li>\r\n<div data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i4.5b265e44ef5qKj\">Exterior：Silt Pocket</div>\r\n</li>\r\n<li>\r\n<div data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i5.5b265e44ef5qKj\">Closure Type：zipper</div>\r\n</li>\r\n<li>\r\n<div data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i6.5b265e44ef5qKj\">Gender：MEN</div>\r\n</li>\r\n<li>\r\n<div data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i7.5b265e44ef5qKj\">Style：Casual</div>\r\n</li>\r\n<li>\r\n<div data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i8.5b265e44ef5qKj\">bag for man：chest bag</div>\r\n</li>\r\n<li>\r\n<div data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i9.5b265e44ef5qKj\">men bag：crossbody bag</div>\r\n</li>\r\n<li><span data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i1.5b265e44ef5qKj\">100% waterproof</span></li>\r\n<li><span data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i1.5b265e44ef5qKj\">Zipper Lock System</span></li>\r\n<li><span data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i1.5b265e44ef5qKj\">Size : 32cm x 16cm x 6cm</span></li>\r\n<li><span data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i1.5b265e44ef5qKj\">Original China product</span></li>\r\n</ul>', 1390, 1090, 'SA-190', 1, 189, 1, '2022-10-28 22:11:36', '2023-03-31 15:41:28'),
(578, 6, '52 in 1 Tools Box', '52-in-1-tools-box', '<h1 class=\"product-name\">52 in 1 Tools Box - Yellow and Black</h1>\r\n<ul class=\"\">\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.232348e64LLoOH\">Available for the repairing</li>\r\n<li class=\"\">Different kinds of bits can satisfy different demands</li>\r\n<li class=\"\">There is a small box inside</li>\r\n<li class=\"\">Convenient to store screws and other accessories</li>\r\n<li class=\"\">The bits were made of CR-V after quenching treatment with HRC 50 - 52 degrees hardness</li>\r\n<li class=\"\">52 in 1 is a multi functional high quality hardware tools, this set contains two sets of professional screwdrivers, It has a handle to extend the length of the screwdriver and the screws have a flexible handle to open and close accessible spaces.</li>\r\n</ul>', 1299, 999, 'SA-189', 0, 0, 1, '2022-10-21 18:43:26', '2022-10-21 18:43:26'),
(577, 4, 'V380 Wi-Fi Camera 360 Degree Camera', 'v380-wi-fi-camera-360-degree-camera', '<p><strong>V380 Wi-Fi IP Smart Net Camera</strong></p>\r\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s\">\r\n<div dir=\"auto\">বেস্ট রিভিউ প্রোডাক্ট</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>Full HD quality</div>\r\n<div dir=\"auto\">Latest version</div>\r\n<div dir=\"auto\">️64 GB memory card support</div>\r\n<div dir=\"auto\">2 way communication</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>Wireless, direct through wifi connect</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>Human trafficking</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>notification</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>আপনার দোকান, অফিস, বাসা-বাড়িকে নিরাপদ রাখতে 360&deg; WiFi IP ক্যামেরাটি অর্ডার করুন।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>ক্যামেরাটি বাসা, অফিস, দোকানে খুব সহজে আপনি নিজেই সেট করে নিতে পারবেন। ক্যামেরাটি সেট করার জন্য ক্যামেরাটির সাথে রয়েছে ষ্ট্যান্ড, স্ক্র, রয়েল প্লাগ, পাওয়ার এডাপ্টারসহ ক্যাবল।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>এছাড়াও ক্যামেরাটিতে নিজস্ব স্পিকার আছে। যার ফলে আশে পাশে ৫-১০ মিটার মধ্যে কে কি বলছে তা শুনতে পারবেন। চাইলে আপনি স্পিকারে কথা বলতে পারবেন। ঘোর অন্ধকারে দেখার জন্য ক্যামেরাটিতে রয়েছে অটো Night Vision সুবিধা। Micro SD কার্ড এর মাধমে রেকর্ড করা যায়। সর্বোচ্চ 64 জিবি মেমোরি কার্ড সাপোর্ট করবে।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>ক্যামেরাটি আপনি ইন্টারনেট ছাড়া ব্যবহার করতে পারবেন। ক্যামেরাটির নিজস্ব ওয়াইফাই আছে। সেক্ষেত্রে ক্যামেরাটি আপনি যেখানে সেট করবেন তার আশেপাশে ১০০ ফিটের মধ্যে স্মার্ট ফোনের মাধ্যমে লাইভ দেখতে পাবেন।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>আর যদি আপনার WiFi কানেকশন থাকে তাহলে পৃথিবীর যে কোন প্রান্ত থেকে লাইভ দেখতে পারবেন।</div>\r\n</div>', 1850, 1590, 'SA-188', 0, 0, 1, '2022-10-21 18:24:16', '2022-10-21 18:24:16'),
