"none\"><strong>👉</strong> রঙ: গোলাপী, হলুদ, নীল</div>\r\n<div class=\"x1yc453h x126k92a x6prxxf x1fc57z9 x14ctfv\" dir=\"auto\" role=\"none\"><strong>👉 </strong>৫ মাস থেকে&nbsp; ১৮&nbsp;মাসের বাচ্চাদের ব্যবহারের জন্যে।</div>\r\n<div class=\"x1yc453h x126k92a x6prxxf x1fc57z9 x14ctfv\" dir=\"auto\" role=\"none\"><strong>👉 </strong>&nbsp;এটা এতটাই ছোট যে সহজে বহনযোগ্য।</div>\r\n<div class=\"x1yc453h x126k92a x6prxxf x1fc57z9 x14ctfv\" dir=\"auto\" role=\"none\"><strong>👉</strong>&nbsp;আপনার ব্যবহারের উপর নির্ভর করে ২/৩ মাস পর পর নিপলটা বদলা পারেন।</div>\r\n<div class=\"x1yc453h x126k92a x6prxxf x1fc57z9 x14ctfv\" dir=\"auto\" role=\"none\"><strong>👉</strong>&nbsp;ঢাকনাযুক্ত একটি প্যাসিফায়ার পাবেন।</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 290, 220, 'SA-179', 0, 0, 1, '2022-10-15 10:25:48', '2022-10-15 10:25:48'),
(565, 7, 'GPS Tracker & Sim Device', 'gps-tracker-and-sim-device', '<div class=\"xdj266r x11i5rnm xat24cr x1mh8g0r x1vvkbs x126k92a\">\r\n<div dir=\"auto\"><strong>GPS Tracker &amp; Sim Device</strong></div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n</div>\r\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">\r\n<div dir=\"auto\">👉&nbsp;সিম ডিভাইস। সিম ইন্সটল করে যেখানেই রেখে যাবেন সেখান থেকে সব কিছু শুনতে পারবেন একটা কল এর মাধ্যমেই !!!!</div>\r\n<div dir=\"auto\">👉&nbsp;GPS Tracker দিয়ে জেনে নিতে পারবেন আপনার গাড়িটি কোথায় আছে।</div>\r\n<div dir=\"auto\">👉&nbsp;মাইক্রোবাস, সিএনজি, টমটম, মোটরবাইক, ট্রাক ইত্যাদিতে। হারিয়ে গেলে বা চুরি হলেও জানতে পারবেন গাড়ির লোকেশন।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">&nbsp;<strong>ব্যবহারবিধিঃ</strong></div>\r\n<div dir=\"auto\">👉 আপনার মোবাইল ফোনে GP, Airtel, Robi অথবা Banglalink সিম যুক্ত করে অ্যাকটিভ করুন।</div>\r\n<div dir=\"auto\">👉 লোকেশন দেখার জন্য মোবাইল ফোন থেকে &rdquo; DW&rdquo; লিখে SMS করতে হবে। রিটার্ন SMS এ Google Map এর একটি লিংক আসবে। এবার মোবাইলে ইন্টারনেট সংযোগ সচল করুন এবং লিংকে যান। লিংকে Google Map এর মতই আসবে লোকেশন। এভাবেই ট্র্যাক করতে পারবেন আপনার গাড়ি বা যেকোন পরিবহন।</div>\r\n</div>', 980, 750, 'SA-177', 0, 0, 1, '2022-10-12 06:11:30', '2022-10-12 06:11:30');
