(564, 7, 'PTZ Bulb System 360 Degree WiFi Panorama IP Camera', 'ptz-bulb-system-360-degree-wifi-panorama-ip-camera', '<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">\r\n<div dir=\"auto\">\r\n<h4 id=\"gridSystemModalLabel\" class=\"modal-title see-title\">PTZ Bulb System 360 Degree WiFi Panorama IP Camera</h4>\r\n</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">আমাদের Bulb Light Wi-Fi Robot Camera সেটআপ করা খুবই সহজ, তাই মিস্ত্রি খরচ বাচব। যে কেউ এটা সহজেই সেটাপ করতে পারবে।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" width=\"16\" height=\"16\" /></span> লাইটের হোল্ডারে সহজেই লাগানো যায় এই ক্যামেরা তাই আলাদাভাবে বিদ্যুৎ সংযোগের জন্য তার কাটাছেড়া করতে হয় না।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" width=\"16\" height=\"16\" /></span> Wifi এর সাথে Bulb Light Wi-Fi Robot Camera কানেক্ট করে দেশের যেকোন স্থানে অথবা দেশের বাহিরে বসে নজর রাখতে পারবেন।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" width=\"16\" height=\"16\" /></span> ক্যামেরাটিতে ১৫ দিন পর্যন্ত রেকর্ডিং সেভ থাকবে।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" width=\"16\" height=\"16\" /></span> ৬৪ জিবি পর্যন্ত মেমোরি সাপোর্ট করে।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/