714.png\" alt=\"✔️\" width=\"16\" height=\"16\" /></span> আমাদের এই Bulb Light Wi-Fi Robot Camera just buy and ready to use camera।</div>\r\n</div>\r\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">\r\n<div dir=\"auto\">আমাদের এই ক্যামেরা সেটআপের জন্য কোন মিস্ত্রি বা কোন সেটাপ বক্স কোন কিছুই প্রয়োজন হয় না সরাসরি কিনবেন লাইট হোল্ডারে সেট করবেন ওয়াইফাই কানেক্ট করবেন ব্যাস হয়ে গেল সেটআপ এবার ব্যবহার করবেন।</div>\r\n</div>', 1950, 1590, 'SA-176', 0, 0, 1, '2022-10-11 10:16:57', '2022-10-11 10:16:57'),
(562, 6, 'Waterproof Pouch Case Laptop Sleeve Bag', 'waterproof-pouch-case-laptop-sleeve-bag', '<h4 id=\"gridSystemModalLabel\" class=\"modal-title see-title\">Waterproof Pouch Case Laptop Sleeve Bag</h4>\r\n<p>ওয়াটারপ্রুফ ল্যাপটপ ব্যাগ যা আমাদের কর্মজীবীদের জন্য নিত্য দিনের সঙ্গী ۔۔যারা ভারী ব্যাগ নিয়ে ঘুরতে পছন্দ করেননা তাদের জন্য অনেক উপকারী&nbsp;</p>\r\n<p>বৃষ্টির দিনে আর ল্যাপটপ নিতে ভয় নাই, নিশ্চিন্তে নিতে পারেন যেখানে সেখানে ۔۔۔</p>\r\n<p>এই ব্যাগ এ আপনি ল্যাপটপ ,মাউস,চার্জার নিতে পারবেন খুব সহজে।</p>\r\n<p><strong>Product Details</strong></p>\r\n<p>👉 Material: Polyester + fiber</p>\r\n<p>👉 Size: 15.6\"</p>\r\n<p>👉 Weight: 0.25KG&nbsp;</p>\r\n<p>👉 Color: Grey</p>\r\n<p>👉 Internal Structure: 1 zipper pocket</p>\r\n<p>👉 Packaging: 1 piece/ OPP Bag</p>', 890, 750, 'SA-174', 0, 0, 1, '2022-10-11 05:43:33', '2022-10-11 05:43:33'),
(563, 7, '56\" LED Indoor Outdoor Solar Power Sensor Light', '-56\"-led-indoor-outdoor-solar-power-sensor-light', '<p><strong>56\" LED Indoor Outdoor Solar Power Sensor Light</strong></p>\r\n<p>👉 সূর্যের আলোতে এবার আপনার বাসা, অফিস, বারান্দা, বাগান, সিড়ি, খামার, আলোকিত হবে।</p>\r\n<p>👉&nbsp; সৌরশক্তি দ্বারা চালিত তাই কোন বিদ্যুতের প্রয়োজন নেই।</p>\r\n<p>👉&nbsp; দিনর আলোতে লাইট অফ থাকবে কিন্তু অন্ধকার হওয়ার সাথে সাথে আলো জ্বলে উঠবে।</p>\r\n<p>👉&nbsp; মোশন সেন্সর দেয়া আছে তাই মানুষ লাইটের ১৫ ফিটের মধ্যে আশা মাত্রই লাইটি অটোমেটিক জ্বলে উঠবে।</p>\r\n<p>👉&nbsp;দীর্ঘ জীবন এবং শক্তিশালী স্থায়িত্ত।</p>\r\n<p>👉 1 Year ওয়ারেন্টি।</p>\r\n<p>👉&nbsp;সৌর পেনেল বাসার ছাদে বা দেয়ালে স্থাপন করতে পারবেন।</p>\r\n<p>👉&nbsp;সৌর পেনেলের সাথে ১৬ ফুট তার দেয়া থাকবে।</p>\r\n<p>👉&nbsp;সৌর পেনেল ও সোলার লাইট দেয়ালে ফিট করার জন্য ৮ পিস স্ক্রু এবং ৮ পিস রয়েল প্লাগ দেয়া থাকবে।</p>\r\n<p>👉&nbsp;ইন্সটল করা একেবারেই সহজ।</p>', 1200, 990, 'SA-175', 0, 0, 1, '2022-10-11 10:05:42', '2022-10-11 10:05:42'),
(495, 4, 'Kitchen Shop Dispensing Palm Brush', 'kitchen-shop-dispensing-palm-brush', '<div class=\"product-desc-tab bg-white\">\r\n<div class=\"tabs tabs--style-2\">\r\n<div class=\"tab-content pt-0\">\r\n<div id=\"tab_default_1\" class=\"tab-pane active show\">\r\n<div class=\"py-2 px-4\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<div class=\"mw-100 overflow--hidden\">\r\n<p><strong>Kitchen Shop Dispensing Palm Brush&nbsp; </strong>&nbsp;</p>\r\n<p>👉 ব্র্যান্ড নতুন এবং উচ্চ মানের ব্রাশ।</p>\r\n<p>👉&nbsp;প্লাস্টিক ডিজাইন, এটি ব্যবহার করা সহজ এবং সুবিধাজনক।</p>\r\n<p>👉&nbsp;সহজেই থালা ,বাটি ,পাতিলের ময়লা ও পোড়া দাগ তোলা যায়।</p>\r\n<p>👉&nbsp;ব্রাশের উপরে ডিশ ওয়াশিং তরল রাখুন এবং চাপুন।</p>\r\n<p>👉&nbsp;ডিশ ওয়াশিং তরল শেষ হলে বার বার রিফিল করা যায়।</p>\r\n<p>👉&nbsp;ঘরের বিভিন্ন ওয়াশিং কাজে ব্যবহার করা যায়</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"my-2 bg-white\">\r\n<div class=\"section-title-1 clearfix p-2\">&nbsp;</div>\r\n</div>', 500, 390, 'SA-108', 0, 0, 1, '2022-10-06 15:20:24', '2022-10-06 15:20:24'),
(496, 4, 'Hanging Scale', 'hanging-scale', '<p><strong>Hanging Scale:</strong></p>\r\n<p>বাসা,অফিস বা দোকান,বাজার সব জায়গায় সুক্ষ পরিমাপ করার জন্য হাঙ্গিং স্কেল টি বেস্ট পরিমাপক। ১০ গ্রাম হতে ৫০ কেজি পর্যন্ত ওজন মাপা যাবে।</p>\r\n<p>কার্যকারিতাঃ</p>\r\n<ul>\r\n<li><span class=\"text_exposed_show\">ডিজিটাল স্কেল হওয়ায় পরিমাপ সঠিক হয়।</span></li>\r\n<li><span class=\"text_exposed_show\">সুক্ষ পরিমাপ করার জন্য এটি খুবই উপযোগী।</span></li>\r\n<li><span class=\"text_exposed_show\">বাসা,অফিস বা দোকানের দ্রব্যাদির মাপামাপির জন্য বেশ কার্যকরী।</span></li>\r\n<li><span class=\"text_exposed_show\">স্কুল-কলেজ ও ল্যাবরেটরিতে এটার ব্যবহার অপরিসীম।<span class=\"_4ay8 _3kkw\">&zwj;</span></span></li>\r\n<li><span class=\"text_exposed_show\">মাছ-মাংস,ফলমূলসহ প্রয়োজনীয় সবকিছুই মাপা যায়।</span></li>\r\n<li><span class=\"text_exposed_show\">কোরবানির মাংস সঠিকভাবে মাপার জন্য এটা অনেক প্রয়োজনীয়।</span></li>\r\n<li><span class=\"text_exposed_show\">খালি পাত্রের ওজনকে শুন্য করে নেয়া যাবে।</span></li>\r\n<li><span class=\"text_exposed_show\">গ্রাম/আউন্স/পাউন্ডে মাপতে পারবেন।</span></li>\r\n<li><span class=\"text_exposed_show\">পরিমাপ করার সেন্সরটি খুবই উন্নতমানের।</span></li>\r\n<li><span class=\"text_exposed_show\">মাত্র ২টি পেন্সিল (AAA সাইজের) ব্যাটারীতে চলে।</span></li>\r\n<li><span class=\"text_exposed_show\">LCD ডিসপ্লে, উচ্চক্ষমতা সম্পন্ন সেন্সর এবং ABS প্লাস্টিক দিয়ে তৈরী।</span></li>\r\n<li><span class=\"text_exposed_show\">স্কেলের উপর On/Off,Mode,Tare ৩ টি Button আছে।</span></li>\r\n<li><span class=\"text_exposed_show\">Automatic Switch Off সিস্টেম আছে।</span></li>\r\n</ul>', 600, 490, 'SA-109', 0, 0, 1, '2022-10-06 15:55:50', '2022-10-06 15:55:50'),
(497, 7, 'Electric Egg Bitter & Hand Mixer', 'electric-egg-bitter-and-hand-mixer', '<p><strong>Electric Egg Bitter &amp; Hand Mixer.</strong></p>\r\n<p>আটা,ময়দা,ডিম,ও কেক বানানোর উপকরন সহ সব কিছুর মিশ্রন এখন খুব সহজেই Hand mixer দিয়ে বানানো যাবে।</p>\r\n<ul>\r\n<li>ইলেকট্রিক এগ বিটার এন্ড মিক্সার ।</li>\r\n<li>৪ টি আলাদা বিটার হুক আছে ।</li>\r\n<li>7 টি স্পীডে&nbsp;চালানো যায় ।</li>\r\n<li>স্টেইনলেস স্টিল হুক।</li>\r\n<li>এটা চালানো খুবই সহজ।&nbsp;</li>\r\n<li>সহজে পরিষ্কার করা যায়।</li>\r\n<li>হুক বাটনে ১ বার চাপ দিলে সব হুক গুলো খোলা যায়।</li>\r\n<li>যে কোন কিছু ব্লেন্ডিং-এর জন্য উপযুক্ত।</li>\r\n</ul>', 1050, 850, 'SA-110', 0, 0, 1, '2022-10-06 17:39:05', '2022-10-06 17:39:05'),
(498, 6, 'Green Tea Mask Stick', 'green-tea-mask-stick', '<p><strong>Green Tea Mask Stick</strong></p>\r\n<p>🟢 হাই ডিমান্ডিং একটি প্রোডাক্ট যা ব্যাবহারের ফলে ত্বক অনেক বেশি চেঞ্জ আসে এবং গ্লো করে।</p>\r\n<p>✅ তৈলাক্ত ভাব দূর করবে</p>\r\n<p>✅ Green Tea উপাদান থাকার কারনে ত্বকের ৯৫% ব্রণের ও অন্যান্য কালো দাগ দূর করে 💯</p>\r\n<p>✅ ত্বকের পোরস থেকে ময়লা পরিষ্কার করে ফেলে</p>\r\n<p>✅ ব্রণ থেকে মুক্তি দেয় 💯</p>\r\n<p>✅ ত্বকের কালচে ভাব দূর করবে</p>\r\n<p>✅ ময়লা পরিষ্কার করবে 💯</p>\r\n<p>✅ ত্বক গ্লো করবে ও উজ্জ্বল হবে</p>\r\n<p>✅ ব্যাবহারের নিয়মঃ</p>\r\n<p>♻️ প্রথমে মুখ ফেস ওয়াস দিয়ে ধুয়ে নিন</p>\r\n<p>♻️ তারপর মুখ শুকিয়ে গেলে মাস্ক মুখে লাগিয়ে ১৫-২০ মিনিট রাখুন</p>\r\n<p>♻️ মাস্ক শুকিয়ে গেলে পরিষ্কার পানি দিয়ে মুখ ধুয়ে ফেলুন</p>', 500, 390, 'SA-111', 0, 0, 1, '2022-10-06 17:42:27', '2022-10-27 06:31:40'),
(499, 4, 'Liquid Dish Washing Brush', 'liquid-dish-washing-brush', '<p><strong>Liquid Dish Washing Brush</strong></p>\r\n<ul>\r\n<li>ব্র্যান্ড নতুন এবং উচ্চ মানের ব্রাশ।</li>\r\n<li>প্লাস্টিক ডিজাইন, এটি ব্যবহার করা সহজ এবং সুবিধাজনক।</li>\r\n<li>সহজেই থালা ,বাটি ,পাতিলের ময়লা ও পোড়া দাগ তোলা যায়।</li>\r\n<li>ব্রাশের উপরে ডিশ ওয়াশিং তরল রাখুন এবং চাপুন।</li>\r\n<li>ডিশ ওয়াশিং তরল শেষ হলে বার বার রিফিল করা যায়।</li>\r\n<li>ঘরের বিভিন্ন ওয়াশিং কাজে ব্যবহার করা যায়।</li>\r\n<li>বিভিন্ন রঙের হয়।</li>\r\n<li>সাইজঃ 8.5cm*6.5cm/3.35\'\'*2.56\'\'(approx)</li>\r\n<li>Material: প্লাস্টিক।</li>\r\n</ul>', 250, 180, 'SA-112', 0, 0, 1, '2022-10-06 17:53:45', '2022-10-06 17:53:45'),
(500, 7, 'Blood Pressure Wrist Monitor 102-S', 'blood-pressure-wrist-monitor-102-s', '<div class=\"html-content pdp-product-highlights\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.127awsgTwsgTnV\">\r\n<h1 class=\"product-name\">Blood Pressure Wrist Monitor 102-S</h1>\r\n<ul class=\"\">\r\n<li class=\"\">1. Compact and lightweight, can be detected at any time</li>\r\n<li class=\"\">2. Free from clothes, more convenient</li>\r\n<li class=\"\">3. HD large screen:LCD high-definition display, even the elderly with poor eyesight, can be clearly visible without worrying about reading</li>\r\n<li class=\"\">display：LCD HD</li>\r\n<li class=\"\">Accuracy: blood pressure &plusmn; 3% heart rate &plusmn; 5%</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\">\r\n<p><strong>Features:</strong></p>\r\n<p>1. Compact and lightweight, can be detected at any time</p>\r\n<p>2. Free from clothes, more convenient</p>\r\n<p>3. HD large screen:LCD high-definition display, even the elderly with poor eyesight, can be clearly visible without worrying about reading</p>\r\n<p><strong>Description:</strong></p>\r\n<p>1.Measure the wrist joint</p>\r\n<p>2. Easy to operate</p>\r\n<p>3. Automated measurement</p>\r\n<p><strong>Specifications:</strong></p>\r\n<p>👉 Display：LCD HD</p>\r\n<p>👉 Accuracy: blood pressure &plusmn; 3% heart rate &plusmn; 5%</p>\r\n<p>👉 Measuring range: blood pressure 0 ~ 280mmHg pulse 40 ~ 199 times / minute</p>\r\n<p>v Color：white</p>\r\n<p>👉 Type：battery</p>\r\n<p>&nbsp;</p>\r\n</div>', 1300, 990, 'SA-113', 0, 0, 1, '2022-10-06 18:22:08', '2022-10-06 18:22:08'),
(501, 4, 'Hand Grip Strengthener', 'hand-grip-strengthener', '<p><strong>Hand Grip Strengthener</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">Place of Origin: Jiangxi, China</li>\r\n<li class=\"\">Model Number: WLQ01</li>\r\n<li class=\"\">Product Name: hand grip</li>\r\n<li class=\"\">Usage: Bodybuilding Fitness</li>\r\n<li class=\"\">Type: Integrated Gym Trainer</li>\r\n<li class=\"\">Color: Black Gray Green</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.10fecyZVcyZVEX\">Function: Body</li>\r\n<li class=\"\">Material: ABS+TPR+ Steel</li>\r\n<li class=\"\">Size: 100x160mm</li>\r\n<li class=\"\">Strength: 10-40kg</li>\r\n</ul>', 370, 290, 'SA-114', 0, 0, 1, '2022-10-06 18:37:44', '2022-10-06 18:37:44'),
(502, 7, 'Digital Weight Machine - Osaka', 'digital-weight-machine-osaka', '<p><strong>Digital Weight Machine - Osaka</strong></p>\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul class=\"\">\r\n<li class=\"\">Capacity: 210kg</li>\r\n<li class=\"\">High-quality product</li>\r\n<li class=\"\">Calculate accurate weight</li>\r\n<li class=\"\">Low power consumption</li>\r\n<li class=\"\">Easy to keep clean</li>\r\n<li class=\"\">Looking so smart product of Camry</li>\r\n<li class=\"\">the battery is easy to buy</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.8a70BamHBamHwv\">Capacity: 210kg High-quality productCalculate accurate weightLow power consumptionEasy to keep cleanLooking so smart product of Camrythe battery is easy to buy</li>\r\n</ul>\r\n</div>', 1180, 950, 'SA-115', 0, 0, 1, '2022-10-06 19:04:24', '2022-10-06 19:04:24'),
(503, 4, 'Silicone Heel Anti Crack Set', 'silicone-heel-anti-crack-set', '<p><strong>Silicone Heel Anti Crack Set</strong></p>\r\n<p><strong> উপকারিতা: </strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> শীত হোক বা গরম, শরীরের পাশাপাশি পায়েরও যত্ন নিতে হয়। কেননা পা ফাটার সমস্যায় প্রায় অনেকেই জর্জরিত, আর এই পা ফাটে অপরিচ্ছন্নতার দরুন। তাই আপনার পায়ের গোড়ালিকে সুরক্ষিত রাখুন।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;পায়ের শক্ত ও মৃত চামড়া দূর করে । </p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;পায়ের সৌন্দর্য বৃদ্ধিতে সাহায্য করে। </p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;সহজেই সুন্দর করুন আপনার সুন্দর পা দুটো। </p>\r\n<p><strong>পন্যের বিবরণ </strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;আইটেমের ধরণ: সিলিকন হিল </p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;উপাদান: সিলিকন </p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;পরিমাণ: 2 pis</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;দেশ : চীন&nbsp;</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> পা পরিষ্কারের পরে হিল টি পরুন&nbsp;</p>\r\n<p>&nbsp;</p>', 370, 250, 'SA-116', 0, 0, 1, '2022-10-06 19:23:22', '2022-10-06 19:23:22'),
(504, 7, 'Cyber Sonic Sound Enhancer Hearing Aid', 'cyber-sonic-sound-enhancer-hearing-aid', '<p><strong>Cyber Sonic Sound Enhancer Hearing Aid&nbsp;</strong></p>\r\n<p><strong>👉 কানে কম শোনা নিয়ে দুশ্চিন্তা আর না,আমরা নিয়ে এসেছি আপনাদের জন্য Cyber Sonic Hearing aid, এটি ডিভাইস কানে শোনার অত্যাধুনিক যন্ত্র। এটি কানে লাগালে অপনি খুব মসৃনভাবে সুনতে পারবেন। আপনি ভলিয়ম কমিয়ে-বাড়িয়ে কানের সাথে এডজাস্ট করে নিতে পারবেন। </strong></p>\r\n<p><strong>👉 এই পন্যটি কেবল মাত্র,যারা কানে কম শুনে তাদের জন্য।তাই এটি হেয়ারিং এইড টি শ্রবন শক্তি হারানো মানুষের জন্য উপযুক্ত, তাই আর দেরী না করে আপনার বয়স্ক মা-বাবা, দাদা-দাদী, নানা-নানী, আত্নীয়- স্বজন এমন সমস্যায় কেউ থাকলেই এনই অর্ডার করে ফেলুন।</strong></p>\r\n<p><strong> 👉 40 ডেসিবেল পর্যন্ত শব্দগুলিকে বাড়াতে পারবেন। ওজন 10 গ্রামের কম 6 ভলিউম স্তর আছে। উভয় কানের সাথে সামঞ্জস্য করতে পারবেন। যারা কানে কম শুনতে পান এই হিয়ারিং এইড ডিভাইসটি তাদের জন্য। </strong></p>\r\n<p><strong>👉 যারা দূরের ফিসফিসানি আলোচনা স্পষ্ট শুনতে চান তাদের জন্য এটি অতুলনীয়। যখন আপনি সিনেমা দেখবেন, খেলা দেখবেন, ক্লাসে থাকবেন অথবা মিটিং এ থাকবেন তখন এই ডিভাইসটি আপনাকে পরিষ্কার শুনতে সাহায্য করবে l</strong></p>\r\n<p><strong>👉&nbsp; সিভিয়ার ও প্রোফাউন্ড হিয়ারিং লসের পেশেন্টদের উপযোগী Amplity sound up to 40 decibelts 8 volumes levels সুপার ইয়ার ওয়্যারলেস লিসেনিং ডিভাইস সাউন্ড ম্যাগনিফিকেশন প্রযুক্তিতে একটি বাস্তব অগ্রগতি; আপনি স্পষ্টভাবে এবং স্বতন্ত্রভাবে উচ্চারিত শব্দ শুনতে পাবেন এটির মাধ্যমে।</strong></p>', 800, 680, 'SA-117', 0, 0, 1, '2022-10-06 19:53:38', '2022-10-06 19:53:38'),
(505, 4, '6PCS Ear Cleaner Set (Buy 1 Get 1 Free)', '6pcs-ear-cleaner-set-buy-1-get-1-free', '<p><strong>6PCS Ear Cleaner Set Stainless Steel With Lather Case</strong></p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /></strong>কান পরিষ্কার করার যন্ত্র, নিরাপদ এবং ব্যথাহীন।</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp; </strong>কান পরিষ্কার করার যন্ত্র, নিরাপদ এবং ব্যথাহীন।এটি উচ্চমানের স্টেইনলেস স্টিলের তৈরি এবং বিশেষভাবে নিরাপদ এবং আরামদায়কভাবে অতিরিক্ত মোম বের করার জন্য ডিজাইন করা হয়েছে।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> কোন পার্শ্ব প্রতিক্রিয়া নাই।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> শিশু থেকে শুরু করে সবাই ব্যবহার করতে পারবে</p>\r\n<ul class=\"\">\r\n<li class=\"\">100% brand new quality</li>\r\n<li class=\"\">Color: Silver</li>\r\n<li class=\"\">Material: Stainless steel</li>\r\n<li class=\"\">Packet Materials: PU Lather</li>\r\n<li class=\"\">The innovative spring earwax cleaning kit is an innovative ear cleaning tool, safe and painless.</li>\r\n<li class=\"\">It is made of high-quality stainless steel and is specifically designed to extract excess wax safely and comfortably.</li>\r\n<li class=\"\">It can prevent damage to ear drums and damage to hearing.</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.622dmgCAmgCAhh\">It has a spiral groove tip, which can reach the perfect distance from the ear and effectively remove earwax.</li>\r\n<li class=\"\">6 pcs ear cleaning kit</li>\r\n</ul>\r\n<p>&nbsp;</p>', 770, 390, 'SA-118', 0, 0, 1, '2022-10-06 20:12:35', '2022-10-21 09:33:52'),
(506, 6, 'Yoga Mat 6mm', 'yoga-mat-6mm', '<h2 class=\"pdp-mod-section-title outer-title\" data-spm-anchor-id=\"a2a0e.pdp.0.i1.393471Fb71FbSs\">Product details of Yoga Mat 6mm -&nbsp;</h2>\r\n<div class=\"pdp-product-detail\" data-spm=\"product_detail\">\r\n<div class=\"pdp-product-desc \">\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul class=\"\">\r\n<li class=\"\">Model: Eco Friendly</li>\r\n<li class=\"\">Yoga Mat</li>\r\n<li class=\"\">Color: Purple, Blue, Pink &amp; Orange</li>\r\n<li class=\"\">Thickness: 8mm</li>\r\n<li class=\"\">Lenth: 72inch</li>\r\n<li class=\"\">Weight: 24inch</li>\r\n<li class=\"\">Provide stability, add balance</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.393471Fb71FbSs\">Textured surface for non-slip grip</li>\r\n<li class=\"\">Portable, lightweight</li>\r\n<li class=\"\">Eco-friendly, easy to clean</li>\r\n<li class=\"\">Excellent cushioning</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>', 950, 790, 'SA-119', 0, 0, 1, '2022-10-07 06:23:50', '2022-10-07 06:23:50'),
(507, 7, 'Double Heads Body Massager with Vibration and Heat', 'double-heads-body-massager-with-vibration-and-heat', '<p><strong>Double Heads Body Massager with Vibration and Heat</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">যেকোনো ব্যথা থেকে মুক্তি মাত্র ৫ মিনিটের মধ্যে।</li>\r\n<li class=\"\">High quality plastic material, durable and non-toxic substances.</li>\r\n<li class=\"\">Strong motor, equipped with superior motor, morepowerful for daily use.</li>\r\n<li class=\"\">stepless speed regulation, vibration speed can be adjustedseparately.</li>\r\n<li class=\"\">High-frequency vibration can crush quickly</li>\r\n<li class=\"\">Fat and Low Frequency Vibration relaxes muscles andeliminates fatigue.</li>\r\n<li class=\"\">The use of infrared technology, effectively stimulates blood circulation.Circulation and metabolism.</li>\r\n<li class=\"\">The kit includes two massage heads to suit your different massageneeds.</li>\r\n<li class=\"\">Portable and lightweight, slimming home,work, outdoors, traveling.</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.4f57BpIIBpII97\">Can be used on the legs, waist, neck, shoulders, arms,hips, hips and calves.</li>\r\n<li class=\"\">Material: Plastic</li>\r\n<li class=\"\">Voltage: 220-250 v</li>\r\n<li class=\"\">Package Dimensions: 47.5 * 17.5 * 16.0 cm / 18.7 * 6.9 * 6.3 inches</li>\r\n<li class=\"\">Package Weight: Approx.1470 g</li>\r\n</ul>', 2050, 1750, 'SA-120', 0, 0, 1, '2022-10-07 06:38:19', '2022-10-07 06:38:19'),
(508, 4, 'Small Octopus Facial Cleaner', 'small-octopus-facial-cleaner', '<p><strong>Small Octopus Facial Cleaner</strong></p>\r\n<p>👉 এই Cleanser Brush এর মাধ্যমে ত্বকের whiteheads, Blackheads, পোরস, ত্বকের মৃত কোষ পরিস্কার এবং মেকাপ রিমোভ করা যায় খুব সহজেই।</p>\r\n<p><strong>ব্যবহারবিধিঃ </strong></p>\r\n<p>প্রথমে ব্রাশটি পানি দিয়ে ভিজিয়ে নিন। এবার ব্রাশটির নিচের দিকের ফোমের অংশে facewash/cleansing gel নিন। এবার এটিকে ঘষে ফোম তৈরি করুন। ব্রাশের দিক দিয়ে মুখের ত্বকের ভিতর থেকে বাহিরের দিকে ঘুরিয়ে ঘুরিয়ে ব্যবহার করুন।&nbsp;</p>', 270, 180, 'SA-121', 0, 0, 1, '2022-10-07 06:56:30', '2022-10-07 06:56:44'),
(509, 4, '3D Roller Massager', '3d-roller-massager', '<h1 class=\"product-name\">3D Roller Massager</h1>\r\n<p>এই প্রোডাক্টটি নারী পুরুষ সবার জন্য উপকারি।</p>\r\n<p>👉 এটি শরীরের যেকোন ব্যাথা উপশমে সাহায্য করে</p>\r\n<p>👉 মাংসপেশীর ব্যাথা কমাতে সাহায্য করে</p>\r\n<p>👉 রক্ত সঞ্চালন বৃদ্ধি করে।</p>\r\n<p>👉 অনেকে বিভিন্ন রকম থেরাপি নিয়ে থাকেন,তাদের জন্যেও এটি বেশ কার্যকরী একটা প্রোডাক্ট</p>\r\n<p>👉 শরীরের অতিরিক্ত মেদ কমাতে সাহায্য করবে।</p>\r\n<p>👉 বডি ম্যাসাজ,ফেইস ম্যাসাজ করতে পারবেন</p>\r\n<p>👉 ফেইসের শেপ ঠিক করার জন্য এটি ব্যবহার করতে পারবেন।</p>\r\n<p>👉 হাই কোয়ালিটি প্রোডাক্ট</p>', 480, 350, 'SA-122', 0, 0, 1, '2022-10-07 07:31:30', '2022-10-07 07:31:30'),
(510, 7, 'Dolphin Infrared Body Massager', 'dolphin-infrared-body-massager', '<p>Dolphin Infrared Body Massager</p>\r\n<p>Dolphin Body Massager - শরীর ম্যাসাজ নিয়ে আর ভাবনা নেই</p>\r\n<p>☑️ঘাড়,পা,মেরুদন্ড, পিঠ, কোমর ব্যথাসহ যেকোন ব্যথার Instant সমাধান</p>\r\n<p>👉&nbsp;বাতসহ যেকোন ব্যথা সাথে সাথে কমিয়ে ফেলে।</p>\r\n<p>👉 মাসল বা সিক্স প্যাক তৈরি করার জন্য বেশ উপযোগী।</p>\r\n<p>👉&nbsp;স্ট্রোক এর ব্যাথা অনুভূত হলে এই থেরাপি ব্যবহার করা যায়।</p>\r\n<p>👉&nbsp;ব্লাড সার্কুলেশন বৃদ্ধি ও টক্সিন নিরাময় সহায়ক হয়ে থাকে।</p>\r\n<p>👉 এটি আপনার শরীরের যে কোন স্থানের ব্যাথাকে অল্প সময়ের মধ্যে দূর করবে।</p>\r\n<p>👉 এটি ব্যাথাযুক্ত স্থানে চেপে ধরলে ম্যাসাজের মাধ্যমে ব্যাথা কমিয়ে আনবে এবং আপনার ব্লাড সার্কুলেশন সচল রাখবে।</p>\r\n<p>👉 Dolphin বডি মাসাজার কার্যকর মাসাজের জন্য শক্তিশালী হ্যামার ইনফ্রারেড ফিজিওথেরাপি</p>\r\n<p>👉 ইফেক্টস ইউনিক ডিজাইন আকুপ্রেসার, আকুপাংচার মাসাজ এবং ট্যাপিং মাসাজের জন্য ভিন্ন ভিন্ন রাবার মাসাজ হেড</p>\r\n<p>হাই/লো গ্রেড স্পিড মাসাজ 8 পজিশন: কাঁধ, হ্যান্ডস, নেক, ব্যাক, ওয়েস্ট, থাই ,পা ও পায়ের পাতা</p>\r\n<p>&nbsp;</p>', 1400, 950, 'SA-123', 0, 0, 1, '2022-10-07 07:55:09', '2022-10-07 07:55:09'),
(511, 7, 'Therapy Heal Pen', 'therapy-heal-pen', '<p><strong>Therapy Heal Pen</strong></p>\r\n<p>👉 ইলেক্ট্রিক আকুপ্রেসার পেনদ্রুত ব্যথা হ্রাস করার জন্য কার্যকরী ভূমিকা পালন করে।</p>\r\n<p>👉 এছাড়াও রক্ত সঞ্চালনের ক্ষেত্রেও সাহায্য করে এবং এর কোনো পার্শপ্রতিক্রিয়া নেই।</p>\r\n<p><strong>উপকারিতাঃ</strong></p>\r\n<p>👉 রক্ত সঞ্চালন বৃদ্ধির করেঘুমের সমস্যার সমাধান করেবাত ব্যাথা দূর করে।মানসিক প্রশান্তি সূষ্টি করে।</p>\r\n<p>👉 শরীর থেকে মেদ এবং ব্যাড কোস্টেরল দূর করে।</p>\r\n<ul class=\"\">\r\n<li class=\"\">3 IN 1:Three metal heads，Dome shape, spherical shape and set point shape.</li>\r\n<li class=\"\">Adjustable Gear:Nine levels adjustable, full body massage.</li>\r\n<li class=\"\">Automatically find acupuncture points to make massage more effective.</li>\r\n<li class=\"\">Automatic Timing：Automatic shutdown in 15 minutes</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.4cfbNNFfNNFfbp\">Instant pulse, clear meridian and active collaterals, good physical therapy effect</li>\r\n<li class=\"\">Product Size: Body length 15.5cm</li>\r\n</ul>', 850, 680, 'SA-124', 0, 0, 1, '2022-10-07 09:18:54', '2022-10-07 09:18:54'),
(512, 4, '5 in 1 Beauty Care Massager', '5-in-1-beauty-care-massager', '<p><strong>5 in 1 Beauty Care Massager</strong></p>\r\n<div class=\"xdj266r x11i5rnm xat24cr x1mh8g0r x1vvkbs x126k92a\">\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span> 5 in 1 Facial Beauty Care Massager<span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb1/1.5/16/1f929.png\" alt=\"🤩\" width=\"16\" height=\"16\" /></span></div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n</div>\r\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> </span>এই একটা কিট হলে আপনার পার্লারে না গিয়ে ঘরে বসেই facial এর কাজ হয়ে যাবে <span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/td8/1.5/16/1f60a.png\" alt=\"😊\" width=\"16\" height=\"16\" /></span></div>\r\n<div dir=\"auto\">এটি আপনার ত্বকের Scrub হিসাবে কাজ করে। নাক এর Blackheads এর উঠে নিয়ে আসে। 5 in 1 Beauty Care Massager যা আপনার ত্বকের গভীর ময়লা তুলে আনে। ত্বককে করে soft, smooth. রক্ত সঞ্চালনের জন্য তা উপকারি। মেকআপ ব্লেন্ডার (Makeup blender) এর কাজ করে, যা মেকআপ কে করে Blend 5-in-1 বিউটি ম্যাসাজার।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.ph