src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> </span>২টি ভিন্ন স্পীড অপশন রয়েছে এই ম্যাসাজারের মাধ্যমে ম্যাসাজ করে আপনি সান-স্পট, বার্ধক্যের বলিরেখা ও চামড়ার মলিনতা দূর করতে পারেন।</div>\r\n</div>', 650, 480, 'SA-125', 0, 0, 1, '2022-10-07 09:36:00', '2022-10-07 09:36:00'),
(513, 4, 'Relax and Spin Tone Massager', 'relax-and-spin-tone-massager', '<p><strong>Relax and Spin Tone Massager</strong></p>\r\n<p>Relax Spin &amp; Tone Body Massager Made In China</p>\r\n<p><strong>পন্যের বিবরণ</strong></p>\r\n<p>👉 Relax Spin &amp;Tone Body মাসাজার</p>\r\n<p>👉 শরীরের বিভিন্ন অংশের মেদ কমাতে সাহায্য করে শুধু তাই নয় শরীরের বিভিন্ন অংশের ব্যথা ও দূর করে নিয়মিত ব্যাবহার করে স্লিম হোন</p>\r\n<p>👉&nbsp;রক্তসঞ্চালন বৃদ্ধি করে ব্যাথা থেকে মুক্তি দেবে</p>\r\n<p>👉&nbsp;এটি একটি লাইটওয়েট ও পোর্টেবল মাসাজার, আপনি আপনার ভ্রমণের সময় সাথে বহন করতে পারেন</p>\r\n<p>👉&nbsp;ইউনিক র্যাপিড রোটেশন</p>\r\n<p>👉&nbsp;হালকা ও সহজে ব্যবহার যোগ্য</p>\r\n<p>👉 এটি আপনার মাসলকে রিলাক্স করে</p>\r\n<p>👉 মাসাজারটির সাথে থাকচে ৪টি ভিন্ন এটাচমেন্ট যা আপনার অ্যাবস, শোল্ডার, হিপস, থাই, Calves, পা ও আন্ডার আর্ম মাসাজ করতে সাহায্য করবে</p>\r\n<p>👉&nbsp;ইনক্রিমেন্টাল স্পিড ডায়াল অ্যাডজাস্টেবল</p>\r\n<p>👉 2500 RPM পর্যন্ত হাই রোটেশনাল স্পিড</p>\r\n<p>👉&nbsp;ব্যাথা দুর করতে ব্যবহার করুন</p>\r\n<p>👉&nbsp;ব্লাড সারকুলেশন বাড়ায়</p>\r\n<p>👉&nbsp;সফট রাবার গ্রিপ</p>\r\n<p>👉&nbsp;ডায়মেনশন: 26.8 x 18.8 x 11 cm</p>\r\n<p>👉&nbsp;ম্যাটেরিয়ালঃ ABS</p>\r\n<p>👉&nbsp;৪ ধরনের মাসাজ হেড সংযুক্ত</p>\r\n<p>👉&nbsp;পাওয়ারঃ AC220~240V, 25W</p>\r\n<p><strong>Features </strong></p>\r\n<p>&bull; Off/massage /massage</p>\r\n<p>&bull; IR switch AC220~240V, 25W</p>\r\n<p>&bull; Dimensions: 26.8 x 18.8 x 11 cm</p>\r\n<p>&bull; 4 replaceable transparent heads</p>\r\n<p>&bull; Material: ABS</p>', 1050, 850, 'SA-126', 0, 0, 1, '2022-10-07 09:58:02', '2022-10-07 09:58:02'),
(514, 7, 'Foot Massager Red Slot', 'foot-massager-red-slot', '<p><strong>Foot Massager Red Slot</strong></p>\r\n<p><strong>বিবরণ: </strong></p>\r\n<p>☛ ডায়াবেটিস রোগীদের হাটার বিকল্প এবং রক্ত সঞ্চালন বাড়ানোর জন্য হাই কোয়ালিটির, অত্যন্ত কার্যকরী একটি যন্ত্র &ldquo;Foot Massager&rdquo;</p>\r\n<p>☛ এটি ব্যবহারে ফলে অতিরিক্ত মেদ সহজেই কমে যায়,</p>\r\n<p>☛ রক্ত সঞ্চালনে সহায়তা করে</p>\r\n<p>☛ ইনফ্রারেড ফুট মাসেঞ্জার শারীরিক,চৌম্বকীয় একটি জৈব কম্পন ম্যাসেজ থেরাপি</p>\r\n<p>☛ সঠিকভাবে রক্তপ্রবাহ, ব্যথা উপশম, পেশী ক্লান্তি নিষ্কাশনে সহায়ক</p>\r\n<p>☛ প্রতিদিন ১০ মিনিট ব্যবহার সুফল পেতে পারেন</p>\r\n<p>☛ এটি সম্পুর্ন এক্সটারনাল তাই কোন পার্শপ্রতিক্রিয়া নেই</p>\r\n<p>☛ পরিবারের সবার জন্য ব্যবহার উপযোগী</p>\r\n<p>☛ ম্যাটেরিয়াল: ABS</p>', 1750, 1400, 'SA-127', 0, 0, 1, '2022-10-07 10:10:17', '2022-10-07 10:10:17'),
(515, 4, 'Rechargeable Pedi Spin', 'rechargeable-pedi-spin', '<p><strong>Rechargeable Pedi Spin</strong></p>\r\n<p>👉 ওয়াশার দিয়ে পায়ের গোড়ালি পরিস্কার করতে পারবেন</p>\r\n<p>👉 পা ফাটা বন্ধ করে, ব্যথা কমে যাবে,</p>\r\n<p>👉 আপনার পায়ের যত্নে ব্যবহার করুন</p>\r\n<p>👉 Pedi Spin ইলেক্ট্রনিক পেডিকিউর কিট</p>\r\n<p>👉 ৪ টি AA ব্যাটারি চালিত (সংযুক্ত নয়)</p>\r\n<ul class=\"\">\r\n<li class=\"\">Ergonomically shaped soft touch handle.</li>\r\n<li class=\"\">USB cable for charging</li>\r\n<li class=\"\">Use with 4 AA battery</li>\r\n<li class=\"\">Best Quality Guaranteed, and Satisfaction</li>\r\n<li class=\"\">Soft, beautiful feet in an instant.</li>\r\n<li class=\"\">Express pedicure routine..</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.2d99GmZQGmZQir\">Complete pedicure routine.</li>\r\n<li class=\"\">Daily routine.</li>\r\n<li class=\"\">Night care.</li>\r\n</ul>', 1100, 850, 'SA-128', 0, 0, 1, '2022-10-07 10:39:18', '2022-10-07 10:39:18'),
(516, 6, 'Chest Pull Expender', 'chest-pull-expender', '<p>Chest Pull Expender</p>\r\n<p>👉 পাঁচটি স্প্রিং থাকায় অন্যান্য স্প্রিং থেকে বেশী শক্তিশালী।</p>\r\n<p>👉 প্রয়োজন অনুযায়ী স্প্রিং কম-বেশি করেও ব্যবহার করা যায়।</p>\r\n<p>👉 এটি Multifunctional হওয়ায় আঙুল,বাহু, বুক, হাত-পা সহ সব জায়গায় ব্যবহার উপযোগী।</p>\r\n<p>👉 শুধু আগুলের ব্যায়ামের জন্যও আলাদা সিস্টেম দেওয়া আছে।</p>\r\n<p>👉 ফুড প্যাডেল ও হ্যান্ড প্যাডেলগুলো খুবই উন্নত মানের।</p>\r\n<p>👉 প্রত্যেকটি পার্ট আলাদা আলাদা করে ব্যবহার করা যায়।</p>\r\n<p>👉 যারা জিমে যেতে পারেন না তাদের জন্য এটি হতে পারে সবচেয়ে উওম</p>\r\n<p>👉 স্টেইনলেস স্টিলের স্প্রিং ফলে মরিচা ধরে না বা ছিঁড়ে যায় না।</p>\r\n<p>👉 সুস্বাস্থ্য ও ফিটনেস ধরে রাখতে এই পণ্যটির বিকল্প নেই।</p>\r\n<p>👉 ছেলে-মেয়ে সবার জন্যই উপযোগী</p>', 920, 790, 'SA-129', 0, 0, 1, '2022-10-07 15:24:00', '2022-10-07 15:24:00'),
(517, 4, 'Real Doctor Back Support', 'real-doctor-back-support', '<p><strong>Real Doctor Back Support</strong></p>\r\n<div class=\"product-details-text\">ROYAL POSTURE ব্যাক সাপোর্ট</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> ম্যাটেরিয়ালঃ ৭০% Neoprene,৩০% পলিস্টার</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> যারা কুঁজো হয়ে হাঁটেন, দীর্ঘক্ষন কম্পিউটারের সামনে বসে থেকে যাদের পিঠ ব্যথা, সোজা হয়ে কাজ করতে পারেন না তাদের জন্য</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> এটা ব্যবহারে মেরুদন্ড বাকা হতে দেবে না</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> সোজা হয়েই কাজ করতে বা পড়তে পারবেন</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> ছেলে মেয়ে এবং যে কোন বয়সীদের জন্য</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> ফ্রিল্যান্সার থেকে শুরু করে যাদের কম্পিউটারের সামনে ঝুকে কাজ করতে হয় সবার জন্য</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> এটা মেরুদন্ডকে সোজা রাখতে সাহায্য করবে, যার ফলে আপনাকে লম্বা ও ফিট দেখাবে</div>', 580, 490, 'SA-130', 0, 0, 1, '2022-10-07 15:42:18', '2022-10-07 15:42:18'),
(518, 6, 'Egg Sitter Gel Flex Seat Cushion', 'egg-sitter-gel-flex-seat-cushion', '<p><strong>Egg Sitter Gel Flex Seat Cushion</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">You\'ll get optimal lumbar support when you sit on Egg Sitter Support Cushion</li>\r\n<li class=\"\">Super strong and durable, it always restores its shape!</li>\r\n<li class=\"\">It\'s perfect for use at home, in the car, and at the office</li>\r\n<li class=\"\">Egg Sitter Support Cushion also includes a free non-slip washable cover</li>\r\n<li class=\"\">Stop sitting in pain and get an Egg Sitter Support Cushion today</li>\r\n<li class=\"\">Soft and comfortable</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.79a8sKN6sKN6VN\">Absorbs pressure points</li>\r\n<li class=\"\">Honeycomb design keeps cool</li>\r\n<li class=\"\">Lets air circulate</li>\r\n<li class=\"\">Made of strong ultra-flex polymer</li>\r\n<li class=\"\">Material: TPE</li>\r\n<li class=\"\">Size: 42 x 35 x 5CM</li>\r\n<li class=\"\">Color: Multicolor</li>\r\n</ul>', 950, 790, 'SA-131', 0, 0, 1, '2022-10-07 18:52:13', '2022-10-07 18:52:13'),
(519, 4, 'Nose Clip Anti Snowring', 'nose-clip-anti-snowring', '<p><strong>Nose Clip Anti Snowring</strong></p>\r\n<p>ANTI SNORING - নাক ডাকা আর নয়। আপনার নাক ডাকা দূর করতে আমরা নিয়ে এলাম 2 IN 1 Anti Snoring &amp; Air Purifier.</p>\r\n<p>👉&nbsp;আপনার অথবা আপনার সঙ্গীর নাক ডাকা নিয়ে বিরক্ত?</p>\r\n<p>👉 এক নিমিষেই সমাধান করে দিতে পারে আমাদের এই এন্টি স্নোরিং ডিভাইস।</p>\r\n<p>👉 এতে রয়েছে এন্টি স্নোরিং ডিভাইস</p>\r\n<p>👉 যা আপনার নাসারন্ধ্রের ভিতরের প্যাসেজগুলোতে আরো বেশী বায়ু প্রবাহিত হতে সাহায্য করে, ফলে নাক ডাকা বন্ধ হয়।</p>\r\n<p>👉 নাকা ডাকা সমস্যা সমাধান করে।</p>\r\n<p>👉 স্লিপিং এ্যাপনিয়া দূরীভূত করে।</p>\r\n<p>👉 নাকের পলিপাস সংক্রান্ত সমস্যার সমাধান করে।</p>\r\n<p>👉 হাল্কা এবং ব্যবহার করা খুবই সহজ।</p>', 420, 280, 'SA-132', 1, 46, 1, '2022-10-07 19:20:30', '2023-03-22 22:41:38'),
(520, 4, 'Travel Pillow 3 in 1', 'travel-pillow-3-in-1', '<p><strong>Travel Pillow 3 in 1</strong></p>\r\n<p>বর্তমান সময়ে ভ্রমণপিপাসু মানুষদের জন্য এটি খুবই প্রয়োজনীয় এবং ফ্যাশনেবল একটি জিনিস। এর মধ্যে যা যা থাকছেঃ</p>\r\n<p>👉&nbsp;ইউ শেইপের একটি নরম বালিশ (ছবিতে দেখতে পাচ্ছেন) </p>\r\n<p>👉 নরম ফর্ম-ফিটিং ইয়ার প্লাগ। </p>\r\n<p>👉 একটি আই মাস্ক। </p>\r\n<p>👉&nbsp;নরম বালিশটি গাড়ী,প্লেন বা অন্যান্য ভ্রমণের জন্য পারফেক্ট ফ্যাশনেবল সুন্দর এবং আরামদায়ক বস্তু।</p>\r\n<p>👉&nbsp;ফিটিং ইয়ার প্লাগগুলি কার্যকরভাবে হট্টগোল শব্দ হ্রাস করে এবং এটি বহন করাও বেশ সুবিধাজনক। </p>\r\n<p>👉 চোখের কালো মাস্ক যার মাধ্যমে আপনি আপনার চোখ জোড়াকে দিতে পারবেন বাইরের আলো থেকে স্বস্তি এবং এটি ফ্যাশনেবল সুন্দর ও আরামদায়ক।</p>', 280, 190, 'SA-133', 0, 0, 1, '2022-10-08 14:34:27', '2022-10-08 14:34:27'),
(521, 7, 'Dental Oral Power Floss', 'dental-oral-power-floss', '<p><strong>Dental Oral Power Floss</strong></p>\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul class=\"\">\r\n<li class=\"\">Quick and easy &mdash; just fill with water, point and press to power away plaque-causing debris.</li>\r\n<li class=\"\">Air Infusion Technology - Air propels water to gently remove debris</li>\r\n<li class=\"\">Water Flosser &amp; oral irrigator features an ergonomic design and low profile tip to easily reach back teeth</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.1fbdTuWuTuWuv7\">Power Floss is perfect for keeping braces and other dental work clean</li>\r\n<li class=\"\">No batteries or cords. Water pick great for adults and kids.</li>\r\n</ul>\r\n</div>\r\n<p>&nbsp;</p>', 850, 550, 'SA-134', 0, 0, 1, '2022-10-08 14:59:38', '2022-10-08 15:00:35'),
(522, 7, 'Back Pain Support Belt', 'back-pain-support-belt', '<p><strong>Back Pain Belt/Back Pain Support</strong></p>\r\n<p>👉&nbsp;(আমদানি কৃত অরিজিনাল গ্রান্টেড বেল্ট)</p>\r\n<p>ফেব্রিক: ৭০% Neoprene, ৩০% পলিয়েস্টার</p>\r\n<p>&nbsp;<strong>কেন ব্যবহার করবেন?? </strong></p>\r\n<p>👉 যারা কুঁজো হয়ে চলাফেরা করেন, যাদের পিঠ ব্যথা, এবং দীর্ঘক্ষন কম্পিউটারের সামনে বসে /ঝুকে কাজ করে থাকেন , সোজা হয়ে কাজ করতে পারেন না তাদের জন্য এটা অত্যন্ত কার্যকরী একটি প্রডাক্ট</p>\r\n<p>👉 যা ব্যবহারে আপনার মেরুদন্ড বাকা হতে দেবে না সোজা হয়েই কাজ করতে বা পড়তে পারবেন ,যার ফলে আপনাকে লম্বা ও ফিট দেখাবে, ছেলে মেয়ে উভয়ই ব্যাবহার করতে পারবেন</p>\r\n<p><strong> ✔️ উপকারিতাঃ </strong></p>\r\n<p>👉 হালকা ব্যকপেইন বা মেরুদন্ডের ব্যাথাকে নিরাময় করে।</p>\r\n<p>👉 এটা মেরুদন্ডকে সোজা রাখতে সাহায্যকরবে</p>\r\n<p>👉 বডি শেপকে রাখে সুন্দর ও আকর্ষনীয়!</p>', 790, 550, 'SA-135', 0, 0, 1, '2022-10-08 15:31:15', '2022-10-12 20:07:36'),
(523, 7, 'Digital Blood Pressure Monitor', 'digital-blood-pressure-monitor', '<p><strong>Digital Blood Pressure Monitor</strong></p>\r\n<div class=\"product-details-text\"><strong>Details:</strong></div>\r\n<div class=\"product-details-text\">&nbsp;</div>\r\n<div class=\"product-details-text\">\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> ব্লাড প্রেশার রেঞ্জ: 0-300 mm Hg</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> পালস রেঞ্জ: 40-160 beats /min</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> ব্লাড প্রেশার অ্যাকুরেসি: &plusmn; 3mmHg (0.4Kpa)</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> হার্ট রেট অ্যাকুরেসি: &plusmn; 5% of reading</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> 90 সেট অফ মেমরি</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> অ্যাভারেজ ভ্যাল্যু অফ ল্যাটেস্ট 3 রিডিং</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> সিম্পল ওয়ান টাচ অপারেশন</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> অটোমেটিক পাওয়ার অফ আফটার 3 মিনিট নো অপেরেশন</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> লো ব্যাটারি ইনডিকেটর</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> AC অ্যাডাপ্টার</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> ব্যাটারী দ্বারা চালিত (সংযুক্ত নয়)</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> সঠিক এবং নির্ভরযোগ্য ব্লাশ প্রেশার রিডিং দিতে সক্ষম</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> যারা রক্তচাপ নির্ণয়ে \"ব্লাড প্রেশার মনিটর\"</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" />&nbsp;বাড়ি অথবা বাড়ির বাহিরেও বহন করতে ইচ্ছুক তাদের জন্য সহজ সমাধান</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" />&nbsp;বয়স ৩০ এর ঊর্ধ্বে যাওয়ার সাথে সাথে মানুষের রক্ত চাপ বাড়তে থাকে যা জানাটা খুবই প্রয়োজন</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" />&nbsp;তাই নিজের শরীরের কথা চিন্তা করেই বাড়ীতে একটা প্রেশার মাপার মেশিন রাখুন।</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" />&nbsp;গভীর রাতে অথবা পরিবারের কোন মুমূর্ষু ব্যক্তির অথবা প্রেশার আপ-ডাউন হয় এমন ব্যক্তির যে কোন সময় রক্তচাপ মাপার জন্যে অন্তত বাসায় এই যন্ত্রটি থাকা উচিত</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> &nbsp;Accu Max ব্লাড প্রেশার মনিটর</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" /> এক্সট্রা লার্জ LCD ডিসপ্লে উইথ ডিজিটাল ১২০ মেমোরি স্টোরেজ ক্যাপাসিটি</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" />&nbsp;ব্লাড প্রেশার লেভেল ইনডিকেটর</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" />&nbsp;ডিটেক্ট ইরেগুলার হার্ট বিট</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" />&nbsp;ডিটেক্ট মুভমেন্ট ডিটেকশন</div>\r\n<div class=\"product-details-text\"><img src=\"https://static.ajkerdeal.com/images/dealdetailsnew/dealdetails_arrow.svg\" />&nbsp;Charger ৪টি AA ব্যাটারি দ্বারা চালিত</div>\r\n</div>', 1650, 1290, 'SA-136', 0, 0, 1, '2022-10-08 16:20:06', '2022-10-08 16:20:06'),
(524, 4, 'Massage Slipper', 'massage-slipper', '<p><strong>Massage Slipper</strong></p>\r\n<p>উপকারিতা</p>\r\n<p>👉 এই Reflexology Sandals মাসাজ স্লিপার মাধ্যমে দেহের রক্ত সঞ্চালন বৃদ্ধি করে </p>\r\n<p>👉&nbsp;এটি ব্যবহারে আপনার যে কোন ধরনের ব্যথা থেকে মুক্তি দিবে </p>\r\n<p>👉 ব্যাটারী বা অন্য কোনো এক্সটার্নাল পাওয়ার ছাড়াই চলে </p>\r\n<p>👉 রক্ত সঞ্চালন বৃদ্ধি করে </p>\r\n<p>👉&nbsp;পা মাসাজ করতে ব্যবহার করুন </p>\r\n<p>👉&nbsp;রোগ প্রতিরোধ ক্ষমতা বাড়ায় </p>\r\n<p>👉&nbsp;নিদ্রায় সহায়তা করে </p>\r\n<p>👉 ক্লান্তি দূর করে </p>\r\n<p>👉 পায়ের ব্যথা উপশমে সহায়তা করে </p>\r\n<p>👉&nbsp;হাঁটার সময় শরীরের টেনশন কমায়</p>\r\n<p>👉&nbsp;ডায়াবেটিস ও উচ্চ রক্তচাপের রোগীদের জন্য উপকারী</p>\r\n<p>👉&nbsp;স্ট্রেস দূর করতে সাহায্য করে</p>', 950, 790, 'SA-137', 0, 0, 1, '2022-10-08 16:36:47', '2022-10-08 16:36:47'),
(525, 7, 'Digital Therapy Machine', 'digital-therapy-machine', '<p><strong>Digital Therapy Machine</strong></p>\r\n<p>☑️ ঘাড়,পা,মেরুদন্ড, পিঠ, কোমর ব্যথাসহ যেকোন ব্যথার Instant সমাধান🤩🤩 </p>\r\n<p><strong>👉 </strong>বাতসহ যেকোন ব্যথা সাথে সাথে কমিয়ে ফেলে। </p>\r\n<p><strong>👉&nbsp;</strong>বাড়তি ওজন বা মেদ কমাতে এই মেশিনটি অনেক কার্যকারী। </p>\r\n<p><strong>👉&nbsp;</strong>স্ট্রোক এর ব্যাথা অনুভূত হলে এই থেরাপি ব্যবহার করা যায়।</p>\r\n<p><strong>👉&nbsp;</strong>ব্লাড সার্কুলেশন বৃদ্ধি ও টক্সিন নিরাময় সহায়ক হয়ে থাকে।</p>\r\n<p><strong>👉&nbsp;</strong>আকর্ষণীয় ফিগার তৈরিতে গুরুত্বপূর্ণ ভূমিকা পালন করে।</p>\r\n<p><strong>👉&nbsp;</strong>সমস্যা অনুযায়ী আছে ৮ ধরনের মুড, যা ব্যথা অনুযায়ী থেরাপী দেবে।</p>\r\n<p><strong>👉&nbsp;</strong>সরাসরি কারেন্ট,ব্যাটারি ও USB সিস্টেমে চালাতে পারবেন।</p>\r\n<p><strong>👉&nbsp;</strong>LED সিস্টেম হওয়ায় এটি ব্যাবহার করতে খুবই সহজ হয়। </p>\r\n<p><strong>👉&nbsp;</strong>আমাদেরটা ৪ প্যাডের হওয়ায় ব্যাথা নিরাময়ে দ্রুত কাজ করে </p>\r\n<p><strong>👉&nbsp;</strong>সময় সেট করা যায় বলে প্রয়োজন অনুযায়ী থেরাপি নিতে পারবেন। </p>\r\n<p><strong>👉&nbsp;</strong>এই Digital Therapy Machine টি অনেক জনপ্রিয় একটি মেশিন। </p>\r\n<p>👇👇👇👇👇 </p>\r\n<p><strong>বিশেষ দ্রষ্টব্যঃ</strong></p>\r\n<p> হার্টে রিং ও পেস মেকার বসানো </p>\r\n<p>এবং গর্ভাবস্থায় ব্যবহার সম্পূর্ণ নিষিদ্ধ।&nbsp;</p>', 850, 690, 'SA-138', 0, 0, 1, '2022-10-08 16:57:45', '2022-10-08 16:57:45'),
(526, 6, 'Miss Belt Body Shaper', 'miss-belt-body-shaper', '<p>Miss Belt Body Shaper</p>\r\n<p><strong>পন্যের বিবরণ==</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" /> আপনার পেটের অতিরিক্ত মেদ (ভুঁড়ি) ও চর্বি খুব সহজেই কমানোর জন্য আমরা আপনার জন্য নিয়ে এসেছি Hot Shaper Belt .</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" /> যা খুব দ্রুত (এটি পরীক্ষিত ) ১০০% গ্যারান্টি আপনার অতিরিক্ত মেদ (ভুঁড়ি) ও চর্বি কমিয়ে আপনাকে স্লিম ও আকর্ষণীয় করে তুলবে ।<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" /> আপনার বডি ফিগার কে আরও আকর্ষণীয় আরও স্লিম করতে সাহায্য করে এই MISS BELT বডি শেপারটি<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" /> এটি আপনি বাসায়, হাঁটার সময়, কাজের মধ্যে , শপিং এ , জগিং এ ব্যবহার করতে পারেন ।<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" /> মহিলা ও পুরুষদের জন্য একটি অনন্য গেজেট (যা আপনার অতিরিক্ত মেদ কমাতে সাহায্য করবে)।<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" /> আপনার ফিগার শেপ এর মধ্যে থাকবে।<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" /><strong> ম্যাটেরিয়ালঃ </strong></p>\r\n<p>পলিয়েস্টার, স্প্যানডেক্স, নাইলন, রাবার</p>', 580, 450, 'SA-139', 0, 0, 1, '2022-10-08 17:13:43', '2022-10-08 17:13:43'),
(527, 7, 'Infrared Thermometer DT-8826', 'infrared-thermometer-dt-8826', '<p><strong>Infrared Thermometer DT-8826</strong></p>\r\n<p>ফিঙ্গারটিপ পালস অক্সিমিটারঃ</p>\r\n<p><span class=\"_5mfr\"><span class=\"_6qdm\">✅</span></span>ফুসফুসজনিত সমস্যায় ভোগা রোগীর জন্য আদর্শ যন্ত্র<br /><span class=\"_5mfr\"><span class=\"_6qdm\">✅</span></span>রক্তে অক্সিজেনের সরবরাহ পরিমাপ করে<br /><span class=\"_5mfr\"><span class=\"_6qdm\">✅</span></span>আপনার সঠিক পালস বা হৃদস্পন্দন পরিমাপ করে।<br /><span class=\"_5mfr\"><span class=\"_6qdm\">✅</span></span>রিয়েল টাইম ভিজুয়াল ইসিজি গ্রাফ দেখায়<br /><span class=\"_5mfr\"><span class=\"_6qdm\">✅</span></span>&nbsp;হাসপাতাল, বাসাবাড়ী অথবা ক্রীড়াক্ষেত্রে ব্যবহারের জন্য<br /><span class=\"_5mfr\"><span class=\"_6qdm\">✅</span></span>যদি আপনার শরীরের অক্সিজেনের মাত্রা সঠিক থাকে তা হলে আপনি থাকবেন নিরাপতাক<br /><br />মেডিকেল ইনফ্রারেড থার্মোমিটার:---------<br /><span class=\"_5mfr\"><span class=\"_6qdm\">✅</span></span>ইনফ্র্যারেড থার্মোমিটার যা কিনা দেহের তাপমাত্রা নির্ধারণে/ করোনা সনাক্তকরণে কার্যকরী ভূমিকা রাখে।<br /><span class=\"_5mfr\"><span class=\"_6qdm\">✅</span></span>দীর্ঘস্থায়ী ব্যবহার উপযোগি।</p>', 1890, 1570, 'SA-140', 0, 0, 1, '2022-10-08 17:26:24', '2022-10-08 17:26:24');
