(531, 4, 'Sit Up Bar Fitness Tools', 'sit-up-bar-fitness-tools', '<p><strong>Fitness Tools</strong></p>\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul class=\"\">\r\n<li class=\"\">Material: Foam + Steel tube</li>\r\n<li class=\"\">Size: 27x18x14cm</li>\r\n<li class=\"\">Color: Black</li>\r\n<li class=\"\">Type: Sit Up Bars</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.3e0arEZXrEZXoQ\">Small and practicalit doesn\'t take up spaceand you can exercise at home.Don\'t have to pay for equipment or go to the gym.You don\'t have to take the time to do it at home.A variety of fitness methodsfor different partswhere to thin where to practice.A set of equipment can carry out a variety of sportssuch as sit-upsflat supportpush-ups and so on.</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.3e0arEZXrEZXoQ\">Usage: home fitness assistant</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\">&nbsp;</div>', 890, 720, 'SA-141', 0, 0, 1, '2022-10-08 18:26:39', '2022-10-08 18:26:39'),
(529, 4, 'Nail Care Machine For Nail Repair', 'nail-care-machine-for-nail-repair', '<p><strong>Nail Care Machine For Nail Repair</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">আপনার হাত-পায়ের আঙ্গুলিতে কুনি ধরেছে ,</li>\r\n<li class=\"\">কোনা বসে গিয়ে ব্যাথা করে,</li>\r\n<li class=\"\">কুনি থেকে চিরতরে মুক্তি পেতে ব্যাবহার করুন নখের কোনা সোজা করার অত্যাধুনিক যন্ত্র নেইল রিপ্যায়ার।</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.1827hCmuhCmucU\">এটা আপনার নখের কোনা গুলোকে উপরে তুলে আপনার হাত-পা কে করে তুলবে আরো আকর্ষনীয় ।</li>\r\n</ul>', 450, 380, 'SA-142', 0, 0, 1, '2022-10-08 18:04:28', '2022-10-08 18:04:28'),
