(532, 4, 'Nozzle Washer Element', 'nozzle-washer-element', '<p><strong>Nozzle Washer Element</strong></p>\r\n<p>বিডেট স্প্রেয়ারে পানির চাপ বৃদ্ধি পাবে এবং বিভিন্ন কাজে ব্যবহার করা যাবে।</p>\r\n<p>পানি চাপের দূরত্ব: ১০ মিটার।</p>\r\n<p><strong>বৈশিষ্ট্য:</strong></p>\r\n<p>গাড়ি পরিষ্কার, ঘর পরিষ্কার, গাছ পানি দেওয়া এবং বাগানের জন্য ব্যবহার করুন।</p>\r\n<p>পানির চাপ আপনার চাহিদা অনুযায়ী ব্যবহার করতে পারেন।</p>\r\n<p><strong> পণ্যের বিস্তারিতঃ </strong></p>\r\n<p>ইনস্টল করা, পরিষ্কার করা এবং ব্যবহার করা সহজ।</p>\r\n<p>নিরাপদ পানি, পানির পথ আপনার চাহিদা অনুসারে সামঞ্জস্য করতে পারেন।</p>\r\n<p>পানির চাপ ৪০০% বৃদ্ধি করুন।</p>\r\n<p>এর মাথা বাজারের সাধারণ আইটেমের চেয়ে ৫০ গুণ শক্তিশালী এবং কখনও বালি-জ্যাম থাকে না। +পানির কোন ড্রপ ছাড়া এই পণ্যটি খুব উচ্চ চাপ নিতে পারে।</p>\r\n<ul class=\"\">\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.acbdhxKKhxKK5w\">Uses: household car, car washing, garden watering, garden spray, washing floor Weight:90g Jet distance:7-10m 100% Brand New and High Quality Size:17cm Material: Alloy copper plating Product Name:Hose Nozzle Package Including: 1PC Note:</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.acbdhxKKhxKK5w\">1. Due to the light and the difference screen adjustment, the color of the item may be slightly different from the images.</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.acbdhxKKhxKK5w\">2. Please allow 1-3cm measurement deviation due to manual measuremen</li>\r\n</ul>\r\n<p>&nbsp;</p>', 720, 550, 'SA-144', 0, 0, 1, '2022-10-08 19:13:06', '2022-10-08 19:13:06'),
(533, 4, 'Door Draft Stopper Foam', 'door-draft-stopper-foam', '<p><strong>Door Draft Stopper Foam</strong></p>\r\n<p>এটা কি কাজে লাগবে ?</p>\r\n<p>👉 দরজার নিচের ফাঁকা অংশ দিয়ে স্বাভাবিকভাবেই বাহিরের শব্দ, ময়লা, বাতাস ঘরে এসে পরে। মাঝে মাঝে আমরা নিজেরাই এতে বিরক্ত হয়ে যাই যখন ময়লা কিংবা শব্দ বাহির থেকে ঘরে আসে। আপনার এসব সমস্যার চমৎকার সমাধান আমাদের Door Bottom Sealing Strip।</p>\r\n<p>👉 দরজার নিচে এটি ব্যবহার করলে বাহির থেকে শব্দ, ময়লা কিংবা দুর্গন্ধযুক্ত বাতাস আর আসতে পারবে না।</p>\r\n<p><strong>সব দরজার সাথে লাগানো যাবে ?</strong></p>\r\n<p>👉 জি। এটা সব দরজার সাথে সহজেই ব্যবহার করা যাবে। একটি রোল একটি দরজার জন্যই পারফেক্ট। যদি লাগানোর পরও অতিরিক্ত অংশ থাকে, তাহলে এটা কেটে অন্য কাজে লাগিয়ে ফেলুন।</p>\r\n<p>👉 এটি 37 ইঞ্চি (3 ফুট 1 ইঞ্চি বা 93 সেমি) লম্বা যেকোনো দরজার নিচে ব্যবহার করা যাবে। আপনার দরজা যদি 37 ইঞ্চি এর চেয়ে ছোট হয় তাহলে আপনি আপনার পছন্দমতো কেটে ব্যবহার করতে পারবেন।</p>\r\n<p>👉 এটি ময়লা হলে ধুয়ে শুকিয়ে পুনরায় ব্যবহার করতে পারবেন।</p>\r\n<p><strong>Product Name: </strong></p>\r\n<p>👉 Door Draft Stopper Foam</p>\r\n<p>👉 Size: 37 x 3.9 inches</p>\r\n<p>👉 Material: Foam Cotton + EPE</p>', 550, 430, 'SA-145', 0, 0, 1, '2022-10-08 19:28:30', '2022-10-08 19:28:39'),
(534, 4, 'Fashion Clothes Rack', 'fashion-clothes-rack', '<p><strong>Fashion Clothes Rack</strong></p>\r\n<div dir=\"auto\">👉ছোট ফ্যামিলি ও&nbsp;ব্যাচেলারদের জন্য প্রয়োজনীয় একটি পন্য।</div>\r\n<div dir=\"auto\">👉 ঘরের কোণে রুচির প্রকাশ।</div>\r\n<div dir=\"auto\">👉 শখের জিনিস সাজিয়ে রাখুন ট্রেন্ডি ডিজাইনের স্মার্ট আলনায়।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><strong>Feature:</strong></div>\r\n<div dir=\"auto\">1. Easy to Assemble.</div>\r\n<div dir=\"auto\">2. Excellent Storage Solution.</div>\r\n<div dir=\"auto\">3. Portable &amp; Multi-functional Clothes Rack.</div>\r\n<div dir=\"auto\">4. Sturdy &amp; Durable, Stylish &amp; Mobile Design.</div>\r\n<div dir=\"auto\">5. Keep Clothes Organized &amp; Easily Accessible.</div>\r\n<div dir=\"auto\">6. Ideal for a bedroom, laundry room, attic, or boutique.</div>\r\n<div dir=\"auto\">7. Multi-pattern classification; Storage Racks and coat hanger.</div>\r\n<div dir=\"auto\">8. Sturdy hanging bars for your clothes, jackets, coats and pants</div>\r\n<div dir=\"auto\">9. Side Hook design, simple and practical, beautiful and generous.</div>\r\n<div dir=\"auto\">10. No drill, no power tools needed. Just assemble the closet and save more space.</div>', 1600, 1250, 'SA-146', 0, 0, 1, '2022-10-08 19:39:23', '2022-11-08 16:37:17'),
(535, 7, 'Mini Foot Pump', 'mini-foot-pump', '<p><strong>Mini Foot Pump&nbsp;</strong></p>\r\n<p> <strong>বৈশিষ্ট্য: </strong></p>\r\n<p>👉 ফুট সক্রিয় নকশা, অনায়াস এবং দ্রুত</p>\r\n<p>👉 সঠিক এবং সহজে পড়া চাপ গেজ, আপনাকে আপনার পছন্দসই চাপ সেট করতে সাহায্য করে। </p>\r\n<p>👉&nbsp;অ্যালুমিনিয়াম খাদ ভিতরের এবং বাইরের ব্যারেল, আরো টেকসই এবং পরিধান-প্রতিরোধী </p>\r\n<p>👉&nbsp;টুইন ভালভ মাথা নকশা Presta এবং Schrader উভয় মাপসই করতে পারেন</p>\r\n<p>👉 অ্যান্টি-স্লিপ প্যাডেল, ভাঁজ করা যায় এমন পাদদেশ, ধসে পড়লে সঞ্চয় করতে সুবিধাজনক। </p>\r\n<p>👉&nbsp;উচ্চ মানের অ্যান্টি-ফ্রিজ এবং তাপ-প্রতিরোধী রাবার টিউব, শক্তিশালী বলিষ্ঠতা, শক্ত হওয়া সহজ নয়। </p>\r\n<p>👉&nbsp;কমপ্যাক্ট মিনি, হালকা ওজন এবং বহন করা সহজ। </p>\r\n<p><strong>প্যাকেজের পরিমান বা বিষয়বস্তু: </strong></p>\r\n<p>👉 1 এক্স বাইক পাম্প</p>\r\n<p> 👉 1 এক্স গ্যাস সুই </p>\r\n<p>👉 1 x স্পোর্টস বল নিডেল।</p>', 980, 870, 'SA-147', 0, 0, 1, '2022-10-08 19:57:37', '2022-10-08 19:57:37'),
(536, 4, 'Mini Dry Iron With Spray', 'mini-dry-iron-with-spray', '<p><strong>Price : 1050 tk Electric Clothes Iron Steamer Handheld Mini Garment Steamer Machine Portable Wet Dry Steam Iron Ironing Machine For Home Travel???? । হ্যান্ডেল ট্র্যাভেল স্টিমার আয়রন অতি সহজে, দ্রুততম সময়ে আয়রনের জন্য ব্যবহার করুন steam Iron. ■ বিদ্যুৎ সাশ্রয়ী, স্বল্প সময়ে স্টিম এর সাহায্যে আয়রন করতে পারবেন। ■ শার্ট, প্যান্ট, শাড়ি ও প্রয়োজনীয় দৈনন্দিন ব্যবহারের কাপড় আয়রন করতে পারবেন। ব্যাবহার করা খুবই সহজ। তাই এখনি আপনার জন্য Handle Travel Steamer Ironটি সংগ্রহ করুন। ■ যারা ভ্রমন প্রিয় ও অফিসের কাজে বাহিরে যেতে হয় তাদের জন্য বেস্ট। । আর যেহেতু Vacuum সিস্টেম তাই কাপড় নষ্ট হওয়ার ভয় থাকে না। Portable Steam Garments Iron Material: ABS+Metal Power: 30W Size: 18cm**8cm**8.4cm Temperature: 150&deg;C Water Capacity: 60ml Colour: Green Weight: 0.4kg Iron+Straw Cover + Water</strong></p>\r\n<div dir=\"auto\">&nbsp;</div>', 1250, 1050, 'SA-148', 0, 0, 1, '2022-10-08 20:17:47', '2022-11-08 16:31:47'),
