(538, 4, 'Double layer Toilet Tissue Holder With Drawer', 'double-layer-toilet-tissue-holder-with-drawer', '<p><strong>Double layer Toilet Tissue Holder With Drawer</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> টয়লেটে টিস্যু হোল্ডারে টিস্যু রেখে আমরা সবাই ব্যবহার করে থাকি। কিন্ত একসাথে টিস্যু ও অন্যান্য প্রয়োজনীয় জিনিস রাখা সম্ভব হয় না।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> Double LayerToilet Tissu Holder টি দিয়ে আপনি আপনার টয়লেটের ভেতর এডজাস্ট করে টিস্যু ,সেনেটারি প্যাড ও অন্যান্য প্রয়োজনীয় জিনিস গুলো রাখতে পারবেন।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> এছাড়া এর ওপরে পর্যাপ্ত জায়গা থাকায় ঘড়ি বা ফোন হোল্ডার রেখে ব্যবহার করতে পারবেন।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> এটি টিস্যু গুলোকে শুকনো রাখবে এবং সহজে টিস্যু বের করে ব্যবহার করা যাবে</p>\r\n<p><strong>Material:</strong> Plastic</p>\r\n<p><strong>Size:</strong> 19cmx22cmx13.5cm</p>', 990, 880, 'SA-150', 0, 0, 1, '2022-10-08 21:04:36', '2022-10-09 09:03:20'),
(539, 7, 'Air Conditioner Windshield', 'air-conditioner-windshield', '<p><strong>Air Conditioner Windshield</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">Adopt scalable air conditioning air deflector to adapt to different heights of air conditioning</li>\r\n<li class=\"\">Adjustable hanging wheel design, hanging wheel can adjust the up and down direction, so that the indoor temperature reaches equilibrium</li>\r\n<li class=\"\">The installation is simple and beautiful, you can freely adjust the windshield angle to change the wind direction, avoid blowing straight</li>\r\n<li class=\"\">Make indoor temperature control, healthier and more comfortable.</li>\r\n<li class=\"\">Size:Before stretching, it is about: 54 cm. After stretching, it is about 70 cm.</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.754cWtrvWtrv9u\">Specification:</li>\r\n<li class=\"\">100% Brand New and High Quality!</li>\r\n<li class=\"\">Quantity:1</li>\r\n<li class=\"\">Material: ABS</li>\r\n</ul>', 1, 1, 'SA-151', 0, 0, 0, '2022-10-08 21:22:13', '2022-10-08 21:22:13'),
(540, 7, 'Portable Electric Lunch Box', 'portable-electric-lunch-box', '<p><strong>Portable Electric Lunch Box</strong></p>\r\n<p><strong>👉️</strong>যারা অফিস করেন বা স্কুলে চাকরি করেন এবং সাথে করে লাঞ্চ নিয়ে যেতে হয়,, আর দুপুরে ঠান্ডা খাবার খেতে হয়! তাদের জন্য আমাদের এই ইলেক্ট্রিক লাঞ্চ বক্স হতে পারে নিত্য দিনের প্রয়োজনীয় সঙ্গী.</p>\r\n<p><strong>পন্যের বিবরণঃ</strong></p>\r\n<p>✅ এই ইলেকট্রিক লাঞ্চ বক্সটি খুব ই অল্প সময়ে আপনার খাবারকে গরম করবে..</p>\r\n<p>✅ এটি শকপ্রুফ এবং কম বিদ্যুৎ খরচে চলে.</p>\r\n<p>✅ সহজে বহনযোগ্য.</p>\r\n<p>✅ এই লাঞ্চ বক্সের খাবার ঠাণ্ডা হয়ে গেলেও বিদ্যুৎ এর মাধ্যমে আবার গরম করা যায়.</p>\r\n<p>✅ খাবার নষ্ট হওয়ার আশঙ্কা নেই.</p>\r\n<p>✅ গরমকাল তো বটেই শীতের সময়ও যথেষ্ট গরম রাখার নির্ভরযোগ্য উপায় হচ্ছে এই ইলেকট্রিক লাঞ্চ বক্স।</p>', 990, 880, 'SA-152', 0, 0, 1, '2022-10-08 21:35:36', '2022-10-08 21:35:36'),
(541, 7, 'Video Making Kit', 'video-making-kit', '<p><strong>Video Making Kit</strong></p>\r\n<p><strong>👉 </strong>টিকটক , ইউটিউব ,লাইভ, ব্লগিং যেকোনো কাজেই এখন সহজভাবে করতে পারবেন ।&nbsp;</p>\r\n<p><strong>👉&nbsp;</strong>ভিডিও মেকিং কিট টি দিয়ে এখন তৈরী করতে পারবেন যেকোনো ভিডিও, যার মধ্যে পাচ্ছেন Studio Type ভিডিও বানানোর সুবিধা!!!&nbsp;</p>\r\n<p><strong>👉 </strong>এটা ভিডিও,অডিও,ছবি তোলার জন্য পারফেক্ট একটি কিট।</p>\r\n<p>👉 ছোট ছোট পার্ট থাকায় যেকোনো যায়গায় বহন করতে পারবেন&nbsp;</p>\r\n<p><strong>👉&nbsp;</strong>সাথে থাকছে এলইডি লাইট , মাইক্রোফোন, মোবাইল স্ট্যান্ড , টেবিল স্ট্যান্ড আরোও অনেক কিছু</p>\r\n<p><strong>👉 </strong>মাইক্রোফোন থাকায় সাউন্ড কোয়ালিটি নিয়ে আর ঝামলা না</p>\r\n<p><strong>👉&nbsp;</strong>সহজ ব্যবহারের জন্য রিমোট কন্ট্রোল।</p>\r\n<p><strong>Description</strong>:&nbsp;</p>\r\n<p>👉 Frequency Response: 50hz-16kHz</p>\r\n<p>👉 Sensitivity Enhancement: + 20db2db</p>\r\n<p>👉 Sensitivity: 45db3db(OBD=1V/PA at 1kHz)Equivalent</p>\r\n<p>👉 Noise level: 24dba</p>\r\n<p>👉 Maximum sound pressure level: 130dB(THD&le;1.5%at 1kHz)</p>\r\n<p>👉 Output Impedance: 200&Omega;30%(atkhz)</p>\r\n<p>👉 Power: 5W</p>\r\n<p>👉 Battery life: 1.5 hours at 6500k100% power</p>\r\n<p>👉 Net Weight: About 244g</p>\r\n<p>👉 Product size: 78.5mm*66.5mm*30.5mm</p>\r\n<p>👉 Noise Reduction: Yes</p>\r\n<p>👉 6500K LED Light</p>\r\n<p>👉 Universal Phone Clamp</p>\r\n<p>👉 Dual Use Tripod Handle</p>', 1400, 1190, 'SA-153', 0, 0, 1, '2022-10-09 10:08:10', '2022-10-09 10:08:10'),
(542, 4, 'Vintage T9 Trimmer', 'vintage-t9-trimmer', '<p><strong>Vintage T9 Trimmer</strong></p>\r\n<div dir=\"auto\">এই ট্রিমারটির বিশেষত্ব হচ্ছে, হাতে নিলে প্রিমিয়াম ফিল হয়।</div>\r\n<div dir=\"auto\">নিজের অথবা পছন্দের মানুষটির জন্য নিয়ে নিতে পারেন ট্রিমারটি। গিফটের জন্য সেরা একটি ট্রিমার।</div>\r\n<div dir=\"auto\">স্পেসিফিকেশনসঃ</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t9e/1/16/27a1.png\" alt=\"➡️\" width=\"16\" height=\"16\" /></span> চার্জিং টাইম- 2 ঘন্টা।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t9e/1/16/27a1.png\" alt=\"➡️\" width=\"16\" height=\"16\" /></span> ফুল চার্জে অনায়াসে 3 ঘন্টা ব্যবহার করা যায়।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t9e/1/16/27a1.png\" alt=\"➡️\" width=\"16\" height=\"16\" /></span> সাথে আছে 1.5-2-3-4 টোটাল ৪ সাইজের ক্লিপ।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t9e/1/16/27a1.png\" alt=\"➡️\" width=\"16\" height=\"16\" /></span> সম্পুর্ন মেটালের তৈরী।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t9e/1/16/27a1.png\" alt=\"➡️\" width=\"16\" height=\"16\" /></span> ভিন্টেজ কালার।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t9e/1/16/27a1.png\" alt=\"➡️\" width=\"16\" height=\"16\" /></span> লো নয়েজ।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t9e/1/16/27a1.png\" alt=\"➡️\" width=\"16\" height=\"16\" /></span> 1400 mAh Li-ion ব্যাটারী, চার্জার, ৪ সাইজের ক্লিপ, তেল এবং ব্রাশ।</div>', 1000, 880, 'SA-154', 0, 0, 1, '2022-10-10 15:24:52', '2023-01-05 10:42:33'),
(543, 4, 'Portable Mini Foldable Travel Iron', 'portable-mini-foldable-travel-iron', '<p><strong>Portable Mini Foldable Travel Iron</strong></p>\r\n<div dir=\"auto\">আপনি চাকরী করেন, কিন্তু সময়ের অভাবে কাপড় লন্ড্রী করতে পারেন না। অগোছালো কাপড় গায়ে দিয়েই অফিস যেতে হয় যা লজ্জাজনক । আর কাপড় লন্ড্রী করাটা অনেক ঝামেলার বিষয়। আর তাই এই সমস্যা থেকে পরিত্রান পেতে আমরা নিয়ে এসেছি মিনি পোর্টেবল ইলেকট্রিক আয়রন মেশিন ।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span> হ্যাঙ্ঘারে কাপড় রেখেই আপনি আপনার কাপড় সহজে লন্ড্রী করতে পারবেন</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span> এটা দিয়ে আপনি সকল ধরনের কাপড় লন্ড্রী করতে পারবেন অতি সহজে</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span> সাধারন আয়রনের মত এটা দিয়ে কাপড় পুরে যাওয়ার ভয় নেই</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span> আপনি বাড়িতে বসেই সহজে কাপড় লন্ড্রী করতে পারবেন</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span> আয়রন মেশিনটি ছোট হওয়ায় এটি যেকোন ভ্রমনে সাথে নিয়ে যেতে পারবেন</div>\r\n<div dir=\"auto\">\r\n<ul class=\"\">\r\n<li class=\"\">Model:- Travel Iron</li>\r\n<li class=\"\">Power:- 700 watts</li>\r\n<li class=\"\">Flat folding handle for easy packing</li>\r\n<li class=\"\">Dry steam spray</li>\r\n<li class=\"\">Push button for steam action</li>\r\n<li class=\"\">Safety automatic button</li>\r\n<li class=\"\">Vertical steam jet</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.3f1bzn9Czn9CRl\">Power On indicator</li>\r\n<li class=\"\">Particle iron for traveling</li>\r\n<li class=\"\">Variable and adjustable temperature controlling</li>\r\n</ul>\r\n</div>', 1100, 950, 'SA-155', 0, 0, 1, '2022-10-10 15:34:58', '2022-10-10 15:34:58'),
(544, 4, 'Rechargeable Folding Fan', 'rechargeable-folding-fan', '<div dir=\"auto\">Rechargeable Folding Fan</div>\r\n<div dir=\"auto\">লোডশেডিং নিয়ে এলাম খুব ভালো মানের একটি ফোল্ডিং ফ্যান একবার চার্জে টানা 6 ঘণ্টা লাইট ও 4 ঘন্টা ফ্যান চলবে।</div>\r\n<div dir=\"auto\"><strong>👉 </strong>Battery: 4V 1600mAh</div>\r\n<div dir=\"auto\"><strong>👉 </strong>Rechargeable Battery</div>\r\n<div dir=\"auto\"><strong>👉 </strong>5VUSB Charge time: 5-6hrs</div>\r\n<div dir=\"auto\"><strong>👉 </strong>Duration:3-4 hrs/high</div>\r\n<div dir=\"auto\"><strong>👉 S</strong>peed 4hrs-5hrs/low speed6-8hrs/strong Light</div>\r\n<div dir=\"auto\"><strong>👉 </strong>Diameter: 18cm</div>\r\n<div dir=\"auto\"><strong>👉 </strong>Unfold Height: 45cm</div>\r\n<div dir=\"auto\"><strong>👉 </strong>Folding Height: 15cm</div>\r\n<div dir=\"auto\"><strong>👉 </strong>Power Bank Output: 5V/0.6A</div>', 1550, 1290, 'SA-156', 1, 113, 1, '2022-10-10 16:26:42', '2023-06-20 11:56:06'),
(545, 4, 'Automatic Toothpaste Dispenser', 'automatic-toothpaste-dispenser', '<p><strong>Automatic Toothpaste Dispenser</strong></p>\r\n<div dir=\"auto\">(অটোমেটিক টুথপেষ্ট ডিসপেনসার)</div>\r\n<div dir=\"auto\"><strong>👉</strong>&nbsp;ঘুম থেকে উঠে সকাল বেলা ব্রাশ হাতে নিবেন আর হোল্ডারে ধরবেন, আর ম্যাজিকের মতোই টুথপেস্ট পড়বে আপনার ব্রাশে।</div>\r\n<div dir=\"auto\"><strong>👉 </strong>টুথব্রাশ প্রবেশ করানোর সাথে সাথেই অটোমেটিক ভাবে টুথপেষ্ট ব্রাশে প্রয়োজনমত জমা হবে।</div>\r\n<div dir=\"auto\"><strong>👉 </strong>টুথপেস্টের টিউব নিয়ে ঝামেলার কোন দরকারই হবে না।</div>\r\n<div dir=\"auto\"><strong>👉 </strong>কোন ইলেকট্রিক কানেকশন প্রয়োজন নেই।</div>\r\n<div dir=\"auto\"><strong>👉</strong>&nbsp;সহজে দেয়ালে লাগানোর জন্য রয়েছে অ্যাডহেসিভ প্যাড।</div>\r\n<div dir=\"auto\"><strong>👉</strong>&nbsp;স্টাইলিশ এবং আপনার ঘরের সৌন্দর্য বর্ধনে অসাধারণ।</div>\r\n<div dir=\"auto\"><strong>👉</strong>&nbsp;বাথরুম কিংবা বেসিনের পাশে সহজেই স্থাপনযোগ্য।</div>\r\n<div dir=\"auto\"><strong>👉 </strong>একসাথে টুথব্রাশ ডিসপেনসার এবং টুথব্রাশ হোল্ডার।</div>\r\n<div dir=\"auto\"><strong>👉 </strong>সুদৃশ্য (৫) ব্রাশ স্ট্যান্ডসহ।</div>\r\n<div dir=\"auto\"><strong>👉 </strong>ম্যাটেরিয়াল: PVC</div>', 590, 460, 'SA-157', 0, 0, 1, '2022-10-10 16:37:32', '2022-10-15 10:33:36'),
(413, 4, 'Baby Sleeping Blanket Bag', 'baby-sleeping-blanket-bag', '<p><strong>Baby Sleeping Blanket Bag</strong></p>\r\n<p>এই শীতে আপনার পরিবারের নতুন সদস্য (ছোট বেবীর) জন্য বেস্ট কোয়ালিটি সম্পুর্ণ Baby Blanket Bag সেট নিয়ে এসেছি। কোথাও ঘুরতে গেলে খুব সহজেই নিয়ে যেতে পারবেন।</p>\r\n<p>👉 এগুলো বাহিরে চায়না ব্লাংকেট, ভিতরে চায়না ফাইবার, থ্রি পার্ট।</p>\r\n<p>উন্নত মানের ফেব্রিক্স সহজে নষ্ট হবে না। 🤚 কেনো এটা ব্যবহার করবেন??</p>\r\n<p>✅ বাচ্চারা গায়ে কম্বল জাতীয় কিছু দিতে চায় না৷ ফলে ঠান্ডা লাগতে পারে। এটা ব্যবহারে ঠান্ডা লাগার সম্ভাবনা একদমই নেই।</p>\r\n<p>✅ বাচ্চারা অনেকবেশি নড়াচড়া করে। যে কারনে কম্বল ব্যবহার যথেষ্ট রিস্কি।</p>\r\n<p>✅ এটি সম্পূর্ণ এলার্জি ফ্রি ও শ্বাসযোগ্য।</p>\r\n<p>✅ এতোটাই সফ্ট আপনার সন্তান খুব আরামে ঘুমাবে।</p>\r\n<p>👉 বাচ্চারা হাত-পা ছোটাছুটি করলে হাতে ঠান্ডা লাগার সম্ভাবনা নাই।</p>\r\n<p>👉 খুব সহজেই ওয়াশ করতে পারবেন।</p>\r\n<p>👉 বাসার ভেতরে এবং বাইরে সব জায়গায় ব্যাবহার উপযোগী।</p>\r\n<p>👉 ওজনে হালকা হওয়ায় খুব সহজেই বাচ্চার শরীরে স্পষ্ট না করে যে কেউ কোলে নিতে পারবে।</p>', 650, 490, 'SA-27', 0, 0, 1, '2022-10-02 20:24:57', '2022-10-02 20:24:57'),
(561, 6, 'Comb Men Beard and Hair Quick Straightener', 'comb-men-beard-and-hair-quick-straightener', '<h4 id=\"gridSystemModalLabel\" class=\"modal-title see-title\"><strong>Comb Men Beard and Hair Quick Straightener</strong></h4>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> এই চিরুনি্টি মাত্র কয়েক মিনিটের মধ্যে আপনার চুলকে স্টাইলিশ করে তুলবে, স্ক্রাব থেকে তাৎক্ষণিকভাবে পরিষ্কার করবে।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> এটি চুলকে ভলিউমাইজ করতে পারে, পাশের চুল সমতল করতে পারে এবং কোঁকড়ানো চুল সোজা করতে পারে।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> এটি সাইজে ছোট হওয়ায় সাথে ক্যারি করতে পারবেন এবং অল্প সময়ের মধ্যেই চুল এবং দাড়ি স্ট্রেইট করতে পারবেন।&nbsp;</p>\r\n<ul>\r\n<li>চুলের কোন ক্ষতি নেই।</li>\r\n<li>ব্যবহারে নিরাপদ: চুলকে অতিরিক্ত গরম হওয়া থেকে বাঁচাতে প্রতিরক্ষামূলক পদ্ধতি ব্যবহার করা হয়েছে।</li>\r\n<li>&nbsp;লাইটওয়েট এবং এর্গোনোমিক হ্যান্ডেল: সহজে ক্লান্ত না হয়ে ধরে রাখা আরামদায়ক। Same as Picture</li>\r\n<li>&nbsp;দৈর্ঘ্য: 24.8 সেমি</li>\r\n<li>&nbsp;কেবল দৈর্ঘ্য: 170 সেমি</li>\r\n<li>&nbsp;সর্বোত্তম তাপমাত্রা: 120 ডিগ্রী&nbsp;</li>\r\n</ul>', 700, 590, 'SA-173', 0, 0, 1, '2022-10-11 05:21:25', '2022-10-11 05:21:25'),
(560, 4, 'USB Mosquito Killer Lamp', 'usb-mosquito-killer-lamp', '<h4 id=\"gridSystemModalLabel\" class=\"modal-title see-title\"><strong>USB Mosquito Killer Lamp</strong></h4>\r\n<p>ইলেকট্রনিক Mosquito কিলার এর সাহায্যে এখন মশার হাত থেকে বাঁচুন,&nbsp;</p>\r\n<p><strong>পণ্যের বৈশিষ্ট্য: </strong></p>\r\n<p>&nbsp;👉মশা তাড়াক (UV আলো)</p>\r\n<p>👉 মশা তাড়ানোর ধূপ মোড - বেগুনি-12h</p>\r\n<p>👉 ইনপুট: ইউএসবি 5 ভোল্ট 1 এম্পায়ার</p>\r\n<p>👉 পাওয়ার আলো: 5 ওয়াট পন্যের বিবরণ:</p>\r\n<p>✍️কোন রাসায়নিক, কোন গন্ধ এবং দূষণ মুক্ত, সম্পূর্ণ পরিবেশ বান্ধব, গর্ভবতী এবং শিশুদের জন্য নিরাপদ।</p>\r\n<p>👉 ব্যবহার করা সহজ এবং নিরাপদ: আপনাকে অভ্যন্তরীণ তার থেকে রক্ষা করার জন্য হুক, ল্যাম্পশেড এবং প্লাস্টিকের খাঁচা দিয়ে সজ্জিত। 👉 এটি শান্ত, আপনার ঘুমের ব্যাঘাত ঘটাবে না এবং আপনাকে একটি শান্ত রাত নিশ্চিত করে।</p>\r\n<p>👉 আকারে ছোট এবং বহন করা ও সুবিধাজনক। এটি আপনার জায়গার বেশি অংশ নেবে না।</p>\r\n<p>👉 ইনডোর, আউটডোর, পরিবার, শয়নকক্ষ, বসার ঘর, রান্নাঘর, অফিস, বাগান, ক্যাম্পিং, তাঁবু, ক্ষেত্র ইত্যাদির জন্য উপযুক্ত।</p>', 700, 550, 'SA-172', 0, 0, 1, '2022-10-11 05:10:49', '2022-10-11 05:10:49'),
(559, 4, 'Mobile Phone Holder', 'mobile-phone-holder', '<p><strong>Mobile Phone Holder Stand for Facetime Live Streaming</strong></p>\r\n<div dir=\"auto\">👉&nbsp;&nbsp;Material: ABS</div>\r\n<div dir=\"auto\">👉&nbsp;&nbsp;Use: Desk</div>\r\n<div dir=\"auto\">👉&nbsp;&nbsp;Item name: Desktop Table Mobile Phone Holder</div>\r\n<div dir=\"auto\">👉&nbsp;&nbsp;Feature : Smartphone Phone Holder Stand</div>\r\n<div dir=\"auto\">👉&nbsp;&nbsp;Color: Black</div>\r\n<div dir=\"auto\">👉&nbsp;&nbsp;Feature : Round Base ( Built-in metal block)</div>\r\n<div dir=\"auto\">👉&nbsp;&nbsp;Suitable for all Smartphone</div>', 580, 450, 'SA-171', 0, 0, 1, '2022-10-10 20:39:09', '2022-10-10 20:39:09'),
(558, 4, '𝗪𝗮𝘁𝗲𝗿𝗽𝗿𝗼𝗼𝗳 𝗣𝗵𝗼𝗻𝗲 𝗖𝗮𝘀𝗲 & 𝗛𝗼𝗹𝗱𝗲𝗿', '𝗪𝗮𝘁𝗲𝗿𝗽𝗿𝗼𝗼𝗳-𝗣𝗵𝗼𝗻𝗲-𝗖𝗮𝘀𝗲-and-𝗛𝗼𝗹𝗱𝗲𝗿', '<p><strong>𝗪𝗮𝘁𝗲𝗿𝗽𝗿𝗼𝗼𝗳 𝗣𝗵𝗼𝗻𝗲 𝗖𝗮𝘀𝗲 &amp; 𝗛𝗼𝗹𝗱𝗲𝗿 𝗳𝗼𝗿 𝗕𝗶𝗸𝗲 &amp; 𝗕𝗶𝗰𝘆𝗰𝗹𝗲</strong></p>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> সাইকেল/ বাইক Ride এর সময় যদি একটা মোবাইল স্ট্যান্ড না থাকে তাহলে কিভাবে? মোবাইল হাতে ধরে রাখাতো আর সম্ভব নয়। আর বৃষ্টি এলে তো কথায় নেই। শখের ফোনটা শেষ!!!!</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t8d/1/16/2611.png\" alt=\"☑️\" width=\"16\" height=\"16\" /></span>এই কথা মাথায় রেখে আপনাদের জন্য নিয়ে এলাম China থেকে 𝐈𝐦𝐩𝐨𝐫𝐭𝐞𝐝 𝐖𝐚𝐭𝐞𝐫𝐩𝐫𝐨𝐨𝐟 𝐇𝐚𝐧𝐝𝐞𝐥 𝐁𝐫𝐚𝐜𝐤𝐞𝐭. এটা সাইকেল এবং বাইক দুটোর সাথেই ইউজ করা যায়।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> এই মোবাইল হোল্ডারটি এবিএস + সিলিকা জেল দিয়ে তৈরি এবং ৩৬০ ডিগ্রী রোটেট করা যায়।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> স্মার্ট ও আকর্ষনীয় ফোন হোল্ডারটি যেকোনো রাইডারের জন্য উপযোগী। হোল্ডারটি বৃষ্টি, ধুলাবালি এবং যেকোনো আঘাত থেকে আপনার ফোনকে রক্ষা করবে।</div>', 780, 650, 'SA-170', 0, 0, 1, '2022-10-10 20:30:15', '2022-10-10 20:30:15'),
(556, 4, 'A9 Mini WiFi Camera', 'a9-mini-wifi-camera', '<p><strong>A9 Mini WiFi Camera 1080P</strong></p>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\">👉 </span>A9 Mini WiFi Camera 1080P Full HD Night Vision Wireless IP Camera</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\">👉 </span>এই ক্যামেরা টি আপনি আপনার বাসা, অফিস, দোকান, গ্যারেজ, ফ্যাক্টরি সহ যেকোনো স্থানে রেখে ক্যামেরার ন্যায় আপনার ফোন থেকে ভিডিও লাইভ দেখতে পারবেন ও ধারন করেও রাখতে পারবেন।সম্পূর্ণ নতুন মডেলের WiFi mini night vision camera. HD কোয়ালিটির এই ক্যামেরা টি দিয়ে WiFi এর সাহায্যে যেকোনো জায়গায় থেকে মোবাইলে লাইভ দেখা যাবে।</div>\r\n<div dir=\"auto\"><strong>&nbsp;বিস্তারিত পন্যের বিবরণঃ</strong></div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\">👉 </span>নাইট ভিশন ক্যামেরাটি রাতের অন্ধকারেও স্পষ্ট ভিডিও ধারণ করতে সক্ষম।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\">👉 </span>ক্যামেরাটি ২৪ ঘন্টা ভিডিও ধারণ ক্ষমতা রাখে।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\">👉 </span>বিদুৎ চলে যাওয়ার পর wifi বিচ্ছিন্ন হলে ১ ঘন্টা পর্যন্ত ক্যামেরাটি তে অফলাইন ভিডিও রের্কড হবে।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\">👉 </span>ক্যামেরাটি ৬৪ জিবি মেমোরি কার্ড সাপোর্টেড</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\">👉 </span>ম্যাগনেট ওয়াল মাউন্ট</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\">👉 </span>শার্ট ক্লিপ</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\">👉 </span>ক্যামেরা টি মোবাইলের অ্যাপ দ্বারা নিয়ন্ত্রনযোগ্য</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\">👉 </span>360 ডিগ্রি এংগেল পর্যন্ত ঘোরানো যায়</div>', 990, 780, 'SA-168', 0, 0, 1, '2022-10-10 20:09:45', '2022-10-10 20:09:45'),
(555, 4, 'Sim Supported Land Telephone', 'sim-supported-land-telephone', '<p><strong>Sim Supported Land Telephone</strong></p>\r\n<div dir=\"auto\">👉 আপনাদের দোকান/অফিস/বাসা/মাদ্রাসা/স্কুলে ব্যবহারের জন্য উপযোগী।দেয়ালে ঝুলিয়েও ব্যাবহার করতে পারবেন।যারা অনলাইনে ব্যবসা করেন তারাও নিতে পারেন।</div>\r\n<div dir=\"auto\">*সিম সাপোর্ট টেলিফোন মডেল</div>\r\n<div dir=\"auto\">HUAWEI TELEPHONE</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><strong>টেলিফোন বৈশিষ্ট্য:</strong></div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span> সিম সাপোর্টেড ল্যান্ডফোন, &gt;&gt; যে কোনো সিম কার্ড ব্যবহার করতে পারবেন যেমন : Grameenphone ৷৷৷ ,Banglalink, ৷৷৷ Robi,৷৷৷ Teletalk ৷৷৷ Airtel.</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>এটি একটি শক্তিশালী লিথিয়াম ব্যাটারি দ্বারা তৈরি।</div>\r\n<div dir=\"auto\">&gt;&gt;&gt; ১ বার চার্জ এ মিনিমাম ৩ দিন এর উপরে চলবে।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>কালার :সাদা এবং কালো</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>রিচার্জেবেল তাই যেকোনো জায়গায় সহজেই নিয়ে যেতে পারবেন</div>\r\n<div dir=\"auto\">সাপ্লিমেন্টারি সার্ভিস: কলার আইডি, কল ফরোয়াডিং, কল ওয়েটিং, কল হোল্ড, থ্রি-ওয়ে কলিংশর্ট মেসেজ২০০০ এন্ট্রি ফোনবুক</div>\r\n<div dir=\"auto\">স্ক্রিন রিঙ্গার ভলিয়ুম</div>\r\n<div dir=\"auto\">SMS ফিচার</div>\r\n<div dir=\"auto\">👉 মোবাইল নেট ওয়ার্ক এর সমস্যাপূর্ণ এলাকা সমুহ বিশেষ করে গ্রামে,এসি রুমে,ঘন বসতিপূর্ণ এলাকা,অতি উঁচু দালান,বেইজমেন্ট বা আন্ডার গ্রাউন্ডে</div>\r\n<div dir=\"auto\">ভাল সুবিধা পাওয়া যায় । এটা পরীক্ষিত ।</div>\r\n<div dir=\"auto\">👉 অফিস এর ফ্রন্ট ডেস্কে- যারা টি অ্যান্ড টি ফোনের ঝামেলা পোহাতে চান না তাদের জন্য এই ফোন ।</div>\r\n<div dir=\"auto\">👉 যাদের বাড়িতে বৃদ্ধ অভিভাবক আছেন এবং যারা স্মার্ট ফোন বা অন্য কোন ফোন ব্যবহার করতে অভ্যস্ত নন তাদের জন্য এই ফোন ।</div>\r\n<div dir=\"auto\">👉 ঘরে বা বাড়িতে একটি কমন(সকলের জন্য) ফোন হিসাবে ব্যবহার করা যায় ।</div>\r\n<div dir=\"auto\">👉 Customer Care বা Service Center-এ ব্যবহার উপযোগী ।</div>\r\n<div dir=\"auto\">👉 Flexi-load বা Bkash করার জন্য ব্যবহার করা যায় ।</div>\r\n<div dir=\"auto\">&nbsp;</div>', 2300, 1990, 'SA-167', 0, 0, 1, '2022-10-10 20:01:31', '2022-10-10 20:01:31'),
(554, 4, 'Capsule Umbrella', 'capsule-umbrella', '<p><strong><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t6f/1/16/2602.png\" alt=\"☂️\" width=\"16\" height=\"16\" /></span>Capsule Umbrella - ক্যাপসুল ছাতা <span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t6f/1/16/2602.png\" alt=\"☂\" width=\"16\" height=\"16\" /></span></strong></p>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/td/1/16/1f302.png\" alt=\"🌂\" width=\"16\" height=\"16\" /> </span>আকাশে বৃষ্টির ছোয়া <span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t6f/1/16/2602.png\" alt=\"☂️\" width=\"16\" height=\"16\" /></span></div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/td/1/16/1f302.png\" alt=\"🌂\" width=\"16\" height=\"16\" /> </span>Capsule Umbrella - ক্যাপসুল ছাতা <span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t10/1/16/2614.png\" alt=\"☔\" width=\"16\" height=\"16\" /></span></div>\r\n<div dir=\"auto\">হঠাৎ বৃষ্টি বা রোদ, থাকুক না!</div>\r\n<div dir=\"auto\">সাথে যদি সবসময় এমন কোন ছাতা থাকে যা সহজেই বহনযোগ্য তাহলে তো কোন চিন্তাই নেই।</div>\r\n<div dir=\"auto\"><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/td/1/16/1f302.png\" alt=\"🌂\" width=\"16\" height=\"16\" /> </span>ক্যাপসুল ছাতা - যা যেকোনো ব্যাগ, পকেট বা হাতে সহজেই বহন করা যায়। কেননা অধিকাংশ ক্ষেত্রে বহন করার ভয়ে আমরা ছাতা ব্যবহার থেকে বিরত থাকি। বৃষ্টির পর আবার ব্যাগে কিংবা পকেটে রাখতে পারেন। তখন ছাতাটি শুখানোর কোনো প্রয়োজন নেই যাস্ট ক্যাপসুলে ভরে ব্যাগে কিংবা পকেটে সহজেই রেখে দিতে পারবেন। এ ক্ষেত্রে আপনার ব্যাগ কিংবা পকেট কোনোটাই ভেজার কোনো সম্ভাবনা নেই।</div>\r\n<div dir=\"auto\">বহন করার চিন্তা শেষ।</div>\r\n<div dir=\"auto\">👉 Colour : Pink,Sky blue,Maroon</div>\r\n<div dir=\"auto\">👉 Type: 3 fold Umbrella</div>\r\n<div dir=\"auto\">👉 Size: 20\" inch long</div>\r\n<div dir=\"auto\">👉 Foldable size : 7\"</div>\r\n<div dir=\"auto\">👉 Fabric: Parachute</div>\r\n<div dir=\"auto\">👉 Ribs: 6 each</div>\r\n<div dir=\"auto\">👉 Brand: Chinese</div>', 670, 550, 'SA-166', 0, 0, 1, '2022-10-10 19:47:00', '2022-10-10 19:47:00'),
(553, 6, 'Capsule Cutter Blender', 'capsule-cutter-blender', '<p><strong>Capsule Cutter Blender</strong></p>\r\n<div dir=\"auto\">👉 নতুন ক্যাপসুল কাটার, একের ভিতর সব</div>\r\n<div dir=\"auto\">👉 এর সাহায্যে ম্যাজিকের মত নিমিষেই আদা, রসুন, পিয়াজ কুঁচি করা যাবে।</div>\r\n<div dir=\"auto\">👉 এর সাহায্যে কালোজিরা, জিরা, মেথি, সরিষা, গোলমরিচ, এলাচি, দারুচিনিসহ সব ধরনের মসলা পেস্ট করা যাবে।</div>\r\n<div dir=\"auto\">👉 মাংসে ব্লেন্ড করে চপ তৈরি করা যাবে।</div>\r\n<div dir=\"auto\">👉 যে কোনো প্রকার ফল এর জুস তৈরি করা যাবে।</div>\r\n<div dir=\"auto\">👉 বরফ কুচি করে মজাদার লাচ্চি তৈরি করা যাবে।</div>\r\n<div dir=\"auto\">👉 দামে সাশ্রয়ী এবং রান্নার কাজে খুবই প্রয়োজনীয় একটি মেশিন।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><strong>ক্যাপসুল কাটারে যা থাকছে:</strong></div>\r\n<div dir=\"auto\">👉 ব্লেড: স্টেইনলেস স্টিল</div>\r\n<div dir=\"auto\">👉 বডি ম্যাটেরিয়াল: ABS প্লাস্টিক</div>\r\n<div dir=\"auto\">👉 কভার: ট্রাইটোন(Triton)</div>\r\n<div dir=\"auto\">👉 কাপ: ট্রাইটোন(Triton)</div>\r\n<div dir=\"auto\">👉 পাওয়ার কনজাম্পশন: 200</div>', 1090, 990, 'SA-165', 0, 0, 1, '2022-10-10 19:30:02', '2022-10-10 19:30:58'),
(552, 7, 'Hair Straightener Brush', 'hair-straightener-brush', '<p><strong>Hair Straightener Brush</strong></p>\r\n<div dir=\"auto\"><strong>Description:</strong></div>\r\n<div dir=\"auto\">👉 ঘরে বসে কয়েকমিনিটে তৈরি করে ফেলুন আপনার মনের মত হেয়ার স্টাইল।</div>\r\n<div dir=\"auto\">👉&nbsp;Simply Hair Straightener</div>\r\n<div dir=\"auto\">👉&nbsp;ম্যাটেরিয়াল: Tourmaline</div>\r\n<div dir=\"auto\">👉&nbsp;সিরামিক পাওয়ার: 25W-39W</div>\r\n<div dir=\"auto\">👉&nbsp;ম্যাক্সিমাম টেম্পারেচার: সবোচ্চ 240&deg;, সর্বনিম্ন 120&deg; # পাওয়ার সোর্স: ইলেকট্রিক</div>\r\n<div dir=\"auto\">👉 থার্মোস্ট্যাট অ্যাডজাস্টমেন্ট সেগমেন্ট: 6</div>\r\n<div dir=\"auto\">👉&nbsp;ডায়ামিটার অফ থার্মাল কন্ডাক্টর: Less than15 m # ভোল্টেজ: 210-240V</div>\r\n<div dir=\"auto\">👉&nbsp;চুল স্ট্রেইট করার জন্য ব্যবহার করুন</div>\r\n<div dir=\"auto\">👉&nbsp;সব ধরণের চুলের জন্য উপযোগী</div>\r\n<div dir=\"auto\">👉&nbsp;চুল স্ট্রেইট করার জন্য ব্যবহার করুন</div>', 970, 890, 'SA-164', 0, 0, 1, '2022-10-10 18:10:21', '2022-10-10 18:10:21'),
(551, 7, '12 Volt High Pressure Water Pump', '12-volt-high-pressure-water-pump', '<p><strong>12 Volt High Pressure Water Pump</strong></p>\r\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">\r\n<div dir=\"auto\">👉&nbsp; আমাদের এই #১২ ভোল্ট পানির পাম্প# দিয়ে নিজে নিজে ওয়াশ করুন ১ বালতি পানি দিয়ে মাত্র ১০ মিনিটে এবং প্রতি ওয়াশে সেভ করুন ১৫০-২০০ টাকা।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n</div>\r\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">\r\n<div dir=\"auto\"><strong>ফুলসেট ওয়াটার পাম্পের সাথে যা যা পাচ্ছেনঃ</strong></div>\r\n<div dir=\"auto\">👉&nbsp;ডিসি 12V হাই প্রেসার মটর</div>\r\n<div dir=\"auto\">👉&nbsp;স্প্রে-গান</div>\r\n<div dir=\"auto\">👉&nbsp;পাইপ</div>\r\n<div dir=\"auto\">👉&nbsp;12v এডাপটার,</div>\r\n<div dir=\"auto\">👉&nbsp;আরো প্রয়োজনীয় যা যা দরকার।</div>\r\n<div dir=\"auto\"><strong>বিঃদ্রঃ </strong></div>\r\n<div dir=\"auto\">👉 ডিসি 12v এর ব্যাটারি দিয়েও চলবে।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n</div>\r\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">\r\n<div dir=\"auto\"><strong>এই ওয়াটার পাম্প দিয়ে আর যা যা করতে পারবেনঃ</strong></div>\r\n<div dir=\"auto\">👉 বাইক ওয়াশ করা</div>\r\n<div dir=\"auto\">👉&nbsp;কার ওয়াশ করা</div>\r\n<div dir=\"auto\">👉&nbsp;বাগানে পানি দেওয়া</div>\r\n<div dir=\"auto\">👉 কৃষি কাজে ও বিভিন্ন গাছে ঔষধ ছিটানোর কাজে</div>\r\n<div dir=\"auto\">👉&nbsp;নতুন বাসাবাড়িতে পানি দেওয়ার কাজে</div>\r\n</div>\r\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">&nbsp;</div>', 1120, 999, 'SA-163', 0, 0, 1, '2022-10-10 17:56:23', '2022-11-24 00:29:30'),
(550, 6, '3 Layer Clothing Rack', '3-layer-clothing-rack', '<p><strong>3 Layer Clothing Rack</strong></p>\r\n<div dir=\"auto\"><strong>Description:</strong></div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> Cloth Rack3 layer &ndash; 301 &ndash; HMS</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> ফ্যাশনেবল ডিজাইন নতুন</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> শক্তিশালী এবং থিকার পোলস</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> নীচে জুতো রাক তিনটি স্তর আছে ।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> শীর্ষে দুটি পাশের কাপড় হ্যাঙ্গারআছে ।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> 45 কেজি ওজন দিতে পারবেন সম্পূর্ণ র&zwnj;্যাক এ ও বাচ্চদের কাপড় রাখতে পারবেন।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> সাইজ : 2.5 x 5.57 ফুট</div>', 2950, 2250, 'SA-162', 0, 0, 1, '2022-10-10 17:46:26', '2022-11-08 16:44:51'),
(443, 4, 'Revoflex Xtreme Full Body Workout', 'revoflex-xtreme-full-body-workout', '<p><strong>Revoflex Xtreme Full Body Workout</strong></p>\r\n<div class=\"m8h3af8h l7ghb35v kjdc1dyq kmwttqpk gh25dzvf n3t5jt4f\">\r\n<div dir=\"auto\">যারা জিমে যাচ্ছেন বা যাবেন চিন্তা করছেন আর নয় জিম এখন কোন মাষ্টারী ব্যায়াম ছাড়াই নিজের জিম &amp; ফিটনেস নিজেই করুন!!</div>\r\n<div dir=\"auto\">(Gym Belt) \"Revoflex Xtreme\" - Gym &amp; Fitness</div>\r\n<div dir=\"auto\">(রিভফলেক্স এক্সট্রিমি - জিম &amp; ফিটনেস)</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><strong>বিবরণ :</strong></div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> &nbsp;অতি দ্রুত ও সহজে আপনার শরীরের আকৃতির আকর্ষণীয় পরিবর্তন আসবে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;যাবতীয় ব্যায়ামের ৬টি লেভেল নিদের্শনা টিপস থাকবে, যার মধ্যে ৪৪ প্রকারের এক্সারসাইজ করার পদ্ধতি বা ছবি থাকবে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> যারা জিমে গিয়ে ব্যায়াম করার কথা ভাবছেন তাদের জন্য আমরা নিয়ে এসেছি এই পন্যটি।খুব সহজেই আপনি বাসায় বসে ব্যায়াম করতে পারবেন।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;আপনি কিভাবে ব্যায়াম করবেন, তার যাবতীয় ছবি থাকবে। আপনি মনের মতো করে ব্যায়াম করতে পারবেন।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;এক্সপেড চেস্ট, ব্যাক, আর্মস, সোল্ডার্স এন্ড পজ ইন ওয়ান মোশন ইত্যাদি ব্যায়াম করা যাবে।</div>\r\n</div>\r\n<div class=\"l7ghb35v kjdc1dyq kmwttqpk gh25dzvf jikcssrz n3t5jt4f\">\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;ছেলে ও মেয়ে উভয়ে এই Revoflex Xtreme দিয়ে নিজের মতো করে ,যে কোন জায়গায় ব্যায়াম করতে পারবেন।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> এটি বহন করা সহজ সাথে একটি বহনকারী ব্যাগ ফ্রি! থাকবে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;মাত্রা: 43*19* 13sm.</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;ওজন: 900grms</div>\r\n</div>', 150, 950, 'SA-57', 0, 0, 1, '2022-10-04 05:13:05', '2022-11-24 00:33:32');
