(444, 4, 'Ladys Towel', 'ladys-towel', '<p><strong>Ladys Towel</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> খন চুল শুকাবে আরও দ্রুত।</p>\r\n<p>&lrm; <img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> মাইক্র-ফাইবার এর তৈরি এই আকর্ষণীও ম্যাজিক তোয়ালে আপনার চুলের পানি দ্রুত শুষে নিবে।&nbsp;</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> ৬-৭ মিনিট এ চুল শুকিয়ে যায়</p>\r\n<p><strong>Product Description: </strong></p>\r\n<p>100% Original Quality</p>\r\n<p>Material: Microfiber</p>', 430, 350, 'SA-58', 0, 0, 1, '2022-10-04 05:33:48', '2022-10-04 05:33:48'),
(607, 4, 'Hot Shower Race Digital', 'hot-shower-race-digital', '<h2><strong>Hot Shower Race Digital</strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</h2>\r\n<h5><span style=\"font-family: verdana, geneva, sans-serif;\">Product Description: 3 Temperatures: Hot, Warm, and Cold, Controlled through a sliding Key Produced in thermoplastic with high mechanical, Electrical and chemical resistance Special alloy heating element Parts made of copper and silver alloy Conductive parts made of copper alloy Safe and reliable- Manufactured under rigid safety standards Exclusive and safe grounding system Accessories: Hand shower with plastic hose and fixing support instant electric water heater</span></h5>', 1499, 1199, 'HTS 111', 0, 0, 1, '2023-01-06 01:55:38', '2023-01-06 02:05:46'),
(609, 4, 'SILK PROTINE SKIN REPAIR SOAP', 'silk-protine-skin-repair-soap', '<h1><strong>SILK PROTINE SKIN REPAIR &nbsp;SOAP</strong></h1>\r\n<ul class=\"\">\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.6b8akFtOkFtOso\">Freshta Hand Made Natural Almond Oil Soap Bar Functions: It helps to remove deaf Keratinocytes, inactive and old sebum extract, pimples etc. from your skin and give u a very glowing natural skin within 15 days. It also repair any damage skin to reproducer new skin cells . Its anti aging properties help to protect your skin from sun UVA and UVB. It\'s antioxidants nourish your skin against rough environmental toxins and humidity. Pimples, acne, wrinkles, and aging spots will reduce gradually by continuous use of this soap within one or two months.</li>\r\n</ul>\r\n<ul class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i2.6b8akFtOkFtOso\">\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.6b8akFtOkFtOso\">Uses: Use 2 times at a time when use in face or body. 1st time it will reduces oil, dust, sebum extraction from skin and 2nd time it will send nutrients to the roots of skin hair follicles. Use whenever you need to wash your body, hands and face at day time and night. For better result use it in morning, noon and before bed time.</li>\r\n</ul>\r\n<p>Product details of Freshta Hand Made Natural Almond Oil Soap Bar</p>\r\n<ul>\r\n<li>Freshta Hand Made Natural Almond Oil Soap Bar Functions: It helps to remove deaf Keratinocytes, inactive and old sebum extract, pimples etc. from your skin and give u a very glowing natural skin within 15 days. It also repair any damage skin to reproducer new skin cells . Its anti aging properties help to protect your skin from sun UVA and UVB. It\'s antioxidants nourish your skin against rough environmental toxins and humidity. Pimples, acne, wrinkles, and aging spots will reduce gradually by continuous use of this soap within one or two months.</li>\r\n<li>Uses: Use 2 times at a time when use in face or body. 1st time it will reduces oil, dust, sebum extraction from skin and 2nd time it will send nutrients to the roots of skin hair follicles. Use whenever you need to wash your body, hands and face at day time and night. For better result use it in morning, noon and before bed time.</li>\r\n</ul>', 1200, 999, 'BD768', 0, 0, 1, '2023-01-13 00:48:42', '2023-01-13 00:55:58'),
(446, 4, '34 Gird Egg Storage Box', '34-gird-egg-storage-box', '<p><strong>34 Gird Egg Storage Box</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Product Type-Egg Box<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> This egg container stores your eggs safely while preserving their freshness.<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Made of PP Free plastic, durably and hygienic, food-safe storage.<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Holds up to 34 eggs, can fit jumbo eggs. Clear for easy visibility.<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Store your eggs safely while preserving their freshness<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Practical,prevents breakage and waste.This portable Eggs Carrying Case Box is designed specially for carrying the eggs easily<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Color: White</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Material: PP<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Size: 34.5 * 25.5 * 7.5cm<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Distinctive see-through plastic egg holder make Perfect packag for hygienically. Items feature fresh for longer, securely stored, and neatly organized.<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> This egg holder keeps stacked items in securely place, whether in the freezer, refrigerator, or cupboard.<br /><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Package Contents: 1x Egg storage box</p>', 750, 650, 'SA-60', 0, 0, 1, '2022-10-04 16:49:45', '2022-11-08 18:29:55'),
(447, 4, 'Faucet Extender Pipe 360 Degree Rotating', 'faucet-extender-pipe-360-degree-rotating', '<p><strong>Faucet Extender Pipe 360 Degree Rotating</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.2791hzLshzLsk4\">Features：</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.2791hzLshzLsk4\">360&deg; Flexible Rotating：The faucet extender turn it or adjustable in whatever direction or angle you want, making it easy to clean oversize supplies in sink or such as big plates or pan etc.</li>\r\n<li class=\"\">High-Quality Materials：Food-grade silicone material, soft and safe, non-toxic and odorless. The all-copper interface is durable and does not rust. Filter design, rich foam to prevent water splashing. Remove the faucet nozzle Connect and tighten.</li>\r\n<li class=\"\">Extended Pipe ：With our Faucet extender, you can add an entire 20 / 50 cm to the length of your faucet. So it&rsquo;s more convenient for us when doing housework.</li>\r\n</ul>\r\n<p><strong>✅ </strong>Universal Installation：International universal four-point interface, suitable for most faucets. So you can use them in different scenes.</p>\r\n<ul class=\"\">\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i2.2791hzLshzLsk4\"><strong>Specifications:</strong></li>\r\n<li class=\"\">Type:Faucet Extension Hose</li>\r\n<li class=\"\">Length: 20 cm</li>\r\n<li class=\"\">Material: Copper+ Silicone</li>\r\n<li class=\"\">Color: Orange</li>\r\n<li class=\"\">Interface: Four-point Interface<strong>&nbsp;</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>', 720, 570, 'SA-61', 0, 0, 1, '2022-10-04 17:04:33', '2022-10-04 17:04:33'),
(448, 4, 'Trolley Rice Storage/Movable Food Container', 'trolley-rice-storagemovable-food-container', '<p><strong>Trolley Rice Storage/Movable Food Container</strong></p>\r\n<p><strong>✅ </strong>অনেক সময় ভারী কোনো চালের কন্টেইনার বা ফুড কন্টেইনার একজায়গা থেকে আরেক জায়গায় নিয়ে যেতে খুব কষ্ট হয়।&nbsp;</p>\r\n<p><strong>✅&nbsp;</strong>আর এই কষ্ট দূর করতে পারেন #TrollyRiceStorage টির মাধ্যমে।</p>\r\n<p><strong>✅ </strong>এটির ভেতর চাল রেখে আপনি অনায়াসে যেকোনো জায়গায় মুভ করতে পারবেন।</p>\r\n<p><strong>✅</strong> এছাড়া এর ভেতর ডাল ,চিনি,আটা ও অন্যান্য খাবারও রেখে দিতে পারবেন।</p>\r\n<p><strong>✅&nbsp;</strong>এটি চাকা বিশিষ্ট হওয়ায় খুব সহজেই একজায়গা থেকে আরেক জায়গায় নিয়ে যাওয়া যায়।</p>\r\n<p>👉Brand new &amp; high quality</p>\r\n<p>👉10 kg large capacity, transparent flip cover, easy to take rice</p>\r\n<p>👉Silicone sealing rig design, can effectively keep the food dry</p>\r\n<p>👉Strong &amp; durable, handle on both sides made it easier to move</p>\r\n<p>👉Can be stored various items like dry food &amp; other grains as well</p>\r\n<p>👉Space saving, narrow structure, can be easily placed in corner</p>\r\n<p>👉Perfect container trolley to store rice, flour, sugar, beans &amp; more</p>\r\n<p>👉Size: 38x28x13cm/14.96x11.02x5.11inch (HxLxW)</p>\r\n<p>👉Color &amp; Design: As Picture</p>\r\n<p>👉Material: Food Grade PP</p>\r\n<p>👉Capacity: 10kg</p>\r\n<p><strong>&nbsp;</strong></p>', 1370, 1120, 'SA-62', 0, 0, 1, '2022-10-04 17:19:55', '2022-10-04 17:19:55'),
(449, 4, 'Apron Cartoon Design Waterproof', 'apron-cartoon-design-waterproof', '<p><strong>Apron Cartoon Design Waterproof</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">Product Category: apron</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.65e0a538a538Ae\">Apron classification: sleeveless apron</li>\r\n<li class=\"\">Use: Antifouling</li>\r\n<li class=\"\">Material: PVC</li>\r\n<li class=\"\">Size:one size</li>\r\n<li class=\"\">Style: Cartoon</li>\r\n<li class=\"\">Suit: Cartoon</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i3.65e0a538a538Ae\">Pattern:Cartoon/Anime</li>\r\n<li class=\"\">Patent: no</li>\r\n<li class=\"\">Color: Kt picture is randomly sent, jingle style</li>\r\n<li class=\"\">Whether the cross-border export special source</li>\r\n</ul>', 250, 190, 'SA-63', 0, 0, 1, '2022-10-04 17:31:14', '2022-10-04 17:31:14'),
(450, 4, 'Wall Seasoning Spice Box', 'wall-seasoning-spice-box', '<p><strong>Wall Seasoning Spice Box</strong></p>\r\n<p>Wall Seasoning Spice Box&nbsp; </p>\r\n<p>🔹Brand new &amp; high quality </p>\r\n<p>🔹180&deg; rotatable, wall-mounted design, can put a variety of spices </p>\r\n<p>🔹No need to punch holes or drill, easy installation, no damage! </p>\r\n<p>🔹Can keep separate different condiments to prevent cross-flavor </p>\r\n<p>🔹Each floor is equipped with a lid to prevent dust &amp; moisture </p>\r\n<p>🔹Space saving, transparent container, easy to see inside contents </p>\r\n<p>🔹Durable &amp; long-lasting, drawer structure, odorless &amp; hygienic </p>\r\n<p>🔹With 4 hooks design at the bottom to hang small kitchen items </p>\r\n<p>🔹Enough capacity to hold salt, sugar, nuts, cereal &amp; other spices </p>\r\n<p>🔹Size: 31x12.7x6.7cm/12.2x5x2.63inch (4 Layers) </p>\r\n<p>🔹Color &amp; Design: As Picture </p>\r\n<p>🔹Material: ABS </p>\r\n<p>🔹Imported From China</p>', 1100, 890, 'SA-64', 0, 0, 1, '2022-10-04 17:43:21', '2022-10-04 17:43:21'),
(451, 4, 'Manual Juicer Hand Pressure Fruit Squeezer', 'manual-juicer-hand-pressure-fruit-squeezer', '<p><strong>Manual Juicer Hand Pressure Fruit Squeezer</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">Package quantity: 1pc</li>\r\n<li class=\"\">Size: 230*120*100mm</li>\r\n<li class=\"\">Material: aluminum alloy</li>\r\n<li class=\"\">Easy to carry and easy to use.</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.b0b99Z5J9Z5J82\">Aluminum Alloy Manual Juicer Pomegranate Juice Squeezer Pressure Lemon Sugar Cane Juice Kitchen Fruit Tool</li>\r\n</ul>\r\n<ul class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i2.b0b99Z5J9Z5J82\">\r\n<li class=\"\"><strong>Description:</strong></li>\r\n<li class=\"\">Color: silver</li>\r\n<li class=\"\">Size: 230*120*100mm</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i3.b0b99Z5J9Z5J82\">Material: aluminum alloy</li>\r\n<li class=\"\">Package quantity: 1pc</li>\r\n</ul>', 950, 790, 'SA-65', 0, 0, 1, '2022-10-04 17:56:52', '2022-10-04 17:56:52'),
(452, 7, 'Glass Oil Control Oil Pot', 'glass-oil-control-oil-pot', '<p><strong>Glass Oil Control Oil Pot</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> আপনি বোতল টিতে বিভিন্ন ধরণের তেল যেমন সয়াবিন তেল, সরিষার তেল, জলপাই এর তেল রাখতে পারবেন। পাশাপাশি ভিনেগার, সয়া সস এসব ও রাখতে পারবেন।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> আপনি এটা ব্যবহার করলে এর স্বচ্ছ তলার সাহায্যে ভিতরে কোন তেল রেখেছেন তা দেখতে পারবেন। পাশাপাশি, তেল ঢালার সময় আপনি সুনিশ্চিতভাবে তেল এর পরিমাণ নিয়ন্ত্রণ করতে পারবেন ফলে আপনার রান্নায় তেলের পরিমাণ ঠিক থাকবে। ★বোতলটার ক্যাপাসিটি ৫০০ মিলি।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> বোতল এর মুখ খুলে এর মধ্যে তেল বা ভিনেগার সহজেই ঢালতে পারবেন।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> রান্না করার সময় এক হাত ব্যবহার করেই তেল ঢালা যাবে।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> বোতল টা পরিষ্কার করার জন্য এর মধ্যে গরম পানি, ডিটারজেন্ট এসব দিয়ে ওয়াশ করতে পারেন।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> বোতলটি মূল বডি স্টেইনলেস স্টিল এর, তলা এবং উপরের দিকে অল্প একটু জায়গা গ্লাস দিয়ে বানানো এবং বোতলের মুখ টা রাবার দিয়ে বানানো।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> সাইজঃ ১১*২.৯ ইঞ্চি।</p>', 770, 550, 'SA-66', 0, 0, 1, '2022-10-04 18:07:35', '2022-10-04 18:07:35'),
(453, 7, 'Cooking Lunch Box', 'cooking-lunch-box', '<p><strong>Cooking Lunch Box</strong></p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> ওজন:</strong> ডবল লেয়ারের জন্য প্রায় 1000 গ্রাম, তিন স্তরের জন্য প্রায় 1200 গ্রাম&nbsp;</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />&nbsp;</strong> আকার: ডবল স্তরের জন্য প্রায় 15x15 সেমি, তিনটি স্তরের জন্য 15x20 সেমি</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />&nbsp;</strong>রেটেড পাওয়ার সাপ্লাই: 220V/50HZ&nbsp;</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /></strong>রেটেড পাওয়ার: 250W</p>\r\n<p><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />&nbsp;</strong>ক্ষমতা: ডাবল-লেয়ারের জন্য প্রায় 1.3 লিটার, তিন-স্তরের জন্য প্রায় 2 লিটার&nbsp;</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> যা তৈরী করা যাবে: সিদ্ধ ডিম, ভাত, মাংস, সবজি, গরম স্যুপ ইত্যাদি।</p>\r\n<p>&nbsp;</p>', 1600, 1350, 'SA-67', 0, 0, 1, '2022-10-04 18:27:03', '2022-10-04 18:27:03'),
(454, 7, 'Fashion Glass Automatic Flip Oiler', 'fashion-glass-automatic-flip-oiler', '<p><strong>Fashion Glass Automatic Flip Oiler</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> এটি একটি অয়েল ডিসপেনসার</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> তেল রাখতে পারবেন, ঢালতে পারবেন</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> যখন নিচের দিকে ঢালবেন তখন এটার লিড খুলবে আর যখন উপর দিকে নিবেন সঙ্গে সঙ্গে বন্ধ হয়ে যাবে।&nbsp;</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> এক কথায় তেল চুয়ে চুয়ে পরবে না</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> খুবই হাই কোয়ালিটির</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> সহজে পরিষ্কার করা যাবে কোনো রকম গন্ধ হবে না এবং দিস্কলার হবে না, টিকবে বহু দিন</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> চায়না থেকে ইমপোর্ট করা</p>\r\n<ul class=\"\">\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.20dbpAaRpAaRFR\">Glass Automatic Flip Oiler J-927.</li>\r\n<li class=\"\">Glass Oil Bottle Soy Sauce Vinegar Spice Jar</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i2.20dbpAaRpAaRFR\">Condiment Bottles Kitchen Accessories</li>\r\n<li class=\"\">Oiler Seasoning Storage</li>\r\n</ul>\r\n<ul class=\"\">\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i3.20dbpAaRpAaRFR\">Auto Flip Oil Dispenser Bottle Glass Leak-proof Oil Jar Seasoning Soy Sauce Jar</li>\r\n<li class=\"\">.Made of quality PP + glass, food-graded, non-toxic and durable</li>\r\n</ul>\r\n<p>&nbsp;</p>', 850, 675, 'SA-68', 0, 0, 1, '2022-10-04 18:41:58', '2022-10-04 18:41:58'),
(455, 4, 'Ice Ball Maker Tray', 'ice-ball-maker-tray', '<p><strong>Ice Ball Maker Tray</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">Specification:</li>\r\n<li class=\"\">Type: Ice tray kettle</li>\r\n<li class=\"\">size: 21X12cm</li>\r\n<li class=\"\">Color: green, blue Features:</li>\r\n<li class=\"\">1.The curling pot can be put into cocktails, iced coffee, iced tea, juice, beer, water and other beverages</li>\r\n<li class=\"\">2.Suitable for family gatherings, family bars, restaurants, beaches, holiday activities, easy to carry</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.6815jpIjjpIjUc\">3.Non-toxic and leak-proof, this durable ice tray will not crack or break. Easy to fill, remove and clean</li>\r\n<li class=\"\">4.The pitcher&rsquo;s design is easy to fill with water</li>\r\n<li class=\"\">5.The cap and body are designed to prevent loss</li>\r\n<li class=\"\">6.Flexible disassembly, better performance</li>\r\n</ul>', 980, 790, 'SA-69', 0, 0, 1, '2022-10-04 18:56:23', '2022-10-04 18:56:23'),
(456, 4, 'Flex Tape', 'flex-tape', '<p><strong>Waterproof Sealing Tape Flex Tape&nbsp;</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">Made in China</li>\r\n<li class=\"\">Good Quality Product</li>\r\n<li class=\"\">Easy to use: Remove the backing sticker and paste it into the thing you want to stick.</li>\r\n<li class=\"\">Excellent material quality: It is made of high-quality hot melt adhesive and fits tightly to make the water pipe no longer leak.</li>\r\n<li class=\"\">Durable,its adhesion remains strong even if after being placed for a long time.</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.7a074RZl4RZlEp\">Excellent effect: all the blisters or bubbles can be removed by pressing hard, and the sealing effect is excellent.</li>\r\n<li class=\"\">Color: Black And White</li>\r\n<li class=\"\">Packages 1 Pc</li>\r\n</ul>', 370, 290, 'SA-70', 0, 0, 1, '2022-10-04 19:13:11', '2022-10-04 19:13:11'),
(457, 4, 'Wall-Mounted Grain Storage Bucket', 'wall-mounted-grain-storage-bucket', '<p><strong>Wall-Mounted Grain Storage Bucket</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> 10KG Wall Mounted Separate Rice Bucket - Cereal Dispenser Moisture Proof - plastic Automatic Storage BoxFeatures:</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Air-Tight:It make these storage containers airtight. Airtight storage system will always keep your food dry and fresh</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Easy stick-on installation with its super strong holding power, use it on wall or the refrigerator door will save you a lot of space</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Multipurpose:These containers are suitable for storing flour, sugar, rice, nuts, beans, cereal, snacks, pet food.Easy stick-on installation with its super strong holding power, use it on wall or the refrigerator door will save you a lot of space</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Each one has a cover make sure it seals the box, Just press to get them out with no mess</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Make your kitchen clean and tidy with Wall Mounted Cereal Dispenser, you can get what you need instantly with its transparent body</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Material:plastic</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Size: One Size</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Length:38cm(14.96in)</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Width:32.4cm(12.76in)</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Height:14.4cm(5.67in)</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Quantity: 1pc</p>', 1950, 1690, 'SA-71', 0, 0, 1, '2022-10-04 19:23:20', '2022-10-04 19:23:20'),
(458, 4, 'Rice Bucket Storage 12kg', 'rice-bucket-storage-12kg', '<p><strong>Rice Bucket Storage 12kg</strong></p>\r\n<p>12kg household kitchen rice bucket waterproof and moisture-proof large capacity</p>\r\n<p><strong>Product Details-</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Material: PP Polypropylene.</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Colour: Blue/Grey.</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Capacity: 12KGSize: 34x17x41cm.</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;&nbsp;Package included:1X Rice tank 1X Measuring cup</p>', 1770, 1390, 'SA-72', 0, 0, 1, '2022-10-04 19:38:39', '2022-10-04 19:38:39'),
(459, 4, 'Wall Mounted Kitchen Rack', 'wall-mounted-kitchen-rack', '<p><strong>Wall Mounted Kitchen Rack</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.5e7e8nZI8nZId4\">Product Name: Wallmounted Kitchen Rack Knife Holder Package Includes-</li>\r\n<li class=\"\">1 * Knife Holder</li>\r\n<li class=\"\">1 * Utensil Holder</li>\r\n<li class=\"\">1 * Towel Bar</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i2.5e7e8nZI8nZId4\">1 * Nail-free Glue</li>\r\n<li class=\"\">1 * Screw Kit Set</li>\r\n<li class=\"\">8 * Removable Hooks</li>\r\n</ul>\r\n<div class=\"html-content detail-content\">\r\n<p data-spm-anchor-id=\"a2a0e.pdp.product_detail.i3.5e7e8nZI8nZId4\"><strong>Package Includes</strong>:<br />👉 1 * Knife Holder<br />👉 1 * Utensil Holder<br />👉 1 * Towel Bar<br />👉 1 * Nail-free Glue<br />👉 1 * Screw Kit Set<br />👉 8 * Removable Hooks</p>\r\n</div>\r\n<div class=\"pdp-mod-specification\">&nbsp;</div>', 970, 690, 'SA-73', 0, 0, 1, '2022-10-04 19:53:52', '2022-10-04 19:53:52'),
(460, 7, 'Electronic Kitchen Scale', 'electronic-kitchen-scale', '<p><strong>Electronic Kitchen Scale</strong></p>\r\n<p>👉 ডিজিটাল স্কেল হওয়ায় পরিমাপ সঠিক হয়।</p>\r\n<p>👉 সুক্ষ পরিমাপ করার জন্য এটি খুবই উপযোগী।</p>\r\n<p>👉 বাসা,অফিস বা দোকানের দ্রব্যাদির মাপামাপির জন্য বেশ কার্যকরী।</p>\r\n<p>👉 স্কুল-কলেজ ও ল্যাবরেটরিতে এটার ব্যবহার অপরিসীম।&zwj;</p>\r\n<p>👉 মাছ-মাংস,ফলমূলসহ প্রয়োজনীয় সবকিছুই মাপা যায়।</p>\r\n<p>👉 কোরবানির মাংস সঠিকভাবে মাপার জন্য এটা অনেক প্রয়োজনীয়।</p>\r\n<p>👉 স্কেলে 0(জিরো) রিসেটিং করার সিস্টেম আছে।</p>\r\n<p>👉 ফলে,Scale এর উপর কোন বাটি রেখে 0(জিরো) করেও Use করা যায়।</p>\r\n<p>👉 গ্রাম/আউন্স এ মাপতে পারবেন। 10kg/353oz পর্যন্ত পরিমাপ করতে পারবেন।</p>\r\n<p>👉 সর্বনিম্ন 1g/0.1oz এ মাপতে পারবেন।</p>\r\n<p>👉 পরিমাপ করার সেন্সরটি খুবই উন্নতমানের।</p>\r\n<p>👉 সাথে ২ টি 1.5V AA ব্যাটারি দেওয়া</p>\r\n<p>&nbsp;</p>', 750, 470, 'SA-74', 0, 0, 1, '2022-10-04 20:08:51', '2022-10-04 20:08:51'),
(461, 7, 'Mini Capsule Cutter', 'mini-capsule-cutter', '<p><strong>Mini Capsule Cutter</strong></p>\r\n<p><strong>এটি চার্জে চালিত ব্লেন্ডার মেশিন।</strong></p>\r\n<div dir=\"auto\">👉 এর সাহায্যে ম্যাজিকের মত নিমিষেই আদা, রসুন, পিয়াজ কুঁচি করা যাবে।</div>\r\n<div dir=\"auto\">👉 এর সাহায্যে কালোজিরা, জিরা, মেথি, সরিষা, গোলমরিচ, এলাচি, দারুচিনিসহ সব ধরনের মসলা পেস্ট করা যাবে।</div>\r\n<div dir=\"auto\">👉 এটার দ্বারা সহজেই যেকোনো কিছু কুচি করে নিতে পারবেন।</div>\r\n<div dir=\"auto\">👉 বাচ্চাদের যেকোনো খাবার পেস্ট করে নিতে পারবেন।</div>\r\n<div dir=\"auto\">👉 সবচেয়ে বড় কথা হচ্ছে এটা যে কোন জায়গায় ক্যারি করে নিয়ে যাওয়া যাবে।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">\r\n<ul class=\"\">\r\n<li class=\"\">Material: stainless steel +PP</li>\r\n<li class=\"\">Battery voltage: 3.7V</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.6a65z2k3z2k3Av\">Rated current: 1A</li>\r\n<li class=\"\">Rated power: 45W</li>\r\n</ul>\r\n</div>', 850, 690, 'SA-75', 0, 0, 1, '2022-10-04 20:22:04', '2022-10-04 20:22:04'),
(462, 7, 'Nima 2 in 1 Blender', 'nima-2-in-1-blender', '<p><strong>Nima 2 in 1 Blender</strong></p>\r\n<p>2 in 1 Nima ইলেকট্রিক গ্রাইন্ডার এবং ব্লেন্ডার সকল প্রকার মসলা ব্লেন্ড ও যে কোন ধরনের জুস তৈরি হবে এটা দিয়ে।</p>\r\n<p><strong>পন্যের বিবরণ-</strong></p>\r\n<p>👉 সব ধরনের জুস করা যাবে।</p>\r\n<p>👉 পেয়াজ,রসুন,আদা সহ সকল প্রকার মসলা ব্লেন্ডার করা যাবে।</p>\r\n<p>👉 কালোজিরা, শুকনা মরিচ, জিরা, মেথি, সরিষা, গোলমরিচ, এলাচি, দারুচিনি সহ যেকোন ধরনের ডাল, বাদাম ইত্যাদি গুড়া বা পাউডার করা যাবে মাত্র কয়েক সেকেন্ডে।</p>\r\n<p>👉&nbsp; আকর্ষনীয় ডিজাইন</p>\r\n<p>👉&nbsp;স্টেইনলেস স্টিল ব্লেড</p>\r\n<p>👉 শক্তিশালী মটর</p>\r\n<p>👉 পাওয়ার: 200W</p>\r\n<p>👉&nbsp; Motor speed: 14500 R.P.M</p>\r\n<p>👉&nbsp; উচ্চতা: 10 inch</p>\r\n<p>👉 ম্যাটেরিয়ালঃ স্টেইনলেস স্টীল।</p>', 1390, 1150, 'SA-76', 0, 0, 1, '2022-10-04 20:40:40', '2022-11-08 18:20:05'),
(463, 4, '3 Layer Dish Drainer', '3-layer-dish-drainer', '<p><strong>3 Layer Dish Drainer</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">Color: Silver.</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.200a3eCI3eCIvM\">Material: Iron</li>\r\n<li class=\"\">Size: 45 x 25 x 40 cm.(H x W x L)</li>\r\n<li class=\"\">Organizes your kitchen perfectly</li>\r\n<li class=\"\">Offers much space for draining and drying after washing dish</li>\r\n<li class=\"\">Draining trays &amp; utensil holder are easy to remove</li>\r\n<li class=\"\">Includes 2 racks for storing small essentials</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i2.200a3eCI3eCIvM\">Rust resistant &amp; durable</li>\r\n<li class=\"\">Chrome plated</li>\r\n<li class=\"\">Easy to assemble</li>\r\n<li class=\"\">Large Capacity</li>\r\n</ul>', 2190, 1750, 'SA-77', 0, 0, 1, '2022-10-04 20:50:49', '2022-10-04 20:50:49'),
(464, 7, 'Electric Doi (Yogurt) Maker', 'electric-doi-yogurt-maker', '<p><strong>Electric Doi (Yogurt) Maker (1 Litre)</strong></p>\r\n<p><strong>Details-</strong></p>\r\n<p>👉 হাতের কোন স্পর্শ ও পরিশ্রম ছাড়াই তৈরি হবে দই</p>\r\n<p>👉 লাইট ইনডিকেটর</p>\r\n<p>👉 ব্র্যান্ড নিউ</p>\r\n<p>👉 হাই কোয়ালিটি</p>\r\n<p>👉 একবারে এক লিটার দই করতে পারবেন।&nbsp;</p>\r\n<div dir=\"auto\"><strong>কিভাবে বানাবেন-</strong></div>\r\n<div dir=\"auto\">একটি পরিষ্কার কড়াই বা পাতিলে দেড় থেকে দুই লিটার দুধ ছেঁকে ঢেলে দিন। কড়াই চুলাতে বসান। এবার জ্বাল দিতে থাকুন। চুলায় আগুন যত ধীরে জ্বলবে দই তত সুস্বাদু হবে। দুধ ফুটিয়ে এক কেজিতে এলে তাতে চিনি ঢেলে দিন। চিনি না গলা পর্যন্ত অপেক্ষা করুন। দুধ উথলে উঠলে কড়াই নামিয়ে ফেলুন। ঠান্ডা না হওয়া পর্যন্ত অপেক্ষা করুন। এবার দই মেকারের মধ্য দুধ ঢেলে দিন । পুরোনো এক চিমটি দই দুধের সঙ্গে ভালোভাবে মেশান। এবার দই মেকার ইলেক্ট্রিক লাইনে দিন। শীতকালে সাধারণত ২-৩ ঘণ্টা আর গরমকালে ৪-৬ ঘণ্টা সময় নিন (মাত্র ১৫ ওয়াট হওয়ায় এটি বিদ্যুৎ সাশ্রয়ীও)। তাহলেই তৈরী হয়ে যাবে আপনার মনের মত পছন্দের দই।</div>\r\n<p>&nbsp;</p>', 900, 690, 'SA-78', 0, 0, 1, '2022-10-04 21:03:06', '2022-10-04 21:03:06'),
(465, 7, 'BBQ Gril Electric', 'bbq-gril-electric', '<p><strong>BBQ Gril Electric</strong></p>\r\n<p>👉&nbsp; ইলেকট্রিক BBQ গ্রিল মেকার </p>\r\n<p>👉&nbsp; BBQ গ্রিল তৈরী করার একটি ইলেকট্রিক টুল </p>\r\n<p>👉&nbsp; মাংস বা সী-ফুড, ভেজিটেবল, প্যানকেক গ্রীল, বেক, ফ্রাই করার উপযোগী </p>\r\n<p>👉&nbsp; অ্যাডজাস্টেবল হিট কন্ট্রোল | *হালকা, মজবুত, পোর্টেবল </p>\r\n<p>👉&nbsp; স্টেইনলেস স্টীল হিটিং এলিমেন্ট&nbsp;</p>\r\n<p>👉 হিট-রেজিস্ট্যান্ট গ্রীপ </p>\r\n<p>👉&nbsp; নন-স্টিক প্যান </p>\r\n<p>👉&nbsp;পাওয়ার সোর্স: AC 220-240v/50Hz. </p>\r\n<p>👉 পাওয়ার: 2000W | </p>\r\n<p>👉 ডাইমেনসন: ৫১x৫০x৩৭সে.মি.</p>\r\n<p>👉&nbsp; হাই কোয়ালিটি প্রোডাক্ট |`</p>', 1800, 1490, 'SA-79', 0, 0, 1, '2022-10-04 21:16:22', '2022-10-04 21:16:22'),
(466, 4, 'Nicer Dicer Quick 5 in 1', 'nicer-dicer-quick-5-in-1', '<p><strong>Nicer Dicer Quick 5 in 1</strong></p>\r\n<p>&nbsp;নাইসার ডাইসার ভেজিটেবল কাটার</p>\r\n<p>👉 ক্লিকে 30 ডাইস বা 10 টি টুকরো গ্রাইন্ড করতে পারেন</p>\r\n<p>👉 নাইসার ডাইসার এর সাহায্যে সহজেই আপনি এখন সালাদ বা ফল স্লাইস, গ্রেট ও গ্রাইন্ড করতে পারেন</p>\r\n<p>👉 আপনার আঙ্গুল কখনোই ব্লেড স্পর্শ করবে না</p>\r\n<p>👉 ব্যবহার করা নিরাপদ</p>\r\n<p>👉 ম্যাটেরিয়ালঃ স্টেইনলেস স্টিল</p>\r\n<p>👉 ব্লেড বডিঃ ABS</p>\r\n<p>👉 রেসিন, কাপ ও কভারঃ Toraitan রেসিন</p>\r\n<p>👉 খুব সহজে পটেটো, অনিওন, টমেটো,</p>\r\n<p>👉 কিউকাম্বার,ক্যারট, ইত্যাদি ফ্রুট ও সবজি চপ করা যায়</p>\r\n<p>👉 আনব্রেকেবেল বডি</p>\r\n<p>👉 সহজেই পরিষ্কার করা যাবে&nbsp;</p>\r\n<p>&nbsp;</p>', 590, 450, 'SA-80', 0, 0, 1, '2022-10-04 21:32:09', '2022-10-04 21:32:09'),
(467, 4, 'BBQ Manual Grill Stand', 'bbq-manual-grill-stand', '<p><strong>BBQ Manual Grill Stand</strong></p>\r\n<p>&nbsp;</p>\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul class=\"\">\r\n<li class=\"\">GO ANYWHERE: This tiny portable charcoal grill can go with you and your family for a road trip or a beach party etc. Perfect for 3-5 people family/party.</li>\r\n<li class=\"\">COMPACT and STURDY: Made of cold-rolled iron and premium chrome Wire mesh. Heat-resistant and scratch-resistant. Legs are more sturdy than similar products.</li>\r\n<li class=\"\">FOLDABLE EASY STORAGE: It can be folded away after you use. Handle designed make it save space and is convenient to take it to anywhere to have fun.</li>\r\n<li class=\"\">12 AIRWAY VENT: Star a fire Faster and Easier with 12 Airway Vent design. Easy to clean as the baking net can be pulled out. WARNING: Use it on a flat, sturdy surface or table.</li>\r\n<li class=\"\">PERFECT GIFT: Uten folding portable lightweight BBQ grill is a perfect BBQ tool for beach, picnics, parties, trailers, a camping trip or anywhere you want.</li>\r\n<li class=\"\">Specifications:</li>\r\n<li class=\"\">ight &amp; portable</li>\r\n<li class=\"\">Clean and smokeless grilling</li>\r\n<li class=\"\">Durable stainless steel heating element</li>\r\n<li class=\"\">With ignition device: Not included</li>\r\n<li class=\"\">Fuel: Charcoal</li>\r\n<li class=\"\">Model: KYZ-SKL013</li>\r\n<li class=\"\">Structure: One piece</li>\r\n<li class=\"\">Applicable: 3 - 5 persons</li>\r\n<li class=\"\">Stove type: Combination stove</li>\r\n<li class=\"\">Material: Stainless Steel</li>\r\n<li class=\"\">Outdoor use</li>\r\n<li class=\"\">Weight: 2kg</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.4796I40kI40kSx\">Open Size: 35 x 27 x 19.5cm</li>\r\n<li class=\"\">Heat resistant painted, health care</li>\r\n<li class=\"\">Chrome plated, stainless quality</li>\r\n<li class=\"\">Good air vents design, easy to make fire</li>\r\n<li class=\"\">Cooking equipment for outdoor camping</li>\r\n<li class=\"\">Family gathering party barbecue roasting picnic</li>\r\n</ul>\r\n</div>\r\n<div class=\"html-content detail-content\">&nbsp;</div>', 1170, 950, 'SA-81', 0, 0, 1, '2022-10-05 03:52:13', '2022-10-05 03:52:13'),
(468, 4, 'Multifunction Electric Sharpener', 'multifunction-electric-sharpener', '<p><strong>Multifunction Electric Sharpener</strong></p>\r\n<p><strong>বৈশিষ্ট্য:&nbsp;</strong></p>\r\n<p><strong>👉 মাল্টিফাংশনাল - </strong>সব ধরণের পরিবারের ছুরি এবং কাঁচিগুলির জন্য উপযুক্ত</p>\r\n<p><strong>👉 সরল অপারেশন-</strong>&nbsp;মানবদেহের স্ট্রীমলাইন ইঞ্জিনিয়ারিং বিভিন্ন বিশেষ টুল রিলিফ গ্রাইন্ডিং প্রযুক্তির সাথে একত্রিত হয়, যা পরিচালনা করা সহজ এবং ব্যবহার করা আরও সুবিধাজনক</p>\r\n<p><strong>👉 নিরাপদ ব্যবহার </strong>প্রতিরক্ষামূলক কভার ডিজাইন, ধারালো করার সময় ধাতব চিপগুলিকে স্প্ল্যাশ করা এবং মানুষকে আঘাত করা থেকে কার্যকরভাবে প্রতিরোধ করে</p>\r\n<p><strong>👉 দ্রুত এবং তীক্ষ্ণ-</strong>&nbsp;কার্ড স্লট ডিজাইন, দ্রুত ধারালো করা এবং ধারালো করা, 1 থেকে 2 মিনিটের মধ্যে ছুরিটি ধারালো করা সহজ, ধারালো করার ঐতিহ্যগত সময়সাপেক্ষ এবং শ্রমসাধ্য বিপদের সমাধান করতে</p>\r\n<p><strong>👉 উন্নত উপাদান -</strong>&nbsp;শেলটি উন্নত চিকিত্সা, ভাল গ্লস এবং উচ্চ কঠোরতা সহ একটি পরিবেশগতভাবে বন্ধুত্বপূর্ণ উপাদান&nbsp;</p>', 790, 680, 'SA-82', 0, 0, 1, '2022-10-05 04:08:46', '2022-10-05 04:08:46'),
(469, 4, 'Hand Juicer', 'hand-juicer', '<p><strong>Hand Juicer</strong></p>\r\n<p>👉 ম্যানুয়াল হ্যান্ড জুসার</p>\r\n<p>👉 এখন এই হ্যান্ডি জুস মেকার এর সাহায্যে ঘরেই তৈরি করুন বিভিন্ন ফলের জুস🍹</p>\r\n<p>👉 আলুসহ বিভিন্ন ধরণের ভর্তাও তৈরি করতে পারবেন</p>\r\n<p>👉 ম্যাটেরিয়াল: প্লাস্টিক ও স্টেইনলেস স্টিল</p>\r\n<p>👉 সহজেই পাল্প থেকে জুস আলাদা করা যায়</p>\r\n<p>👉 সহজে পরিষ্কার এবং সংরক্ষণের জন্য সব যন্ত্রাংশ আলাদা করা যায়</p>\r\n<p>👉 Strong Suction Base Unit - ব্যবহারের সময় জুসার স্থির রাখে</p>\r\n<p>👉 সহজে চালনা করা যায়</p>', 900, 750, 'SA-83', 0, 0, 1, '2022-10-05 04:16:36', '2022-10-05 04:16:36'),
(470, 4, 'Super Vegetable Cutter', 'super-vegetable-cutter', '<p><strong>Super Vegetable Cutter</strong></p>\r\n<p>Super Vegetable cutter 6 Teile Set for Vegetable (সুপার ভেজিটেবল কাটার ৬ সবজির জন্য টাইল সেট)</p>\r\n<p><strong>👉</strong> কসবজি এবং ফলগুলি তাজা সালাদ, লো-কার্ব পাস্তা, স্ট্রে-ফ্রাই এবং কাঁচা শাকসব্জিতে রূপান্তর করতে কাটারটি ব্যবহার করুন।</p>\r\n<p><strong>👉&nbsp;</strong>2 কাটা প্রবেশকরণ, উপাদানগুলি সহজে সংগ্রহের পাত্রে কাঙ্ক্ষিত আকারে কাটা যায়</p>\r\n<p><strong>👉 </strong>আলু, মিষ্টি আলু, মূলা, শসা, জুচিিনি বা পেঁয়াজকে পাস্তায় পরিণত করেন না কেন - আপনার খাবারকে একটি নতুন, বিশেষ আকৃতি দিন</p>', 950, 780, 'SA-84', 0, 0, 1, '2022-10-05 04:25:42', '2022-10-05 04:25:42'),
(471, 4, 'Folding Dish', 'folding-dish', '<p><strong>Folding Dish</strong></p>\r\n<p>Multi-function 3 in 1 Folding Cutting Board Kitchen Foldable Drain Basket Chopping Blocks Washing Basket Kitchen Organizer</p>\r\n<p><strong>Description: </strong></p>\r\n<p>👉 100% brand new and high quality with competitive price.</p>\r\n<p>👉 Food grade PP material,safety and health,colorful color,frosted surface design,to avoid slippage when chopping.</p>\r\n<p>👉 Product name:Folding Cutting Board</p>\r\n<p>👉 Material:Food grade pp</p>\r\n<p>👉 Size: as the picture</p>\r\n<p>👉 Color:grey</p>\r\n<p>👉 Size-Square with Leaky hole:40*30*14 cm</p>', 700, 590, 'SA-85', 0, 0, 1, '2022-10-05 04:37:08', '2022-10-05 04:37:08'),
(472, 4, 'Bathroom Sink Sink Power Dredger Sewer Pipe Cleaner Cup', 'bathroom-sink-sink-power-dredger-sewer-pipe-cleaner-cup', '<p><strong>Bathroom Sink Sink Power Dredger Sewer Pipe Cleaner Cup</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">Package included: Dredging tool for cleaning pipes 1 x</li>\r\n<li class=\"\">Specification: Type: Pipe dredger Material: PP + TPR + Silica Gel Color: Orange &amp; black Application: Sink, pool, sewer for bathroom, mop pool, bath, toilet, etc .. Size: 7 * 10 * 17cm Weight: 134g</li>\r\n<li class=\"\">How to use (step by step): Step 1 - Fill the water chamber Before using the Clog gun, you will need to fill its water chamber. To do this, turn the device so that the wider end is facing up, and fill it to the top without overflowing it.</li>\r\n<li class=\"\">Step 2 - Turn the device over After the water chamber of the device is full, quickly turn the tool over and place it directly over the clogged drain.</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.1f84OceOOceOJX\">Step 3 - Click on the black surface After you turn the appliance over the sink, shower or bath, click on the round black surface that you will see at the top of the appliance. If you press down hard enough, it will send water into the clogged drain and clean up debris. However, if you press on it too lightly, you may need to push it again with more force to clear the drain.</li>\r\n<li class=\"\">Step 4 - Remove the appliance and check Finally, after you have completed the pressing step, remove the appliance from the sink and check the drain to make sure it is clear. If this is not the case, repeat the step.</li>\r\n</ul>', 700, 550, 'SA-86', 0, 0, 1, '2022-10-05 04:47:26', '2022-10-05 04:47:26'),
(473, 4, 'Digital Spoon Scale', 'digital-spoon-scale', '<h4 id=\"gridSystemModalLabel\" class=\"modal-title see-title\"><strong>Digital Spoon Scale</strong></h4>\r\n<p>👉 অধিকাংশ সময় রান্নাঘরের মশলাসহ অন্যান্য খারারের জিনিসের ম্যাপ বুঝতে আমাদের অনেক সমস্যাতে বুঝতে হয় ۔۔ </p>\r\n<p>👉 মশলা কম বেশি হয়ে গেলে খাবারের স্বাদটাই নষ্ট হয়ে যায় তাই যেকোনো গুঁড়া মশলা ভেজা উপাদান মাপতে নিয়ে এলাম এই ডিজিটাল মাপের চামচ </p>\r\n<p>👉&nbsp;এটি দিয়ে খুব সহজেই যেকোনো মশলা মাপতে পারবেন খুব সহজেই আর সামনের চামচ অংশটি খোলা যায় যার কারণে এটি পরিষ্কার করাও খুব সহজ ।</p>\r\n<p> উচ্চ মানের ওজনের চামচ </p>\r\n<p>👉&nbsp;খাবার ওজনের সমস্যা সহজে সমাধান করুন </p>\r\n<p>👉 মেটেরিয়াল-ABS প্লাস্টিক </p>\r\n<p>👉&nbsp;রুলার সাইজ- 230*50*23mm </p>\r\n<p>👉&nbsp;বিভিন্ন তরল ও গুঁড়া বেকিং উপাদান ব্যবহারের জন্য উপযুক্ত</p>\r\n<p>👉 চামচ আলাদা করা যায় </p>\r\n<p>👉&nbsp;স্ক্রিন- LED ডিসপ্লে </p>\r\n<p>👉&nbsp;ওজন পরিসীমা_0.5gm থেকে 500gm </p>\r\n<p>👉&nbsp;শাটডাউন সময়- প্রায় 2 মিনিট </p>\r\n<p>👉&nbsp;কোন ব্যবহারের শর্তে স্বয়ংক্রিয়ভাবে বন্ধ হয়ে যায় </p>\r\n<p>👉&nbsp;কম শক্তি খরচ, কম ব্যাটারি সূচক </p>\r\n<p>👉&nbsp;একাধিক অনুপাতের জন্য একটি স্কেল</p>', 650, 520, 'SA-87', 0, 0, 1, '2022-10-05 04:59:33', '2022-10-05 04:59:33'),
(474, 7, 'Kitchen Oil-Resistant Stickers', 'kitchen-oil-resistant-stickers', '<p><strong>Kitchen Oil-Resistant Stickers</strong></p>\r\n<div dir=\"auto\">Price:------</div>\r\n<div dir=\"auto\">1 meter =350/- (1 Meter =Length: 3.2 feet)</div>\r\n<div dir=\"auto\">2 meter =550/- (2 Meter =Length:6.4 feet)</div>\r\n<div dir=\"auto\">3 meter =790/- (3 Meter =Length:9.6 feet)</div>\r\n<div dir=\"auto\">4 meter =990/- (4 Meter =Length:13 feet)</div>\r\n<div dir=\"auto\">5 meter =1190/- (5 Meter =Length:16.feet)</div>\r\n<div dir=\"auto\">6 meter =1350/- (6 Meter =Length:19 feet)</div>\r\n<div dir=\"auto\">7 meter =1490/- (7 Meter =Length:22.5 feet)</div>\r\n<div dir=\"auto\">8 meter =1600/- (8 Meter =Length:26 feet)</div>\r\n<div dir=\"auto\">9 meter =1700/- (9 Meter =Length:29 feet)</div>\r\n<div dir=\"auto\">10.meter=1800/-(10 Meter =Length:33 feet) (1 Roll )</div>\r\n<div dir=\"auto\">প্রস্থ : সব গুলো ২৪ ইঞ্চি</div>\r\n<p>👉 রান্নাঘরের দেয়াল কিংবা কেবিনেটে তেল চিটচিটে ভাব বা ময়লা হওয়ার সম্ভাবনা নেই।</p>\r\n<p>👉 নিয়ে আসুন Shoppers Delight এর স্মার্ট ও নতুন কিচেন প্রোডাক্ট &lsquo;Kitchen Oil-Resistant Sticker\'</p>\r\n<p>👉 যা তেল, তরকারির ঝোল, ভাতের মাড় ইত্যাদি থেকে দেয়াল কিংবা কেবিনেটকে রাখে সুরক্ষিত। 👉 Multi-Use এই স্টিকার শেলফ, ড্রয়ার ইত্যাদিতেও ব্যবহার করতে পারেন সৌন্দর্য বর্ধনের জন্য।</p>\r\n<p>👉 ছোট আয়তনের ফ্ল্যাটগুলোর রান্নাঘর ছোটই হয়ে থাকে। এরপর যতই সাবধানতা অবলম্বন করুন না কেন, তেল, তরকারির ঝোল, ভাতের মাড়, রান্নার সময় ধোঁয়া বাতাসের জলীয় বাষ্পের সঙ্গে এক হয়ে একধরনের আঠালো ভাব তৈরি করে ফেলে। এতে রান্নাঘরের দেয়াল তেল চিটচিটে কিংবা ময়লা হয়ে যায়। ফলে রান্নাঘরের সৌন্দর্যহানী হয়। এই সমস্যার চিরস্থায়ী সমাধান দিবে আমাদের এই স্টিকার। যেকোনো ধরণের দাগ থেকে দেয়ালকে মুক্ত রাখতে অনন্য এই স্টিকার।</p>\r\n<p>👉 এটা রান্নাঘরের দেয়াল,কেবিনেট, শেলফ, কাউন্টারটপ ইত্যাদি দাগমুক্ত ও পরিষ্কার রাখতে ব্যবহার করতে পারবেন এই কাউন্টার স্টিকার। -উদ্দেশ্য অনুযায়ী কেটে ছোট করে এটা ব্যবহার করা যাবে।</p>', 700, 350, 'SA-88', 0, 0, 1, '2022-10-05 05:12:25', '2022-10-05 05:12:25'),
(475, 4, 'Stainless Steel Garlic Manual Press Squeezer', 'stainless-steel-garlic-manual-press-squeezer', '<h4 id=\"gridSystemModalLabel\" class=\"modal-title see-title\"><strong>Stainless Steel Garlic Manual Press Squeezer</strong></h4>\r\n<p><strong>Specification:</strong></p>\r\n<p><strong> Material: stainless steel + plastic Size: 10*7*5 cm Pressure garlic tool</strong></p>\r\n<p><strong> Features:</strong></p>\r\n<p><strong> (1) With handle, easy to use; </strong></p>\r\n<p><strong>(2) Stainless steel material, durable;</strong></p>\r\n<p><strong> (3) The curved design is easy to roll back and forth.</strong></p>', 390, 320, 'SA-89', 0, 0, 1, '2022-10-05 05:23:04', '2022-10-05 05:23:04'),
(476, 4, 'Gas Stove Cover', 'gas-stove-cover', '<p><strong>Gas Stove Cover</strong></p>\r\n<p>🔥গ্যাসের খরচ কমাতে ও রান্নার সময় বাঁচাতে ব্যবহার করুন অ্যালুমিনিয়ামের তৈরি Energy Saving Gas Stove Cover</p>\r\n<p>👉 এটা চুলার সাথে আঁটসাঁটভাবে আটকিয়ে থাকে।ফলে, গ্যাসের তাপমাত্রা পাশ দিয়ে বের হওয়ার কোন সুযোগ থাকে না।তাই, সম্পূর্ণ তাপমাত্রা পাতিলের নিচে পড়ে, ফলে অল্প সময়েই রান্না হয়ে যায়।</p>\r\n<p>👉 এটা ব্যাবহারে গ্যাসের এনার্জি অপচয় হয় না বলে অল্প গ্যাসেই রান্না হয়ে যায়, ফলে গ্যাস খরচও কম হয়।</p>\r\n<p>👉 গবেষণা মতে, এটা ব্যাবহারে ৩০%-৫০% গ্যাস খরচ কম হয়।</p>\r\n<p>👉 এটার উপরের অংশ খাঁজকাটা হওয়ায় পাতিল সহজেই আটকে থাকে।</p>\r\n<p>👉 যেকোন সাইজের পাতিল ব্যাবহার করা যায়।</p>', 480, 420, 'SA-90', 0, 0, 1, '2022-10-05 17:12:33', '2022-10-05 17:34:59'),
(477, 4, '5-Layer Multifunctional Kitchen Rack', '5-layer-multifunctional-kitchen-rack', '<p><strong>5-Layer Multifunctional Kitchen Rack</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">Condition: 100% brand new and high quality</li>\r\n<li class=\"\">Material: metal</li>\r\n<li class=\"\">Size: 3 layers: 14x60x32cm</li>\r\n<li class=\"\">Size: 4 layers: 14x76x32cm</li>\r\n<li class=\"\">Size: 5 layers; 14x90x32cm</li>\r\n<li class=\"\">360 degrees rotating shelf,Space saving .</li>\r\n<li class=\"\">Optimal material,reinforced and thickened, Strong and durable, No deformation。</li>\r\n<li class=\"\">Universal wheel with brake , move as you like, Quiet and smooth without hurting the floor.</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.3086ikIzikIz2a\">Rotating storage, breathable mesh basket.</li>\r\n<li class=\"\">The details are in place to make life more refined.</li>\r\n<li class=\"\">Shipped as a whole, no installation required.</li>\r\n<li class=\"\">Resistant up to 15 kg per layer.</li>\r\n</ul>', 4200, 3800, 'SA-91', 0, 0, 1, '2022-10-05 17:39:29', '2022-10-05 17:39:29'),
(479, 7, '12 Pieces Double Layer Spice Rack', '12-pieces-double-layer-spice-rack', '<h1 class=\"product-name\">12 Pieces Double Layer Spice Rack</h1>\r\n<p>👉 রান্নাঘরের সকল মসলা এবং প্রয়োজনিয় দ্রব্যাদি একসাথে হাতের কাছে থাকবে সবসময়, ব্যবহার করুন কিচেন কেয়ার এর \"Rotating Spice Organizer\"</p>\r\n<p>👉 আপনি রান্নাঘরের বিভিন্ন মশলা এর মাঝে রাখতে পারবেন।</p>\r\n<p>👉 এটা মূলত রান্নাঘরে ব্যবহার করার জন্য। কিন্তু আপনি অন্য জায়গায় ছোট খাট জিনিস যা এই বোতল গুলোর মধ্যে ধরে তা রাখার কাজে ব্যবহার করতে পারবেন।&nbsp;</p>\r\n<p>👉 যে কোন সমতল জায়গার উপর রাখা যাবে।</p>\r\n<p>👉 বোতল গুলো কাচের এবং বোতলের মুখ গুলো স্টেইনলেস স্টিলের।</p>\r\n<p>👉 প্রোডাক্ট টিকে প্রয়োজন মত ঘুরানো যাবে</p>\r\n<p>👉 ১২ টি বোতল আছে এই স্পাইস অর্গানাইজার এর মাঝে।</p>\r\n<p>👉 রোটেটিং স্পাইস অর্গানাইজার এর সাইজ ১৩.১৯*৬.৫ ইঞ্চি।ছোট গ্লাস জারের সাইজ ৩.৭*১.৭ ইঞ্চি।</p>\r\n<p>&nbsp;</p>', 1420, 1190, 'SA-92', 0, 0, 1, '2022-10-05 18:04:03', '2022-10-05 18:04:03'),
(480, 7, 'Affix Manual Puri Maker Stainless Steel', 'affix-manual-puri-maker-stainless-steel', '<p><strong>Affix Manual Puri Maker Stainless Steel</strong></p>\r\n<div dir=\"auto\">Manual Ruti Maker</div>\r\n<div dir=\"auto\"><strong>পন্যের বিবরণ:</strong></div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> রুটি এন্ড পুরি মেকার</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> হাই কোয়ালিটি রুটি মেকার এর সাহায্যে মাত্র এক মিনিটেরও কম সময়ে রুটি তৈরি করতে পারবেন</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> সময়, শ্রম, তেল, জ্বালানী সাশ্রয়ী</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> কর্মজীবী মহিলাদের জন্য খুবই প্রয়োজনীয় একটি গ্যাজেট</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> স্টেইনলেস স্টিল</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> ঝামেলা ছাড়াই বানিয়ে ফেলুন সুন্দর গোল রুটি।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> এটা ব্যাবহার করা খুবই সহজ।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> টেকসই বছরের পর বছর ব্যবহার করতে পারবেন।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> ব্যস্ত জীবন এ খুব সহজেই যখন-তখন ঝামেলা ছাড়াই রুটি তৈরি করুন।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> ১০০% স্টেইনলেস স্টিল হওয়ায় বছরের পর বছর ব্যবহার করতে পারবেন।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> খুব সহজেই পরিষ্কার করা যায় ও টেকসই।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Size- 7 \\7.5 inch</div>', 1190, 980, 'SA-93', 0, 0, 1, '2022-10-05 18:30:54', '2022-10-05 18:30:54'),
(481, 7, 'Electric Heating Coffee Mug & Saucer', 'electric-heating-coffee-mug-and-saucer', '<p>Electric Heating Coffee Mug &amp; Saucer</p>\r\n<p>👉 এবার চা/কফি বানানোর পর কোন গুরুত্বপূর্ণ কাজে ডুবে গেলে আর ঠাণ্ডা কফি বা চা র দিকে তাকিয়ে মন খারাপ করা লাগবে না।</p>\r\n<p>এই কফি মগ সেটটি তে আছে</p>\r\n<p>☕১ টা কাপ মগ</p>\r\n<p>☕ ১টা চামচ</p>\r\n<p>☕১টা ঢাকনা</p>\r\n<p>☕১টা কফি ইলেক্ট্রিক হিটার যেটার মাধ্যমে কাপ এ রাখা কফি/চা গরম রাখতে পারবেন।</p>\r\n<p>👉 এই সেটটি সুন্দর একটি গিফট বক্সে থাকে। যেমন টা pic তে দেখা যাচ্ছে।</p>\r\n<p><strong>মেটেরিয়ালঃ</strong></p>\r\n<p>👉 সিরামিক পাওয়ার -১৬ ওয়াট</p>\r\n<p>👉 ভোল্টেজ -২২০ হিটিং</p>\r\n<p>👉 তাপমাত্রা -৫৫ ডিগ্রি সেলসিয়াস</p>', 1350, 1200, 'SA-94', 0, 0, 1, '2022-10-06 01:55:59', '2022-11-08 21:12:49'),
(482, 4, 'Knife Sharpener Suction', 'knife-sharpener-suction', '<h1 class=\"product-name\">Knife Sharpener Suction</h1>\r\n<p>👉 কোরবানী যেনো আর কিছুদিন পরই আপনার ঘরের দরজায় কড়া নাড়ছে</p>\r\n<p>👉 আর এই ব্যাস্ত সময়ে কামাড় এর দোকানে দোড় ঝাপের এর দুশ্চিন্তা দূর করতে আমাদের এই ক্ষুদ্র প্রয়াস</p>\r\n<p>👉 তাই কোরবানীর পূর্ব এই মুহূর্তে আপনাদের জন্য নিয়ে এলাম Knife Sharpener.</p>\r\n<p>👉 এই পণ্য টির মাধ্যমে আপনি খুব সহজেই আপনার ছুড়ি, চাপাটি কে ধার করতে পারবেন&nbsp;</p>\r\n<p>👉 এছাড়া ধার অনেক দিন ধরে থাকবে।</p>\r\n<p>👉এটিতে রয়েছে ৩টি ধাপ এবং Stainless Steel (SS) এর তৈরি ব্লেড, যেটিতে জং ও মরিচা ধরেনা এবং টিকে ও বছরের পর বছর।</p>\r\n<p>এছাড়া বাসা বাড়ির কিচেনের জন্য ও এটি ব্যবহার করতে পারেন।</p>', 500, 320, 'SA-95', 0, 0, 1, '2022-10-06 02:09:44', '2022-10-06 02:09:44'),
(441, 7, 'Wonder Patch Abdomen Treatment', 'wonder-patch-abdomen-treatment', '<p><strong>Wonder Patch Abdomen Treatment</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" /> Simply paste before going to sleep! Persisting for 8 hours, Long effect! Targets only fat / cellulite on and around the Belly. Care of the fat on the stomach.</p>\r\n<p><strong>&nbsp;Main Ingredients&nbsp;</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" /> Natural Ingredients, No preservatives &ndash; Sophoricoside / Catechin / Capsaicin / Caffeine / Sallcornia herbacaa. -Remove the middle film in three equal parts first.</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" /> Attached to the belly area and location determined by paste gives.</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/2714.png\" alt=\"✔️\" /> Move after 2~3 min for well attached. Remove after 6~8 Hours</p>', 520, 380, 'SA-55', 0, 0, 1, '2022-10-03 22:09:24', '2022-10-03 22:09:24');
INSERT INTO `products` (`id`, `brand_id`, `name`, `slug`, `description`, `price`, `selling_price`, `sku`, `should_track`, `stock_count`, `is_active`, `created_at`, `updated_at`) VALUES
(442, 7, 'Waist Relax Mate', 'waist-relax-mate', '<p><strong>Waist Relax Mate</strong></p>\r\n<div dir=\"auto\"><strong>Description</strong></div>\r\n<div dir=\"auto\">One you need,all we support.</div>\r\n<div dir=\"auto\">\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Increase range of motion and flexibilty.</div>\r\n<div dir=\"auto\">4 position adjustment, health care waist</div>\r\n<div dir=\"auto\">Relieve back pain.</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Easily improve posture, increase the range of motion of the spine, effectively relieve back pain.\r\n<div dir=\"auto\">Cervical spinal traction stretch frame, humpback braces</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Adjustable and portable. You can strectch any time any where but does not include pillows</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><strong>Item Type</strong></div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Massage &amp; Relaxation &amp; Orthopedic&nbsp;</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Material: ABS&nbsp;</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Application: Body</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Color: Black</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><strong>Package included:</strong></div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><strong><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> 1</strong> * Back Support Stretcher</div>\r\n</div>\r\n</div>', 650, 550, 'SA-56', 0, 0, 1, '2022-10-03 22:41:37', '2022-10-06 12:35:26'),
(401, 4, 'Baby Carrier Comfort Bag', 'baby-carrier-comfort-bag', '<p><strong>বেবি ক্যারিয়ার কমফোর্ট ব্যাগ </strong></p>\r\n<p>&bull; নিরাপদ বেবী ক্যারিয়ার</p>\r\n<p>&bull; 2 টি পজিশনে এই ক্যারিয়ারকে ব্যবহার করা যাবে</p>\r\n<p>&bull; প্যাডেড ফোম, যা আপনার সোনামনিকে রাখবে আঘাত থেকে নিরাপদ</p>\r\n<p>&bull; হেড সাপোর্ট বাচ্চার মাথাকে দুর্ঘটনা থেকে রক্ষা করবে।</p>\r\n<p>&bull; শপিং বা কোন জাগায় ট্রাভেলে গেলে আপনার সোনামনিকে বহনের জন্য এই বেবি ক্যারিয়ারটি ব্যবহার করতে পারেন</p>\r\n<p>&bull; হুক ও বেল্ট সিস্টেম, তাই সহজেই পিঠে ও কলে আটকানো যায়</p>\r\n<p>&bull; ৩.৫ থেকে ২০ কেজি ওজনের বাচ্চাদের ক্ষেত্রে প্রযোজ্য</p>\r\n<p>&bull; ৩-১৮ মাস বয়েসী শিশুদের ক্ষেত্রে প্রযোজ্য</p>\r\n<p>&bull; সহজেই পরিষ্কার করা যায়</p>', 780, 590, 'SA-15', 0, 0, 1, '2022-10-02 13:33:48', '2022-10-02 13:33:48'),
