(566, 4, 'Toothpaste Dispenser', 'toothpaste-dispenser', '<div dir=\"auto\"><strong>(অটোমেটিক টুথপেষ্ট ডিসপেনসার)</strong></div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><strong>👉</strong>&nbsp;ঘুম থেকে উঠে সকাল বেলা ব্রাশ হাতে নিবেন আর হোল্ডারে ধরবেন, আর ম্যাজিকের মতোই টুথপেস্ট পড়বে আপনার ব্রাশে।</div>\r\n<div dir=\"auto\"><strong>👉&nbsp;</strong>টুথব্রাশ প্রবেশ করানোর সাথে সাথেই অটোমেটিক ভাবে টুথপেষ্ট ব্রাশে প্রয়োজনমত জমা হবে।</div>\r\n<div dir=\"auto\"><strong>👉&nbsp;</strong>টুথপেস্টের টিউব নিয়ে ঝামেলার কোন দরকারই হবে না।</div>\r\n<div dir=\"auto\"><strong>👉&nbsp;</strong>কোন ইলেকট্রিক কানেকশন প্রয়োজন নেই।</div>\r\n<div dir=\"auto\"><strong>👉</strong>&nbsp;সহজে দেয়ালে লাগানোর জন্য রয়েছে অ্যাডহেসিভ প্যাড।</div>\r\n<div dir=\"auto\"><strong>👉</strong>&nbsp;স্টাইলিশ এবং আপনার ঘরের সৌন্দর্য বর্ধনে অসাধারণ।</div>\r\n<div dir=\"auto\"><strong>👉</strong>&nbsp;বাথরুম কিংবা বেসিনের পাশে সহজেই স্থাপনযোগ্য।</div>\r\n<div dir=\"auto\"><strong>👉&nbsp;</strong>একসাথে টুথব্রাশ ডিসপেনসার এবং টুথব্রাশ হোল্ডার।</div>\r\n<div dir=\"auto\"><strong>👉&nbsp;</strong>সুদৃশ্য (৫) ব্রাশ স্ট্যান্ডসহ।</div>\r\n<div dir=\"auto\"><strong>👉&nbsp;</strong>ম্যাটেরিয়াল: PVC</div>', 650, 490, 'SA-178', 0, 0, 1, '2022-10-15 09:53:11', '2022-10-15 09:54:15'),
(440, 7, 'Cover Coco Diamond Serum', 'cover-coco-diamond-serum', '<p><strong>Cover Coco Diamond Serum</strong></p>\r\n<p>অয়েলি স্কিনের জন্য সিরাম ব্যবহার করতে গেলে আমাদের অনেক ভাবতে হয় যে স্কিন আবার বেশি অয়েলি হয়ে যাবে কিনা?সিরাম স্কিনে কাজ করবে কিনা?</p>\r\n<div dir=\"auto\">Serum টি all type skin এর জন্য perfect.এই সিরাম লাইট ওয়েট হয়ায় স্কিনের সাথে খুব ভালোভাবে মিশে যায়।</div>\r\n<div dir=\"auto\">এই সিরাম মূলত স্কিন ব্রাইট করার কাজ করে।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><strong>কার্যকারীতা:</strong></div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;স্কিন সফট,স্মুথ করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;হালকা স্পট দূর করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;স্কিন টান টান করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;অয়েলি ভাব দূর করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;আমাদের অনেকের স্কিন কুচকে যায়</div>\r\n<div dir=\"auto\">এই কুচকানো ভাব দূর করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;Suntan দূর করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;স্কিন হাইড্রেট রাখে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;Blemish দূর করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" />&nbsp;১০০% অরিজিনাল প্রোডাক্ট।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">রাতে ঘুমানোর আগে ফেইস ওয়াশ দিয়ে মুখ ভালো ভাবে ধুয়ে নিন এবং সারা মুখে সিরাম লাগিয়ে নিন এবং ভালো করে মিশিয়ে সারারাত রাখুন। পরদিন সকালে মুখ ভালো করে ওয়াশ করুন</div>', 500, 390, 'SA-54', 0, 0, 1, '2022-10-03 21:56:17', '2022-10-03 21:56:17'),
