(437, 7, 'Sweat Slim Belt', 'sweat-slim-belt', '<p>Sweat Slim Belt</p>\r\n<p>👉 আপনার পেটের অতিরিক্ত মেদ (ভুঁড়ি) ও চর্বি খুব সহজেই কমানোর জন্য আমরা আপনার জন্য নিয়ে এসেছি Hot Shaper Belt ,যা খুব দ্রুত (এটি পরীক্ষিত ) ১০০% গ্যারান্টি আপনার অতিরিক্ত মেদ (ভুঁড়ি) ও চর্বি কমিয়ে আপনাকে স্লিম ও আকর্ষণীয় করে তুলবে । এটি ব্যবহার করা খুবি সহজ ।</p>\r\n<p>👉 মহিলা ও পুরুষদের জন্য একটি অনন্য গেজেট (যা আপনার অতিরিক্ত মেদ কমাতে সাহায্য করবে)।</p>\r\n<p>👉 আপনার ফিগার শেপ এর মধ্যে থাকবে।</p>\r\n<p>👉 খুব সহজেই ব্যবহার উপযোগী ।</p>\r\n<p>👉 এটি আপনি বাসায়, হাঁটার সময়, কাজের মধ্যে , শপিং এ , জগিং এ ব্যবহার করতে পারেন ।</p>\r\n<p>👉 এটির ব্যবহারে আপনার বিরক্তিবোধ করবেন না, স্বস্তি ও আরামদায়ক মনে হবে ।</p>\r\n<p>👉 এটি আপনাকে আরও আকর্ষণীয় ও স্লিম করে তুলবে।</p>\r\n<div dir=\"auto\">&gt;&gt; SIZE: (M=29-31\'\') (L-32-33\") (XL-34-35\") (XXL-36-37\")</div>\r\n<div dir=\"auto\">(3XL-38-39\") (4XL-40-42\")</div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 670, 420, 'SA-51', 0, 0, 1, '2022-10-03 21:17:32', '2022-10-03 21:17:32'),
(438, 7, 'Cover Coco 24K Gold Serum', 'cover-coco-24k-gold-serum', '<div dir=\"auto\"><strong>Cover Coco 24K Gold Serum</strong></div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">অয়েলি স্কিনের জন্য সিরাম ব্যবহার করতে গেলে আমাদের অনেক ভাবতে হয় যে স্কিন আবার বেশি অয়েলি হয়ে যাবে কিনা?সিরাম স্কিনে কাজ করবে কিনা?</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">Serum টি all type skin এর জন্য perfect.এই সিরাম লাইট ওয়েট হয়ায় স্কিনের সাথে খুব ভালোভাবে মিশে যায়।</div>\r\n<div dir=\"auto\">এই সিরাম মূলত স্কিন ব্রাইট করার কাজ করে।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><strong>কার্যকারীতা:</strong></div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> স্কিন সফট,স্মুথ করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> হালকা স্পট দূর করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> স্কিন টান টান করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> অয়েলি ভাব দূর করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> আমাদের অনেকের স্কিন কুচকে যায়</div>\r\n<div dir=\"auto\">এই কুচকানো ভাব দূর করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Suntan দূর করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> স্কিন হাইড্রেট রাখে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Blemish দূর করে।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> ১০০% অরিজিনাল প্রোডাক্ট।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">রাতে ঘুমানোর আগে ফেইস ওয়াশ দিয়ে মুখ ভালো ভাবে ধুয়ে নিন এবং সারা মুখে সিরাম লাগিয়ে নিন এবং ভালো করে মিশিয়ে সারারাত রাখুন। পরদিন সকালে মুখ ভালো করে ওয়াশ করুন</div>', 500, 390, 'SA-52', 0, 0, 1, '2022-10-03 21:39:23', '2022-10-03 21:39:23'),
(433, 7, 'Blue Light Acne Treatment KB-7910', 'blue-light-acne-treatment-kb-7910', '<p><strong>Blue Light Acne Treatment KB-7910</strong></p>\r\n<p><strong>Description </strong></p>\r\n<p>KD-7910 Acne Laser Pen Portable Wrinkle Removal Machine Durable Soft Scar Removal Device Blue Light Therapy Pen Skin care Beaty</p>\r\n<p><strong>Features-</strong></p>\r\n<p>👉 Promote combination of protein and bone collagen, activate the skin, tighten the loosen skin.</p>\r\n<p>👉 Effectively inhibit acne bacillus and improve red spot, oily skin and heavy sensitive skin, shirk pore, remove acne.</p>\r\n<p><strong>Description</strong></p>\r\n<p>👉 Model: KD-7910</p>\r\n<p>👉 Voltage: DC 1.5V</p>\r\n<p>👉 Current: 036A</p>\r\n<p>👉 Power: 0.9W</p>\r\n<p>👉 Stalls:1 file</p>\r\n<p>👉 Battery:1*AA Battery(not include)</p>\r\n<p><strong>Specification-</strong></p>\r\n<p>👉 Color: white</p>\r\n<p>👉 Material: ABS</p>\r\n<p>👉 Item size: approx.135*19*19mm</p>\r\n<p>👉 Package Include: 1x Acne Laser Pen</p>\r\n<p>👉 1 x User Manual</p>\r\n<p><strong> Note-</strong> Please allow 1-3cm error due to manual measurement and make sure you do not mind before ordering. The color of the actual items may slightly vary from the above images due to different computer screen, thanks for your understanding.</p>\r\n<p>&nbsp;</p>', 530, 480, 'SA-47', 0, 0, 1, '2022-10-03 20:00:19', '2022-10-03 20:00:19'),
(434, 4, 'Silicone Message Bath Brush', 'silicone-message-bath-brush', '<p><strong>Silicone Message Bath Brush</strong></p>\r\n<p>👉 Silicone Body Shower Wash Massage Brush With Shampoo Soap Gel Dispenser</p>\r\n<p>👉 সিলিকন বডি ব্রাশ 100% সিলিকন দিয়ে তৈরি, স্ক্যাল্প ম্যাসাজ এবং ত্বকের স্ক্রাবিং একটি দুর্দান্ত ব্রাশ যা ছোট বড় সবার ব্যাবহার উপযোগী।</p>\r\n<p>👉 আরামদায়ক আকার এবং আকৃতি এটিকে আপনার হাতে সহজেই ফিট করে এবং অনেক ফেনা তৈরি করে.&nbsp;</p>\r\n<p>👉 ব্রাশটি পরিষ্কার করা খুব সহজ ,এটি এমনকি গরম পানি দিয়েও পরিষ্কার করা যায় তাই ব্রাশটি দীর্ঘস্থায়ী&nbsp;</p>\r\n<p>👉 আপনার যদি প্রয়োজন হয় তবে আপনি এটি আপনার রান্নাঘরে ডিশ স্ক্রাবার হিসাবেও ব্যবহার করতে পারেন।</p>\r\n<p>👉 Material: Silicone</p>\r\n<p>👉&nbsp;Size: 8.8&times;8&times;5.7cm</p>\r\n<p><strong>Product include</strong></p>\r\n<p>👉 1 &times; Silicone Bath Brush</p>', 370, 290, 'SA-48', 0, 0, 1, '2022-10-03 20:16:41', '2022-10-03 20:16:41'),
(432, 4, 'Nose Hair Trimmer', 'nose-hair-trimmer', '<p><strong>Nose Hair Trimmer</strong></p>\r\n<p>👉 আপনি কি নাকের লোমের সমস্যা নিয়ে ভুগছেন??</p>\r\n<p>👉 আপনার নাকের লোম এর ফলে কি নাক এ চুল্কানি সমস্যা হয়? তাহলে এই Nose Hair Trimmer টি আপনার জন্যই।&nbsp;</p>\r\n<p>👉 এই Nose Hair Trimmer এর ফলে আপনার নাকের লোম দূর হবে খুব সহজেই।&nbsp;</p>\r\n<p>👉 Nose Hair Trimmer টির সাথে পাচ্ছেন প্রিমিয়াম কোয়ালিটির একটি বাক্স, যেটির ফলে আপনার ট্রিমার টি থাকবে যত্নে</p>\r\n<p>👉 ছোটো আর বক্স সিস্টেম এ হওয়ার ফলে যেকোনো জায়গায় সাথে করে নিয়ে যেতে পারবেন</p>', 480, 370, 'SA-46', 0, 0, 1, '2022-10-03 19:38:32', '2022-10-03 19:38:32'),
(431, 4, 'Holding Fan', 'holding-fan', '<p><strong>Pocket Holding Fan</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Product Material, ABS + PC + Electronic&nbsp;</p>\r\n<p><strong>Components</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Color- White Pink Blue Black</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Battery Capacity: 1400 MAh</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Battery Voltage: 3.7V</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Tap Position: 3-Speed</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> The Duration of Use: 4-12 Hours</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Charging Duration: 4 Hours</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Product Size: 162*80*17mm</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Packing Size: 14.5*9.5 * 4.2mm</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Packing Number: Carton Size: 50*35*31cm/80 Boxes/11.0kg</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Net Weight: 110g</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> Gross Weight: 230g</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" /> The Fan Can Be Divided into Three Adjustment&nbsp;</p>\r\n<p>&nbsp;</p>', 620, 490, 'SA-45', 0, 0, 1, '2022-10-03 19:22:53', '2022-10-03 19:22:53'),
(430, 7, 'Elegant Butterfly Gold Watch', 'elegant-butterfly-gold-watch', '<p><strong>Elegant Butterfly Gold Watch</strong></p>\r\n<p>আপনার প্রিয়জনের জন্য সবচেয়ে আকর্ষণীয় উপহার হোক এই প্রিমিয়াম কোয়ালিটির ঘড়ি!!</p>\r\n<p>👉 ঘড়ি প্রেমীদের তালিকায় যোগ হতে পারে এই আকর্ষনীয় ব্র্যান্ডের ঘড়ি, আপনার ব্যাক্তিত্বে আনবে অন্যরকম ভাব।</p>\r\n<p>👉 সুন্দর কৌণিক কোয়ার্টজ মুখগুলি একটি বিলাসবহুল হীরার মতো চকচকে প্রতিসরণ করে৷ গ্যালাকটিক নক্ষত্রগুলি বিভিন্ন কোণ এবং আলোর অধীনে রংধনু বর্ণালী দিয়ে ঝলক দেখায়</p>\r\n<p>👉 সঠিক সময় রাখা: কোয়ার্টজ অ্যানালগ সঠিক এবং সঠিক সময় রাখা প্রদান করে।</p>\r\n<p>👉 .টেকসই: উচ্চ কঠোরতা কাচ, খাদ কেস এটি সুপার টেকসই করে তোলে, নরম জাল ঘড়ি চাবুক আরামদায়ক পরা অভিজ্ঞতা প্রদান</p>\r\n<p>👉 ব্যবসায়িক, নৈমিত্তিক, গৃহমধ্যস্থ কার্যক্রম বা দৈনন্দিন ব্যবহারের জন্য পারফেক্ট</p>\r\n<p>👉 এটি মহিলা বা মেয়েদের জন্য খুব উপযুক্ত এবং এটি পরতে খুব আরামদায়ক, এটি পোষাক, স্যুট, শার্ট এবং আরও অনেক কিছুর সাথে যুক্ত হতে পারে।</p>\r\n<p><strong> স্পেসিফিকেশন-</strong></p>\r\n<p>👉&nbsp;ঘড়ির ফিতে মোট দৈর্ঘ্য: প্রায় 20.5 সেমি ডায়াল কেস ব্যাস: প্রায় 4.2 সেমি আয়নার ব্যাস প্রস্থ: 1.6 সেমি ডায়াল বেধ: প্রায় 0.8 সেমি চাবুক প্রস্থ: 4.1 সেমি নেট ওজন: 58 গ্রাম</p>', 1020, 860, 'SA-44', 0, 0, 1, '2022-10-03 19:04:30', '2022-10-03 19:04:30'),
(429, 4, 'Mini Hair Straightener', 'mini-hair-straightener', '<p><strong>Mini Hair Straightener&nbsp;</strong></p>\r\n<div dir=\"auto\">চুল সোজা এবং কার্লি ২টাই করুন একটা মেশিন দিয়ে।</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>&nbsp; চুল স্ট্রেইট কিংবা কার্লি যখন যেটা ভালো লাগে তখন এই মিনি হেয়ার Iron দিয়ে দুইটাই করে নিতে পারবেন।</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>&nbsp; অফিস, ভার্সিটি কিংবা যেকোন যায়গায় আপনার হ্যান্ড ব্যাগেই রেখে দিতে পারেন কিউট এই হেয়ার আইরনটি।</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>&nbsp;&nbsp;একের মধ্যে দুই</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>&nbsp;&nbsp;৩-৫ মিনিটেই হিট হয়ে যায়।</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>&nbsp;&nbsp;সাইজ ৬ ইঞ্চি</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>&nbsp; সহজে ব্যবহার করা যায়</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>&nbsp;&nbsp;এটা মিনি সাইজ তাই যে কোন জায়গায় হ্যান্ড ব্যাগে বহন করে সহজেই নিয়ে যেতে পারবেন</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><strong>Product details of Mini Hair Straightener Portable</strong></div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>&nbsp; Product type: Hair Straightener and curly a dual model</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>&nbsp; Color: Multicolor</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>&nbsp; Rated voltage:220V~</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>&nbsp; Rated frequency:50Hz</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>&nbsp; Rated power:20W</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" width=\"16\" height=\"16\" /></span>&nbsp; Easy to use</div>', 690, 470, 'SA-43', 0, 0, 1, '2022-10-03 18:03:55', '2022-10-03 18:03:55'),
(428, 4, 'Hair Straightener', 'hair-straightener', '<p><strong> 2in1 Hair Straightener+Curler Comb Brush</strong></p>\r\n<p>👉 বারবার পার্লারে গিয়ে টাকা দিয়ে চুল স্ট্রেইট করা অনেকের জন্য ঝামেলার। সেক্ষেত্রে Hair straightener হতে পারে সবচেয়ে ভালো সমাধান।</p>\r\n<p>👉 বারবার পার্লারে গিয়ে টাকা দিয়ে চুল স্ট্রেইট করা অনেকের জন্য ঝামেলার। সেক্ষেত্রে Hair straightener হতে পারে সবচেয়ে ভালো সমাধান।</p>\r\n<p>👉 যখন তখন ঘরে বসেই করে নিতে পারেন আপনার Hair straightener... খুব সহজে , অল্প সময়ে করে নিতে পারেন আপনার Hair Style সেট ।।&nbsp;</p>\r\n<p>👉 শুধুমাত্র ব্রাশটি দিয়ে চুল আঁচড়ালেই নিমিষের মধ্যে আপনি পাবেন একদম স্ট্রেইট চুল, কোনোরকম চুলের Damage ছাড়াই।</p>\r\n<p>👉 2in1 Hair Straightener Comb.. কোঁকড়া চুলকে কোন রকম ড্যামেজ করা ছাড়াই করে তুলে সোজা Straight..</p>\r\n<p>👉 Salon Quality যা চুল ড্যামেজ/রাফ করে না..যা চুলকে Smooth &amp; Straight করে..</p>\r\n<p>&nbsp;</p>', 1350, 1000, 'SA-42', 0, 0, 1, '2022-10-03 17:50:30', '2022-11-24 07:12:31'),
(406, 4, 'Chicco Soft Baby Comod-Potty Chair', 'chicco-soft-baby-comod-potty-chair', '<div class=\"m8h3af8h l7ghb35v kjdc1dyq kmwttqpk gh25dzvf n3t5jt4f\">\r\n<div dir=\"auto\"><strong>Chicco Soft Baby Comod/Potty Chair/Baby Toilet Seat</strong></div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">বাচ্চাদের Potty train করার জন্য সবচেয়ে কোমল ও উপযোগী।</div>\r\n</div>\r\n<div class=\"l7ghb35v kjdc1dyq kmwttqpk gh25dzvf jikcssrz n3t5jt4f\">\r\n<div dir=\"auto\">বিল্ড কোয়ালিটি খুবই মজবুত। ১ বছর বয়স থেকেই বাচ্চারা ব্যবহার করতে পারবে। উপরে নরম ফোম থাকায় বসে আরাম পাবে এবং ধরার জন্য দুইপাশে হ্যান্ডেল আছে যা সেফটির কাজ করবে। সহজেই ধোয়া যাবে।</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span> The Chicco soft reducer toilet seat helps your child learn to use the toilet</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span> Small size makes it easy to carry</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span> Fitted with two side handles for support</div>\r\n<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span> child learn to use the</div>\r\n</div>', 1270, 890, 'SA-20', 0, 0, 1, '2022-10-02 16:27:06', '2022-10-02 16:27:06'),
(407, 4, 'Intime Baby Bath Tub', 'intime-baby-bath-tub', '<p><strong>Intime Inflatable Baby Bath Tub, Baby Children Shower </strong></p>\r\n<p>আপনার প্রিয় শোনা বাবুকে গোসল করানোর জন্য আমাদের এই পণ্যটি ব্যবহার করুন!এর মাধ্যমে আপনার সন্তান খেলা ধুলা ও আনন্দে গোসল করবে!</p>\r\n<p><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span> &nbsp;বয়সঃ 0-5 বছর বয়সী বাচ্চাদের</p>\r\n<p><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span> ইউরোপীয় উন্নত মানসম্পন্ন PVC উপাদান দিয়ে তৈরি</p>\r\n<p><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp;ব্যাকরেস্ট ডিজাইন, যা শিশুর পিছনে ভাল সমর্থন করতে পারে</p>\r\n<p><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp;সহজেই যেকোনো যায়গায় প্যাকেট করে নিয়ে যেতে পারবেন</p>\r\n<p><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp;পিছনে নরম বালিশ রয়েছে, টেকসই, এবং পরিষ্কার করা সহজ</p>\r\n<p><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp;পানি বের করার জন্য নিচে বড় আকারের ড্রেন প্লাগ আছে</p>\r\n<p><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span>&nbsp;পাশে একটি স্টোরেজ থলি আছে যেখানে সাবান,শ্যাম্পু এবং শাওয়ার জেল এর মত অন্যান্য জিনিস রাখতে পারবেন ।</p>', 1700, 1390, 'SA-21', 0, 0, 1, '2022-10-02 16:38:58', '2022-10-02 16:38:58'),
(403, 4, 'Baby Portable Car Seat', 'baby-portable-car-seat', '<p><strong>Baby Portable Car Seat</strong></p>\r\n<p><strong>পণ্যের বিবরণ-</strong> সেফটি ভেস্ট বিশেষভাবে গাড়ি ভ্রমণের জন্য ডিজাইন করা হয়েছে, আপনার সন্তানকে বিপজ্জনক থেকে রক্ষা করুন, বেল্টটি সঠিক অবস্থানে রাখুন এবং ছোট মুখ ও ঘাড় থেকে দূরে রাখুন। এটি ক্ষতি এবং আঘাত থেকে দূরে থাকার জন্য আপনাকে একটি বড় সাহায্য দেয়</p>\r\n<p><strong>উপাদান- </strong>পিপি তুলা।</p>\r\n<p><strong>আকার-</strong> 50x26x22cm / 20&times;10.2&times;8.7ইঞ্চি।</p>', 1270, 1050, 'SA-17', 0, 0, 1, '2022-10-02 14:15:25', '2022-10-02 14:15:56'),
(404, 4, 'Deluxe Baby Bather', 'deluxe-baby-bather', '<p><strong>Deluxe Baby Bather</strong></p>\r\n<p>আপনার ছোট্ট বাবু সোনামণিদের জন্য</p>\r\n<p>👉আপনার সোনামনিকে গোসল করানো এখন একদম সহজ।</p>\r\n<p>👉এটি একটি চমৎকার জিনিস। বাচ্চাকে রোদ খাওয়ানো থেকে শুরু করে গোসল, গা মুছানো, তেল মাখানোর জন্য বেবি ব্যাথার ব্যবহার করতে পারেন।</p>\r\n<p>👉এটিও নবজাতক থেকে শুরু ২৪ মাস পযর্ন্ত ব্যবহার করা যায়</p>\r\n<p>👉ছোট বাচ্চাদের গোসল করানো অনেক সতর্কতার সাথে করা উচিত আবার নতুন মা-রা ভয়ও পায় বটে বেবি বাথার এর সাহায্যে বাচ্চাকে গোসল করানো সেই পরিমানের সহজ।সাথে বাচ্চার ব্যথার চান্সই নাই</p>\r\n<p>👉সম্পূর্ণ ওয়াটার প্রুফ কাপড়।</p>\r\n<p>👉ওয়াশএবেল।</p>\r\n<p>👉ককম্ফোর্টেবল</p>', 1600, 1300, 'SA-18', 0, 0, 1, '2022-10-02 15:54:15', '2022-10-02 15:54:15'),
(405, 4, 'Baby Mosquito Net Bed', 'baby-mosquito-net-bed', '<p><strong>Baby Mosquito Net Bed</strong></p>\r\n<p>আপনার বাচ্চাকে রাখুন সুস্থ সবল এবং জীবাণুমুক্ত।</p>\r\n<p>✅প্রোডাক্টের গুনাগুন-</p>\r\n<p>👉এটা সম্পূর্ণ কেমিক্যাল ফ্রি হাতের স্পর্শ ছাড়াই তৈরি।</p>\r\n<p>👉খুব সহজে ব্যবহার করা যায় এবং খুব সহজেই ফোল্ডিং করা যায়।</p>\r\n<p>👉অনেক সফট এবং কম্ফোর্টেবল। এটা ১০০% পলিস্টার মেষ ফেব্রিক্স দিয়ে তৈরি।</p>\r\n<p>👉তিনটি কালার এভেলেবেল আছে।</p>\r\n<p>👉সাইজ মেজারমেন্ট ছবিতে দেয়া আছে।</p>\r\n<p>👉১০০% কিউসি এপ্রুভড কোয়ালিটি। দামে সস্তা মানে ভালো।</p>\r\n<p>👉আপনার বাচ্চা যখন সুস্থ থাকবে আপনার মন থাকবে ফুরফুরা।</p>', 1400, 1050, 'SA-19', 0, 0, 1, '2022-10-02 16:10:50', '2022-10-02 16:10:50'),
(425, 7, 'Brows Flawless হেয়ার রিমুভার', 'brows-flawless-হেয়ার-রিমুভার', '<p><strong>Brows Flawless&nbsp;</strong></p>\r\n<p><strong>পন্যের বিবরন-</strong></p>\r\n<p>➤&nbsp;ভ্রু প্লাক, মুখ, আপার লিপ, লোয়ার লিপ, গলা ও ঘাড়ে অবাঞ্ছিত লোম রিমুভ করা যাবে।</p>\r\n<p>➤&nbsp;তাৎক্ষণিক ও ব্যথা মুক্ত উপায়ে ব্যবহার করা যাবে।</p>\r\n<p>➤&nbsp;ত্বকে লাল ভাব বা জ্বালাপোড়া করবে না।</p>\r\n<p>➤&nbsp;ভিতরে লাইট থাকায় লোম রিমুভে সুবিধা।</p>\r\n<p>➤&nbsp;কোন সাইড ইফেক্ট নেই।</p>\r\n<p>➤&nbsp;হাতের মুঠোয় ধরে ব্যবহার করতে পারবেন।</p>\r\n<p>➤&nbsp;সব ধরনের স্কিনের জন্য উপযোগী।</p>\r\n<p>➤&nbsp;পার্লার যাওয়া ঝামেলা থেকে মুক্তি।</p>\r\n<p>➤&nbsp;অরিজিনাল পন্য ১০০% কার্যকরী।</p>', 560, 450, 'SA-39', 0, 0, 1, '2022-10-03 17:03:04', '2022-10-03 17:03:04'),
(426, 7, 'Blue Heart Finger Ring', 'blue-heart-finger-ring', '<h4 id=\"gridSystemModalLabel\" class=\"modal-title see-title\">Blue Heart Finger Ring- Silver and Blue</h4>\r\n<ul>\r\n<li>Product Type: Finger Ring</li>\r\n<li>Color: Silver and Blue</li>\r\n<li>Good Quality Material</li>\r\n<li>Gender: Women</li>\r\n<li>Fashionable and Attractive Design</li>\r\n</ul>', 550, 380, 'SA-40', 0, 0, 1, '2022-10-03 17:14:03', '2022-10-03 17:14:03'),
(427, 4, 'Black Heads Remover', 'black-heads-remover', '<p><strong>Black Heads Remover</strong></p>\r\n<p>যারা ব্ল্যাকহেডস ও হোয়াইটহেডস সমস্যায় ভুগছেন এটা তাদের জন্য মাস্ট<br />Beautiful skin care expert solution.<br />Black, White Heads &amp; Pimple Remover<br />👉 এটি আপনার মুখের ব্ল্যাকহেডস দূর করবে।হোয়াইট হেডস দূর করবে।<br />👉 ব্লাক, হোয়াট হেড রিমুভার ব্যবহারে আপনার ফেস এর ব্রন, ব্লাক, হোয়াট হেডস নিমিষেই দূর করবে।<br />👉 এটা ব্যবহারে আপনার ফেইসে কোন স্পট বসবে না।<br />👉 ফেইস এর ময়লা পরিষ্কার করবে।<br />👉 ফেস এর উজ্জ্বলতা বৃদ্ধি করবে।<br />👉 এটা ব্যবহারে কোন প্বার্শ প্রতিক্রীয়া নেই।<br />👉 এটি USB চার্জিং সিস্টেম থাকার কারণে ব্যাটারি কিনতে হবে না।</p>\r\n<p>👉 এটি ব্যাবহারে স্কিনের ব্লাড র্সাকুলেসন বারে।<br />👉 ক্রমাগত ব্যাবহারে স্কিন ফেট কমে। এবং ডাবল চিন দূর হয়।</p>', 950, 750, 'SA-41', 0, 0, 1, '2022-10-03 17:29:20', '2022-10-03 17:29:20'),
(424, 7, 'Slimming Massage Ginger Oil', 'slimming-massage-ginger-oil', '<p><strong>Slimming Massage Ginger Oil</strong></p>\r\n<p>বেলি ড্রেনেজ আদা তেল, পেটের নাভিতে লাগান দিনে 1-2 বার এবং আলতোভাবে ম্যাসাজ করুন শোষিত হওয়া পর্যন্ত প্রায় 10-20 মিনিট।</p>\r\n<p><strong>স্পেসিফিকেশন: </strong></p>\r\n<p>➤ এই তেলটি: ডিটক্সিফাই করে এবং স্লিম করে, তেল কমায় এবং ত্বককে সতেজ করে। রক্ত সঞ্চালনকে উৎসাহিত করে এবং রক্তের স্থবিরতা দূর করে।</p>\r\n<p>➤ ব্যবহার: পেট, পা, নিতম্ব, ঘাড় সহ শরীরের যেকোনো অংশে ব্যাবহার করতে পারবেন</p>\r\n<p><strong> ব্যবহারবিধি:</strong></p>\r\n<p>➤ অল্প পরিমাণে এসেনশিয়াল অয়েল নিন। তালুতে ৩-৪ ফোঁটা এসেন্স পয়েন্ট ব্যবহার করুন। ➤ আক্রান্ত স্থানে সমানভাবে এসেনশিয়াল অয়েল লাগান এবং আলতোভাবে ম্যাসাজ করুন। ➤ শোষিত না হওয়া পর্যন্ত ম্যাসাজ করুন।</p>\r\n<p>➤ তেল শোষণ করতে সাহায্য করার জন্য আপনার আঙ্গুল দিয়ে ত্বকে ফ্লিক করুন।</p>', 420, 300, 'SA-38', 0, 0, 1, '2022-10-03 16:49:46', '2022-10-03 16:49:46'),
(422, 7, 'Stainless Steel AYATUL KURSI Cuff Bracelet', 'stainless-steel-ayatul-kursi-cuff-bracelet', '<p><strong>Stainless Steel AYATUL KURSI Cuff Bracelet </strong></p>\r\n<p><strong>Product Details-</strong></p>\r\n<p>👉 Product Material- High quality stainless steel</p>\r\n<p>👉 Product Color- Gold, Silver, Rose Gold</p>\r\n<p>👉 Product Size- Adjustable opening (press the opening to adjust the size)</p>\r\n<p>👉Product packaging- 1 bracelet (independent packaging in opp bag)</p>\r\n<p>👉 Applicable gender- unisex, religious jewelry</p>\r\n<p>👉 Wearing occasion- Party, dance, church, street, leisure, festival, daily</p>\r\n<p>👉 Purchase Note- 1. Due to manual measurement, the size may be slightly off.</p>', 650, 490, 'SA-36', 0, 0, 1, '2022-10-03 16:21:44', '2022-10-03 16:21:44'),
(423, 4, 'Live Makeup Multipurpose Ring Lamp With Mobile Stand', 'live-makeup-multipurpose-ring-lamp-with-mobile-stand', '<p><strong>Live Makeup Multipurpose Ring Lamp With Mobile Stand</strong></p>\r\n<p>👉 ৩ কালারের LED লাইটসহ অসাধারণ আয়না রয়েছে।</p>\r\n<p>👉 লাইটটা রিং-আকৃতির হওয়ায় আপনার চেহারা আরও স্পষ্ট করে তুলে।</p>\r\n<p>👉 ফলে, আপনাকে ভিডিওতে সূক্ষ্ম এবং মেকাপ করতে নিখুঁত দেখাবে।</p>\r\n<p>👉 লাইভ স্ট্রিমিং, সেলফি ফটো, মেকআপ, অনলাইন ট্রেনিং, ভিডিও শুটিং ইত্যাদিতে ব্যাপকভাবে ব্যবহৃত হয়।</p>\r\n<p>👉 মেকাপ আইটেম রাখার জন্য লাইটের নিচে ট্রে দেওয়া আছে।</p>\r\n<p>👉 আলোর স্বল্পতা পূরনের জন্য এই লাইট খুবই কার্যকরী</p>\r\n<p>👉&nbsp;আলো কমানো-বাড়ানোর জন্য কন্ট্রোলার দেওয়া আছে।</p>\r\n<p>👉 রিং-লাইট ব্যাটারি অথবা USB ক্যাবল দিয়ে ব্যবহার করা যায়।</p>\r\n<p>👉 রিং লাইটের স্ট্যান্ডটি ছোট-বড় করা যায়।</p>', 1150, 890, 'SA-37', 0, 0, 1, '2022-10-03 16:39:03', '2022-10-03 16:39:03'),
(421, 7, 'Fungal Removal Nail Treatment', 'fungal-removal-nail-treatment', '<p><strong>Fungal Removal Nail Treatment</strong></p>\r\n<div class=\"m8h3af8h l7ghb35v kjdc1dyq kmwttqpk gh25dzvf n3t5jt4f\">\r\n<div dir=\"auto\">ফাঙ্গাস জনিত নখের ড্যামেজ দূরীকরণ জেল। মাত্র ৭ দিন ব্যবহারেই প্রত্যাশিত ফলাফল।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n</div>\r\n<div class=\"l7ghb35v kjdc1dyq kmwttqpk gh25dzvf jikcssrz n3t5jt4f\">\r\n<div dir=\"auto\">ফাঙ্গাস জনিত নখের ড্যামেজ দূরীকরণ জেল 20ml । অত্যন্ত কার্যকরী সম্পূর্ণ প্রাকৃতিক। আমদানিকৃত সম্পূর্ন পার্শ্বপ্রতিক্রিয়া বিহীন।নখের ফাটা এবং অপুস্টিজনিত যেসব কালো দাগ পড়ে দূর করে । ফাঙ্গাল এর কারনে নখের আগা ফেটে যাওয়া এবং নখ সম্পুর্ন বড় না হওয়া জনিত সমস্যার সমাধান করে । নখ সুন্দর , বড় করে তোলে, নখের উজ্জলতা বৃদ্ধি করে। এর পাশা পাশি পায়ের গোড়ালি এর ফাটা অংশে ব্যবহারেও সেখানের ত্বক কোমল এবং মসৃন হয়।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n</div>\r\n<div class=\"l7ghb35v kjdc1dyq kmwttqpk gh25dzvf jikcssrz n3t5jt4f\">\r\n<div dir=\"auto\"><strong>ব্যবহারবিধি:</strong></div>\r\n<div dir=\"auto\">*ব্যাবহারের কিছুক্ষন আগে হালকা গরম পানি দিয়ে নখ ভিজিয়ে নিন।</div>\r\n<div dir=\"auto\">*এর পর পরিস্কার কোন কিছু নিয়ে নখের ভেতরে যদি কোন ময়লা থাকে তা পরিস্কার করে নিন ।</div>\r\n<div dir=\"auto\">*এর পর ২/৩ ফোটা Nail Repair Essence দিনে দুইবার করে দিবেন নখের আক্রান্ত অংশে (সকালে এবং রাতে) ।</div>\r\n</div>', 480, 320, 'SA-35', 0, 0, 1, '2022-10-03 16:11:12', '2022-10-03 16:11:12'),
(419, 7, 'NTFS Beauty Facial Aromatherapy Sprayer', 'ntfs-beauty-facial-aromatherapy-sprayer', '<p><strong>NTFS Beauty Facial Aromatherapy&nbsp;</strong></p>\r\n<p>NTFS Facial steamer or Nasal vapor machine.</p>\r\n<p>👉 Product name: Hot Facial Steamer</p>\r\n<p>👉 Power Source: AC110-240V 50/60HZ</p>\r\n<p>👉 Material: PTC PP ABS Power</p>\r\n<p>👉 Consumption: 130W Size: 17.5x25.5x16 cm</p>\r\n<p>👉 Volume: Max 50ml Net</p>\r\n<p>👉 Weight: 450g Steam</p>\r\n<p>👉 Temperature: Approx 40&deg;C</p>\r\n<p><strong> Package included: </strong></p>\r\n<p>👉 1 x Facial Steamer</p>\r\n<p>👉 1 x Measuring Cup</p>\r\n<p>👉 1 x Nose Cap</p>\r\n<p>👉 1 x User Manual(Please read it before use)</p>', 1450, 1190, 'SA-33', 0, 0, 1, '2022-10-03 15:25:24', '2022-10-03 15:25:31'),
(420, 7, 'Kinoki Detox Foot Pads', 'kinoki-detox-foot-pads', '<div class=\"m8h3af8h l7ghb35v kjdc1dyq kmwttqpk gh25dzvf n3t5jt4f\">\r\n<div dir=\"auto\"><strong>Kinoki Detox Foot Pads-10PCS/1 Boxes</strong></div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">কিনোকি ডিটক্স ফুট প্যাডস সর্বশেষ উদ্ভাবিত ডিটক্সিফিকেশন থেরাপি।এটি শরীর থেকে টক্সিন দূর করে এবং টক্সিনের জন্য যে ক্ষতিকর প্রভাব পড়ে তা কমিয়ে দেয়।</div>\r\n<div dir=\"auto\">টক্সিন হলো একধরনের বিষ, যা মানবদেহে খাবারের মাধ্যমে ও পরিবেশ দূষণের মাধ্যমে প্রবেশ করে। এই টক্সিন গুলো আমাদের শরীরে জমে জমে একটা সময় ক্যান্সার , হার্ট অ্যাটাক, জন্ডিস, ডায়াবেটিস এর মত বড় রোগে পরিণত হয়। তাই আজই আপনার এবং আপনার পরিবারের জন্য সংগ্রহ করুন।</div>\r\n</div>\r\n<div class=\"l7ghb35v kjdc1dyq kmwttqpk gh25dzvf jikcssrz n3t5jt4f\">\r\n<div dir=\"auto\">কেন ব্যবহার করবেন?</div>\r\n<div dir=\"auto\">================</div>\r\n<div dir=\"auto\">আমরা কি জানি যে, প্রতিদিন আমরা যা খাচ্ছি তা বিষাক্ত রাসায়নিক ও ফরমালিন যুক্ত ? প্রতিদিন আমরা যে প্রসাধনী ব্যবহার করছি তা কতটুকু নিরাপদ? প্রতিদিন আমাদের ব্যবহৃত মোবাইল, কম্পিউটার টেলিভিশন ইত্যাদির রেডিয়েশন আমাদের দেহে প্রবেশ করে। তাছাড়াও প্রতিদিন ধুলাবালি, পরিবেশ দূষন, ধূমপান এবং মদ্যপানের কারণে আমাদের দেহে মারাত্মক স্বাস্থ্য হানিকর পদার্থের প্রবেশ ঘটছে। এসব ক্ষতিকর উপাদান থেকে মুক্তি পাওয়া সম্ভব একমাত্র Detox Foot Pads ব্যাবহারের মাধ্যমে।</div>\r\n</div>\r\n<div class=\"l7ghb35v kjdc1dyq kmwttqpk gh25dzvf jikcssrz n3t5jt4f\">\r\n<div dir=\"auto\">ডিটক্স ফুট প্যাডের উপকারিতা সমূহঃ</div>\r\n<div dir=\"auto\">===========================</div>\r\n<div dir=\"auto\">● শরীর থেকে অনাকাঙ্খিত টক্সিন দূর করে।</div>\r\n<div dir=\"auto\">● এটি আপনার এনার্জি লেভেলকে বাড়িয়ে দেয়।</div>\r\n<div dir=\"auto\">● এটি আপনার বিপাকক্রিয়ার উন্নতি ঘটায়।</div>\r\n<div dir=\"auto\">● রক্ত পরিষ্কার করে এবং রক্ত প্রবাহ বাড়িয়ে দেয়।</div>\r\n<div dir=\"auto\">● বাতের ব্যাথা, হাটু ব্যথা, কোমর ব্যথা এবং মাংসপেশীর ব্যথা কমিয়ে শরীরকে ঝরঝরে করে তোলে।</div>\r\n<div dir=\"auto\">● ধূমপায়ীদের জন্য যারা শরীর থেকে নিকোটিন দূর করে সুস্থ থাকতে চান।</div>\r\n<div dir=\"auto\">● বিভিন্ন ধরনের বাতের ব্যথা হতে মুক্তি মিলবে।</div>\r\n<div dir=\"auto\">● শরীরের বিভিন্ন জ্বালা -যন্ত্রণা হতে মুক্তি মিলবে।</div>\r\n<div dir=\"auto\">● হাটুর ব্যাথা এবং মাংসপেশির ব্যথা কমিয়ে শরীরকে ঝরঝরে করে তুলে।</div>\r\n<div dir=\"auto\">● শরীর থেকে অতিরিক্ত টক্সিন বের করে।</div>\r\n<div dir=\"auto\">● শরীর এর এনার্জি লেভেল বৃদ্ধি করে।</div>\r\n<div dir=\"auto\">● মাথা ব্যথা কমাতে ও মানসিক চাপ কমাতে এটি সাহায্য করে।</div>\r\n<div dir=\"auto\">● রক্ত পরিস্কার ও রক্ত প্রবাহ বাড়িয়ে দেয়।</div>\r\n<div dir=\"auto\">● শরীরের ওজন হ্রাস/বৃদ্ধি ঠিক রাখার জন্য এটি ব্যবহার করা যায়।</div>\r\n<div dir=\"auto\">● শরীরের মধ্যে অতিরিক্ত চর্বি জাতীয় পদার্থ শোষণ করে।</div>\r\n<div dir=\"auto\">● রক্তের কোলেস্টেরল কমাতে সাহায্য করে।</div>\r\n<div dir=\"auto\">● চামড়ার কালোদাগ ও কুচকানো রোধ করে।</div>\r\n<div dir=\"auto\">● শরীর থেকে বিষাক্ত নিকোটিন বের করে।</div>\r\n<div dir=\"auto\">● এ্যাজমা ও ব্রংকাইটিসে বিশেষ উপকারী।</div>\r\n<div dir=\"auto\">● সাইনাসের সমস্যা দূর করে।</div>\r\n<div dir=\"auto\">● ঘামের দূগর্ন্ধ ও পায়ের মোজার দূগর্ন্ধ দূর করে।</div>\r\n<div dir=\"auto\">● এটি ব্যবহার করা খুবই সহজ।</div>\r\n<div dir=\"auto\">ব্যবহার বিধিঃ</div>\r\n<div dir=\"auto\">==========</div>\r\n<div dir=\"auto\">ডিটক্স প্যাডটি ঘুমানোর পূর্বে ব্যবহার করতে হবে। ডিটক্স প্যাচ ব্যবহারের পূর্বে পায়ের পাতা ভাল ভাবে ধুয়ে শুকিয়ে নিতে হবে।</div>\r\n<div dir=\"auto\">একটি আঠাযুক্ত শিট (sheet) নিয়ে ধীরে ধীরে কাগজটি তুলে ফেলতে হবে এবং পায়ের তলায় লাগাতে হবে</div>\r\n<div dir=\"auto\">এটি ৬ থেকে ৮ ঘন্টা পর খুলে ফেলতে হবে।</div>\r\n</div>\r\n<div class=\"l7ghb35v kjdc1dyq kmwttqpk gh25dzvf jikcssrz n3t5jt4f\">\r\n<div dir=\"auto\">পার্শ্ব প্রতিক্রিয়াঃ</div>\r\n<div dir=\"auto\">===========</div>\r\n<div dir=\"auto\">এটি একটি Organic Health Product ,শুধু মাত্র বাহ্যিক ব্যবহারের জন্য, তাই এর কোনো প্রকার পার্শ্ব প্রতিক্রিয়া নেই।</div>\r\n</div>', 370, 220, 'SA-34', 0, 0, 1, '2022-10-03 15:37:31', '2022-10-03 15:37:31'),
(418, 6, 'Usb Rechargeable Makeup Mirror Fan', 'usb-rechargeable-makeup-mirror-fan', '<p><strong>Usb Rechargeable Makeup Mirror Fan</strong></p>\r\n<p>প্রিয় মানুষকে গিফট করুন ইউনিক জিনিস</p>\r\n<p>Mirror with Led Light &amp; Fan (একের ভিতর সব)</p>\r\n<p>✔️ কিউট এই মিরর টার সাথে পাচ্ছেন লাইট এবং ফ্যান এটাচড করা 🤩🤩।</p>\r\n<p>যেটা মেকাপ এর জন্য পারফেক্ট। কারণ মেকাপ করতে আমাদের ফ্যান,লাইট দুইটায় লাগে</p>\r\n<p>✔️&nbsp;এটি আপনি বাইরে গেলেও সহজে নিয়ে যেতে পারবেন সাথে আয়না,ফ্যান দুইটাই পাবেন।</p>\r\n<p>✔️&nbsp;এইটা চার্জ সিস্টেম তাই ব্যাটারির ঝামেলাও নেই।</p>\r\n<p>✔️&nbsp;খুবই হালকা তাই সহজেই ক্যারি করা যায়।</p>\r\n<p><strong>Details-</strong></p>\r\n<p>👉The Mini Fan includes a built-in 1200mAh rechargeable battery and supports USB charging.</p>\r\n<p>👉compact and Light Weight</p>\r\n<p>👉 pocket size</p>\r\n<p>👉Rechargeable</p>\r\n<p>👉Rubber Fan Blade.</p>\r\n<p>👉USB Charging.</p>\r\n<p>👉Usage time: 1-2 hours.</p>\r\n<p>👉Soft 16 LED Light.</p>\r\n<p>👉Equipped with makeup mirror.</p>', 590, 480, 'SA-32', 0, 0, 1, '2022-10-03 15:09:57', '2022-10-03 15:09:57'),
(386, 4, 'LED Solar Step Lights (4 pcs Set)', 'led-solar-step-lights-4-pcs-set', '<p><strong>ওয়াটারপ্রুফ LED সোলার ডেক লাইট</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />&nbsp;ওয়াটার প্রুফ সোলার লাইট , বডি ABS ম্যটেরিয়ালের তৈরি।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />&nbsp;সোলার লাইট তাই কোন খরচ নাই।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> &nbsp;দিনে অটোমেটিক চার্জ হবে এবং রাতে অটোমেটিক আলো জ্বলবে, অন অফ করার ঝামেলা নেই।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />&nbsp;শক্তিশালী সোলার প্যানেল দ্বারা তৈরি তাই দীর্ঘ সময় আলো দেয়।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />&nbsp;খুব সহজেই ইন্সটল করা যায় ।</p>\r\n<p><strong>Packing List:</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> 4Pcs x Solar Deck Light Installation Screw &amp; Installation Tape</p>', 1190, 1050, 'SA-01', 0, 0, 1, '2022-10-01 19:54:09', '2022-10-04 18:08:40');
INSERT INTO `products` (`id`, `brand_id`, `name`, `slug`, `description`, `price`, `selling_price`, `sku`, `should_track`, `stock_count`, `is_active`, `created_at`, `updated_at`) VALUES
(387, 4, 'Baby Bouncer Chair(With out Toy)', 'baby-bouncer-chairwith-out-toy', '<p><strong>Baby Bouncer Chair(With out Toy)</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> এর উপরে বাচ্চাকে রেখে নড়াচড়া করলেই নিজে নিজে দুলতে থাকবে।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> আপনার বাচ্চা অনায়াসে খেলতে পারবে এটির ভিতরে।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> এটা মাথা,ঘার,কোমর ও মেরুদন্ড সোজা রাখে, যার ফলে আপনার বাচ্চার শারীরিক গঠনে সাহায্যে করবে।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> বিশ্রাম,ঘুম ও খেলা এই ৩ পজিশনেই ব্যবহার করতে পারবেন।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> এটি 60%কটন এবং 40% পলিয়েস্টারের উন্নতমানের নরম কাপর, তাই বাচ্চার জন্য অনেক আরামদায়ক এবং ত্বকের কোন ক্ষতি করবে না।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> এই চেয়ারটি লক বিশিষ্ট হওয়ার ফলে বাচ্চার পরে যাওয়ার ও কোন ভয় নেই।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> এটি ২০ কেজি ওজন বহন করতে সক্ষম</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> সর্বচ্চ ৩ বছরের বাচ্চাও ব্যাবহার করতে পারবে</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> এটি সহজেই খোলা যায় এবং ধৌত করা যায়।অফার</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> যে কোন জায়গায় বহন করতে পারবেন খুব সহজেই।</p>\r\n<p><strong>প্রোডাক্টটির বৈশিষ্ট্য</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> এটির মেটারিয়াল উন্নত মানের হওয়ায় দীর্ঘস্থায়ী &amp; টেকসই হবে।</p>\r\n<ul>\r\n<li>এটির ফেব্রিক্স ৪০% লেলিন ও ৬০% সুতির হওয়ায় বাচ্চার জন্য আরাম দায়ক।</li>\r\n<li>*এটির ফেব্রিক্সটি খুলে ওয়াস করা যাবে।</li>\r\n<li>* সহজে কালার নষ্ট হবে না।</li>\r\n<li>*এটি ভাজ করা যায় ও যেকোনো জায়গায় বহন করা যায়।</li>\r\n<li>*ওজনঃ 2 কেজি প্রায়।</li>\r\n</ul>', 1050, 820, 'SA-02', 0, 0, 1, '2022-10-01 21:00:51', '2022-10-04 18:10:02'),
