(389, 4, 'LCD Writing Tablet- 8.5\"', 'lcd-writing-tablet-85\"', '<p><strong>Display Type : LCD Display</strong></p>\r\n<p>Import from China</p>\r\n<p>LCD Writing Tablet - এর বিশেষ বৈশিষ্ট্য হচ্ছে-</p>\r\n<p>১ ) কালার ফন্ট এ লেখা ও ছবি আঁকা।</p>\r\n<p>২) খুব সহজেই লেখা ইরেজ / মুছা যায়।</p>\r\n<p>৩ ) কোনো কালির বা কাগজের প্রয়োজন হয় না।</p>\r\n<p>৪ ) এটিতে কোনো চার্জের প্রয়োজন হয় না , একটি ব্যাটারী ব্যবহার হয়। যেটিতে বছর পার। এছাড়া ব্যাটারী সহজে রিপ্লেসমেন্ট করা যায় । ৫ ) লেখা বা আঁকা ছবি স্ট্যান্ডবাই মুডে রাখা যায়।</p>\r\n<p>৬ ) লিখাগুলো সুস্পষ্ট ও যা সহজে বোঝা যায়।</p>\r\n<p>৭ ) সাথে পেন আছে , যা দিয়ে বাচ্চারা সহজে লিখতে ও আকতে পারে।</p>\r\n<p>৮ ) লক বাটনে ক্লিক করে লক করে রাখা যায়।</p>\r\n<p>৯ ) এটির মজবুত প্লাস্টিকের তৈরি , তাই এটি খুবই মজবুত।</p>\r\n<p>১০ ) এছাড়া ছাত্র - ছাত্রীদের গনিত এবং জ্যামিতিক চিত্র আকাঁ ও অফিস এর দৈনন্দিন রুটিন লিখে রাখা। তাই আপনার সন্তানের শিক্ষাকার্যকম এগিয়ে নিতে আজই সংগ্রহ করুন।</p>', 550, 390, 'SA-04', 0, 0, 1, '2022-10-01 21:45:58', '2022-10-02 06:06:32'),
(390, 4, 'Card Early Education Device', 'card-early-education-device', '<p><strong>Card Early Education Device</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> আমরা নিয়ে এসেছি Card Early Education Device এক থেকে 5 বছর বয়সী শিশুদের জন্য উপযুক্ত। আপনার শিশুর জন্য এটি হতে পারে চমৎকার উপহার।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> শুধুমাত্র কার্ড ঢোকানোর মাধ্যমে শিশুরা তাদের হাতের চোখের সমন্বয় করতে সক্ষম নয়। তারা শব্দগুলি কীভাবে উচ্চারণ করা হয় তা শুনতেও সক্ষম হয় এবং শব্দটি পুনরাবৃত্তি করে এবং চিহ্ন/ছবি থেকে শব্দ/শব্দ চিনতে শুরু করে।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> শিক্ষকরাও পৃথক সেটিংসে ডিভাইসটি ব্যবহার করে শিশুদের সাথে যোগাযোগ করতে পারেন।</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> অন্তর্ভুক্ত কার্ডগুলি হল প্রাণী, নিত্যপ্রয়োজনীয় জিনিসপত্র, যানবাহন, খাবার, ফলমূল, শাকসবজি, পোশাক, প্রকৃতি, রঙ, ব্যক্তি, কাজ এবং আকার, যাতে তারা সমস্ত ক্ষেত্রে শিখতে থাকা শিশুদের অন্তর্ভুক্ত করতে সক্ষম হয়।</p>\r\n<p><strong>স্পেসিফিকেশন:</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> রঙ: গোলাপী/নীল (ঐচ্ছিক)</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> শেল উপাদান: ABS</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> ব্যাটারি ক্ষমতা: 700mAh</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> আইটেমের আকার: 10.7 * 9 * 2 সেমি / 4.21 * 3.54 * 0.79 ইঞ্চি</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> আইটেম ওজন: প্রায়. 73.5g/2.59oz</p>\r\n<p><strong>প্যাকিং তালিকা:</strong></p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> 1 * বাচ্চা শেখার মেশিন</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> 1 * কার্ডের প্যাক (112pcs)</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> 1 * চার্জিং তার</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" /> 1 * ব্যবহারকারী ম্যানুয়াল</p>', 1280, 880, 'SA-05', 0, 0, 1, '2022-10-01 22:07:37', '2022-10-04 18:12:13'),
(391, 4, 'Magic Water Book', 'magic-water-book', '<p><strong>Magic Water Book <span class=\"hsphh064 owmke36a kjdc1dyq ctgv7vl3 m8h3af8h lvuc4oj0 je9skisw tt3ens6q eq5u9d8z\" data-testid=\"emoji\"><span class=\"tbl4rxom k8cr7cgy eusf8shn rl78xhln f7cxi1y6 srn514ro\">📕</span></span><span class=\"hsphh064 owmke36a kjdc1dyq ctgv7vl3 m8h3af8h lvuc4oj0 je9skisw tt3ens6q eq5u9d8z\" data-testid=\"emoji\"><span class=\"tbl4rxom k8cr7cgy eusf8shn rl78xhln f7cxi1y6 srn514ro\">📗</span></span><span class=\"hsphh064 owmke36a kjdc1dyq ctgv7vl3 m8h3af8h lvuc4oj0 je9skisw tt3ens6q eq5u9d8z\" data-testid=\"emoji\"><span class=\"tbl4rxom k8cr7cgy eusf8shn rl78xhln f7cxi1y6 srn514ro\">📘</span></span></strong></p>\r\n<ul>\r\n<li>আপনার বাচ্চার জ্ঞান বিকাশে অনেক সহায়তা করবে এই ম্যাজিক ওয়াটার বুক টি।</li>\r\n<li>এটির মাধ্যমে আপনার বাচ্চা বিভিন্ন ছবি ড্রইং করতে পারবে এবং সুন্দর ভাবে বিভিন্ন রং চিনতে পারবে।</li>\r\n<li>বাচ্চারা খুব আনন্দের সাথে এই Magic Water Book টি ব্যবহার করবে।</li>\r\n<li>এটিতে একবার রং করলে ছবিগুলো খুব প্রাণবন্ত ও রঙিন দেখায়।</li>\r\n<li>শুকানোর সাথে সাথে রঙিন জায়গাগুলি অদৃশ্য হয়ে যায় এবং পৃষ্ঠাগুলি বারবার রঙিন হতে থাকে।</li>\r\n</ul>', 580, 470, 'SA-06', 0, 0, 1, '2022-10-02 05:47:06', '2022-10-02 06:06:58'),
(392, 4, 'Magic Handwriting Practice Copy Book', 'magic-handwriting-practice-copy-book', '<p><strong>Magic Handwriting Practice Copy Book </strong></p>\r\n<ul>\r\n<li>আপনার বাবুর হাতের লিখা নিয়ে চিন্তিত?</li>\r\n<li>&nbsp;আপনার বাবুর হাতের লিখা শিখতে কি বেশি সময় লাগছে ?</li>\r\n<li>বাবুর হাতের লিখা সুন্দর হচ্ছেনা অথবা সোজা হচ্ছেনা?</li>\r\n<li>বাবু কে লিখা শেখানোর জন্য সময় দিতে পারতেছেন না ?</li>\r\n<li>আপনার বাবুর হাতের লিখা সুন্দর ও সোজা করার এক মেজিক্যাল বই হল magic practice writing book.</li>\r\n<li>👉 <strong>বইটির বিষেশত্বঃ</strong></li>\r\n<li>আপনার বাবুর হাতের লেখা ( Bangla, Arabic, Alphabet &amp;Number ) শেখার জন্য এই বইটি বিশেষ ভাবে কাজ করবে।</li>\r\n<li>বর্ণমালা ও ছবি গুলো খাঁজ কাটা রয়েছে যার ফলে শিশুদের লিখতে সুবিধা হয় এবং পাশাপাশি পড়তে ও পারবে।</li>\r\n<li>এই খাতায় লিখার ১০-১৫ মিনিট এর ভিতরে অটো মুছে যাবে।</li>\r\n<li>এটি খুবই উন্নতমানের মোটা কাগজের এবং অনেক মজবুত যেটি সহজে নষ্ট হবে না।</li>\r\n<li>প্রতিটি অক্ষর বিশেষ সফটওয়ারে ডিজাইন করা যাথে লিখাগুলির পুরুত্ব একই মাপের যার কারনে লিখার উপর কলম ঘুরানো সহজ</li>\r\n<li>কলমের সাথে একটি রাবার বা গ্রিপার থাকবে যা ধরে বাবুরা খুব সহজে লিখতে পারবে</li>\r\n<li>বার বার খাতা কিনার অপচয় থেকে রক্ষা পেতে পারেন।</li>\r\n<li>যে বইগুলো থাকবে</li>\r\n<li>*Alphabet Book * Number book * Adorsholipi (Bangla) &amp; *Arabic ( এক সেট ৪ পিচ বই এবং ১ টি কলম, ৫ টি শিস ও ১ টি গ্রিপার )</li>\r\n<li>Book Size -19x13 CM</li>\r\n</ul>', 950, 730, 'SA-07', 0, 0, 1, '2022-10-02 06:04:18', '2022-10-04 18:12:26'),
(393, 4, 'U Shape Silicone Baby Toothbrush', 'u-shape-silicone-baby-toothbrush', '<p><strong>U Shape Silicone Baby Toothbrush</strong></p>\r\n<p>ছোট বাচ্চাদের মুখের দূর্গন্ধ এবং জীবানু খুব দ্রুত আক্রমন করতে পারে এবং বাচ্চাদের ব্রাশ করানো অনেক কঠিন এবং রিস্কি।</p>\r\n<p>☆ সাধারন ব্রাশ এ অনেক সময় বাচ্চারা ব্যাথা পায় এবং রক্তক্ষরন পর্যন্ত হতে পারে।</p>\r\n<p>☆হাত না ঘুরিয়ে এবং ব্রাশ এর বডি মুখের ভিতরে না ঢুকিয়ে সহজেই মাত্র ১০ সেকেন্ডে মুখের জার্ম দূর করে।</p>\r\n<p>☆দাঁতের এবং মাড়ির কোনায় কোনায় সুন্দরভাবে ক্লিন করে, যার কারনে চকলেট বা মিষ্টি জাতীয় খাবার এর পর ব্যাবহার করলে দাত নষ্ট হবার ভয় থাকেনা।</p>\r\n<p>☆১-৬ বছরের বাচ্চাদের ব্যবহার উপযোগী</p>\r\n<p><strong>✓✓Description The product is a U-shaped toothbrush.</strong></p>\r\n<p>It is made of PP and silicone materials for durable and practical to use. A great choice for your kids. Help children to develop the good habit of brushing teeth, let children love brushing.</p>\r\n<p>✓✓Features ✓Material: PP, silicone.</p>\r\n<p>✓Made of high-quality PP and silicone materials, durable and practical for long term use. ✓Lightweight and portable to carry. Great for or home use.</p>\r\n<p>✓With brush head, they will not hurt the mouth.</p>\r\n<p>✓High-quality and low price, high cost performance.</p>\r\n<p>✓Comfortable for kids to hold and grip, convenient to use.</p>', 250, 180, 'SA-08', 0, 0, 1, '2022-10-02 06:21:41', '2022-10-02 06:21:41'),
(394, 4, 'BABY DUCK SCOOTY', 'baby-duck-scooty', '<p><strong>MORE INTERACTIONS:</strong></p>\r\n<p>You can play together,car party favors form a wind up toys party, more parent-child interaction, deeper friendship with friends, also can encourage kids to develop their imagination while have hours of fun.</p>\r\n<p><strong>HIGH QUALITY MATERIAL: </strong></p>\r\n<p>Made of quality ABS Plastic, it does no harm either to the environment, nor to the kids,smooth surface verysafe,durable quality fall resistant, easy to grasp and hold for little babies hands EXQUISITE DESIGN: No battery is required, and with a single push, you can move forward without using the battery. Then it will last a long distance.The duck\'s head can be rotated 360 degrees, and there will be a sound when it is rotated</p>\r\n<p><strong>CUTE GIFT:</strong></p>\r\n<p>Cartoon Duck on Motorcycle Model , attracting and creative designed.Cute cartoon ducky style backpack make kids be more happy to use it.Also great gift for kids or car collector fans</p>', 580, 450, 'SA-09', 0, 0, 1, '2022-10-02 06:45:54', '2022-10-02 06:45:54'),
(395, 4, 'Baby Basketball Shooting Game', 'baby-basketball-shooting-game', '<p><strong>Baby Basketball Shooting Game</strong></p>\r\n<p>* Quick Details Type: Other Educational Toys</p>\r\n<p>* Gender: Unisex Age Range: 1 to 5 Years</p>\r\n<p>* Place of Origin: Guangdong,China</p>\r\n<p>* Brand Name: Yifan</p>', 600, 450, 'SA-10', 0, 0, 1, '2022-10-02 08:24:32', '2022-10-02 08:24:32'),
(396, 4, 'Children Projector Toy Flashlight Animal', 'children-projector-toy-flashlight-animal', '<p><strong>Children Projector Toy Flashlight Animal</strong></p>\r\n<p>আপনার সন্তানকে মোবাইল,ইউটিউব বা এই ধরনের ক্ষতিকারক নেশা থেকে দূরে রাখতে আমরা নিয়ে এলাম অত্যন্ত কার্যকরী শিক্ষণীয় প্রোডাক্ট।</p>\r\n<ul>\r\n<li>এবার আপনার সন্তান শিখবে খেলার ছলে ও আনন্দের সাথে।</li>\r\n<li>ছোট্ট সোনামনির বুদ্ধি বিকাশে এবং শেখার পদ্ধতিতে একধাপ এগিয়ে রাখতে শিক্ষণীয় খেলনা।</li>\r\n<li>এখানে আছে জীবজন্তু এবং পশু পাখির বিভিন্ন রকমের ছবি।</li>\r\n<li>খুব সহজেই আপনার বাচ্চা শিখে যাবে বিভিন্ন প্রাণী,জীব-জন্তু ও অন্যান্য জিনিসের নাম</li>\r\n<li>ছবি গুলো ফ্লিপ চেঞ্জ করানো যায়</li>\r\n<li>চাইনিজ ইমপোর্ট করা</li>\r\n</ul>', 630, 490, 'SA-011', 0, 0, 1, '2022-10-02 08:39:29', '2022-10-02 08:39:29'),
(397, 4, 'Induction Crystal Flying Ball', 'induction-crystal-flying-ball', '<h1 class=\"product_title entry-title\"><strong>Induction Crystal Flying Ball</strong></h1>\r\n<ul>\r\n<li>Best Toy for Gift,Random Color.</li>\r\n<li>এটি হাতের সেন্সর এর মাদ্ধমে উড়ে এবং কন্ট্রোল করা যায়&nbsp;</li>\r\n<li>রিচার্জেবল।&nbsp;</li>\r\n<li>আপনার আদরের বাচ্চার জন্য একটি আনকমন খেলনা</li>\r\n<li>পাখাগুলো সফট্-প্লাষ্টিক ম্যাটেরিয়ালে তৈরী তাই আঘাত লাগার কোন ভয় নেই।</li>\r\n<li>জন্মদিন বা যে কোন অনুষ্ঠানে ছোটো সোনামণিদের গিফট করতে পারেন এই আকর্ষণীয় এয়ারক্রাফট।</li>\r\n<li>একবার ফুল চার্জে অনেক্ষণ আকাশে উড়বে।</li>\r\n<li>সব বয়সের বাচ্চাদের জন্য আদর্শ খেলনা।</li>\r\n<li>Charging Time: 30 minutes</li>\r\n<li>Flying Time: About 20-25 minutes</li>\r\n</ul>', 880, 650, 'SA-12', 0, 0, 1, '2022-10-02 08:54:33', '2022-10-02 08:54:33'),
(398, 4, 'Baby-Kids Reading Table', 'baby-kids-reading-table', '<div dir=\"auto\"><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t12/1.5/16/1f58d.png\" alt=\"🖍\" width=\"16\" height=\"16\" /></span><strong>Kid\'s Reading Table.<span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t25/1.5/16/1f4dd.png\" alt=\"📝\" width=\"16\" height=\"16\" /></span><span class=\"fxk3tzhb b2rh1bv3 gh55jysx m8h3af8h ewco64xe kjdc1dyq ms56khn7 bq6c9xl4 eohcrkr5 akh3l2rg\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t10/1.5/16/1f58b.png\" alt=\"🖋\" width=\"16\" height=\"16\" /></span></strong><strong>Baby reading table</strong></div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\"><em>সোনামনিদের</em>&nbsp;আনন্দের <em>লেখাপড়ার সময়কে আরো&nbsp; </em>আনন্দদায়ক করতে আমরা নিয়ে এসেছি মাল্টি ফাংশনাল সোনামনি ডেস্ক ।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />&nbsp;যে ডেস্ক ব্যবহার করে আপনার সোনামনি খেলাধুলার পাশাপাশি লেখাপড়াও করতে পারবে । খেলাধুলার ক্ষেত্রেও ব্যবহার করতে পারবে, পড়ালেখার কাজেও ব্যবহার করতে পারবে ডেস্ক টেবিলটি।</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />&nbsp;টেবিলটি বহনযোগ্য যেকোনো জায়গায় বসে সোনামণিরা পড়তে এবং খেলতে পারবে।</div>\r\n<div dir=\"auto\">বিছানায় নিয়ে টেবিলটিতে পড়াশোনা করা যাবে,</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />&nbsp;এছাড়া মেঝে, সোফায় বসে পড়তে পারবে।</div>\r\n<div dir=\"auto\"><strong>Baby reading table</strong></div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />Material- Plastic</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />Size- 30*56*21.5cm</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />Made in China</div>\r\n<div dir=\"auto\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1.5/16/1f449.png\" alt=\"👉\" />Colour : Pink, Blue, Yellow, Light Green all available now.</div>', 550, 390, 'SA-012', 0, 0, 1, '2022-10-02 12:15:52', '2022-10-02 12:15:52'),
