(408, 4, 'Baby Nail Cutter', 'baby-nail-cutter', '<p><strong>Baby Nail Cutter/Trimmer</strong></p>\r\n<p>✅ছোটদের নখ কাটা নিয়ে বাবা- মায়েরা সবসময়ই দুঃশ্চিন্তায় ভোগে। শিশুদের নখ রাখা , কাটা, ময়লা পরিষ্কার করা সবগুলো বিষয়েই বিশেষ সতর্কতা মেনে চলা উচিত।</p>\r\n<p>✅শিশুদের হাত পায়ের নখ তুলনামূলক বেশ পাতলা হয় তাই তারা নিজেরাও মাঝে মাঝে নিজেদের শরীরে স্ক্র্যাচ করে। আবার রেগুলার নেইল কাটার দিয়ে নখ কাটার সময় তাদের চামড়া কেটে যায়, রক্ত ক্ষরণ হয়। হাতে নখ বড় হয়ে গেলে ব্যাক্টেরিয়ার সংক্রমন ঘটে আর শিশুদের যেহেতু হাত মুখে দেওয়ার অভ্যাস থাকে তাই এটা খুবই ক্ষতিকর একটা দিক।</p>\r\n<p>✅এই সকল সমস্যার সমাধানের জন্যই Nail Trimmer. এর ব্যবহার শিশুর ত্বককে সুরক্ষা দিবে এবং নখ কাটা নিয়ে দুঃশ্চিন্তা থেকেও মুক্তি দিবে। Nail Trimmer টি AA সাইজের ব্যাটারি চালিত। বয়সের ভিত্তিতে নখকে মসৃন করার জন্য 5 টি ভিন্ন ভিন্ন Grinding Head থাকবে।</p>\r\n<p>&nbsp;</p>', 920, 690, 'SA-22', 0, 0, 1, '2022-10-02 16:53:20', '2022-10-02 16:53:20'),
(409, 4, 'Baby Fruit Pacifier Nipple 2 pis', 'baby-fruit-pacifier-nipple-2-pis', '<p><strong>Baby Fruit Pacifier Nipple</strong></p>\r\n<p>✅ আপনার বেবি বেড়ে ওঠাতে তার সঠিক পুষ্টি ও সু-স্বাস্থ্যের প্রতি আপনি অবশ্যই সচেতন! তাই দেড়ি না করে আজই আপনার সোনামণির জন্য বেবি ফ্রুট প্যাসিফিয়ার নিয়ে নিন। এটি একটি আকর্ষণীয় খেলনা সাদৃশ্য যা বাচ্চাদেরকে সহজেই আকৃষ্ট করে।</p>\r\n<p>বৈশিষ্ঠ্য-</p>\r\n<p>✅ এটির ক্ষুদ্র ছিদ্রগুলো শুধু ক্ষুদ্র খাদ্যকণা বাচ্চার খাদ্যনালীতে পাঠায়।</p>\r\n<p>✅ বাচ্চার গলায় খাবার আটকানোর কোন ভয় নেই।</p>\r\n<p>✅ বাচ্চার বেড়ে ওঠা ও খাদ্য গ্রহণে এটি নিরাপদ ও স্বাস্থ্যকর।</p>\r\n<p>✅ বাচ্চাদের শক্ত খাবার গ্রহনে অভ্যস্ত করে তোলায় সহায়ক।</p>\r\n<p>✅ সহজে পরিষ্কার করা যায় শুধুমাত্র উষ্ণ সাবান পানি ব্যবহার করে।</p>', 570, 410, 'SA-23', 0, 0, 1, '2022-10-02 17:05:42', '2022-10-21 17:30:33'),
(410, 4, 'Kids Ice Cream Car Toy', 'kids-ice-cream-car-toy', '<p><strong>Kids Ice Cream Car Toy With Light Music</strong></p>\r\n<p>✅Transparent বা স্বচ্ছ খেলনা আইসক্রিম কার্টটি চতুর্দিকে চলতে পারে এবং বাচ্চারা সহজেই কন্ট্রোল করতে পারবে।</p>\r\n<p>✅এই খেলনা আইসক্রিম কার্টটির ভেতরের অংশ স্বচ্ছ এবং বিভিন্ন রঙের হওয়ায় শিশুরা খেলে খুবই আনন্দ পাবে।</p>\r\n<p>✅এই কালারফুল স্বচ্ছ খেলনা আইসক্রিম কার্ট বাচ্চাদের হাত ও চোখের সমন্বয় বৃদ্ধি করতে দারুণ কাজ করে।</p>\r\n<p>✅এর ভেতরের অংশে রয়েছে বিভিন্ন আকৃতির ডিজাইন, এতে শিশুরা আকৃতি সম্পর্কে ধারনা পাবে।</p>\r\n<p>✅এই খেলনা আইসক্রিম কার্টতে রয়েছে চমৎকার কালারফুল লাইটিং এবং মিউজিক যা দেখে বাচ্চারা খেলবে ও উৎফুল্ল থাকবে।</p>\r\n<p>✅এটি খুবই টেকসই এবং বাচ্চাদের জন্য নিরাপদ একটি খেলনা।</p>', 950, 680, 'SA-24', 0, 0, 1, '2022-10-02 17:24:32', '2022-10-02 17:24:32'),
(411, 4, 'LCD Writing Tablet- 10.5\"', 'lcd-writing-tablet-105\"', '<p><strong>LCD Writing Tablet- 10.5\"</strong></p>\r\n<p><strong>Display Type : LCD Display</strong></p>\r\n<p>Import from China</p>\r\n<p>LCD Writing Tablet - এর বিশেষ বৈশিষ্ট্য হচ্ছে-</p>\r\n<p>১ ) কালার ফন্ট এ লেখা ও ছবি আঁকা।</p>\r\n<p>২) খুব সহজেই লেখা ইরেজ / মুছা যায়।</p>\r\n<p>৩ ) কোনো কালির বা কাগজের প্রয়োজন হয় না।</p>\r\n<p>৪ ) এটিতে কোনো চার্জের প্রয়োজন হয় না , একটি ব্যাটারী ব্যবহার হয়। যেটিতে বছর পার। এছাড়া ব্যাটারী সহজে রিপ্লেসমেন্ট করা যায় । ৫ ) লেখা বা আঁকা ছবি স্ট্যান্ডবাই মুডে রাখা যায়।</p>\r\n<p>৬ ) লিখাগুলো সুস্পষ্ট ও যা সহজে বোঝা যায়।</p>\r\n<p>৭ ) সাথে পেন আছে , যা দিয়ে বাচ্চারা সহজে লিখতে ও আকতে পারে।</p>\r\n<p>৮ ) লক বাটনে ক্লিক করে লক করে রাখা যায়।</p>\r\n<p>৯ ) এটির মজবুত প্লাস্টিকের তৈরি , তাই এটি খুবই মজবুত।</p>\r\n<p>১০ ) এছাড়া ছাত্র - ছাত্রীদের গনিত এবং জ্যামিতিক চিত্র আকাঁ ও অফিস এর দৈনন্দিন রুটিন লিখে রাখা। তাই আপনার সন্তানের শিক্ষাকার্যকম এগিয়ে নিতে আজই সংগ্রহ করুন।</p>', 590, 470, 'SA-25', 0, 0, 1, '2022-10-02 17:30:11', '2022-10-02 17:30:11'),
