(415, 6, 'Ayatul Kursi Necklace', 'ayatul-kursi-necklace', '<p><strong>Ayatul Kursi Necklace</strong></p>\r\n<p>💘Ayatul Kursi round Necklace stainless steel</p>\r\n<p>💘 💫18K Gold plated💫</p>\r\n<p>💨Both for men and women💨</p>\r\n<p>💞Color- Silver ,Gold , Rose gold 💞</p>', 1070, 790, 'SA-29', 0, 0, 1, '2022-10-02 20:51:28', '2022-10-02 20:51:28'),
(416, 6, 'Eelhoe Hair Mask', 'eelhoe-hair-mask', '<p><strong>Eelhoe Hair Mask</strong></p>\r\n<p>Hair Lofting Cream Repairs Damaged Roots And Nourishes Hair Scalp Treatments কোকোনাট অয়েল হেয়ার ট্রিটমেন্ট মাস্ক কোঁকড়া হেয়ার লোফটিং ক্রিম মেরামত ক্ষতিগ্রস্থ কেরাটিন মেরামত পুষ্টিকর হেয়ার এসেন্স কেয়ার স্মুথিং রক্ষণাবেক্ষণ</p>\r\n<p><strong>Description-</strong></p>\r\n<p>influences-</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> Nourish, rebuild and repair hair, restore its elasticity,</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> Promote the flow of nutrients to the scalp,</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> our hair is shiny and smooth</p>\r\n<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" /> Enrich hair roots to help prevent breakage.</p>\r\n<p><strong>safety warning </strong></p>\r\n<p>For external use. Keep out of reach of children. Avoid contact with eyes. After contact, rinse with water. If redness, tingling or other irritation occurs after use, please discontinue use.</p>\r\n<p><strong>Direction-</strong></p>\r\n<p>Wash and towel dry your hair. Divide the hair into small pieces. Apply the mask from the roots. Use a wide-toothed comb or fingers to comb the hair to make the hair evenly distributed. Let it penetrate for 3 to 5 minutes. Rinse well. The style is business as usual. For best results, use 2-3 times a week.</p>', 590, 500, 'SA-30', 0, 0, 1, '2022-10-02 21:10:10', '2022-10-02 21:15:01'),
