(591, 4, 'T500 Plush Smartwatch', 't500-plush-smartwatch', '<p>স্মার্ট মানুষদের জন্য স্টাইলিশ স্মার্ট ওয়াচ</p>\r\n<p><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfa/1/16/231a.png\" alt=\"⌚\" width=\"16\" height=\"16\" /></span>মডেল- T500 Plus Smartwatch অর্ধেক দামে অরিজিনাল পণ্য।</p>\r\n<p><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" width=\"16\" height=\"16\" /></span> যা যা পাবেন এই স্মার্টওয়াচে- ---সময় ও তারিখ আলাদা আলাদা থিমে এবং ডিজাইনে ---আপনার ফোনের কল রিসিভ করে কথা বলতে পারবেন --- এইটার মাধ্যমে ডায়াল করে কল দিতেও পারবেন ---গান শুনতে পারবেন --- ফোনের মিউজিক কন্ট্রোল করতে পারবেন ---লাউডস্পীকার ---ফুল টাচস্ক্রীণ মোবাইলের মত ব্যবহার করতে পারবেন ---হার্টবিট নির্নয় ---ব্লাড প্রেশার নির্নয়। ---কত স্টেপ হাটলেন সেটা জানতে পারবেন। ---কত কিলোমিটার পথ হাটলেন সেটাও জানতে পারবেন। --- সারাদিন কতক্ষণ ঘুমালেন সেটিও জানতে পারবেন এর মাধ্যমে। ---আপনার ফোনের কল,ম্যাসেজ কিংবা ফেসবুকের নোটিফিকেশন গুলো পাবেন। ---কে কল দিয়েছে সেটা দেখতে পাবেন। ---এই ঘড়িটির মাধ্যমে আপনার ফোনের ক্যামেরা দিয়ে ছবি তুলতে ---চার্জিং ব্যাকআপঃ ফোনের সাথে কানেক্ট করা থাকলে ২-৩ দিন চার্জ থাকবে। ------ফোনের সাথে কানেক্ট না থাকলে ৩-৪ দিন চার্জ পাবেন</p>', 1550, 1000, 'BD131', 0, 0, 1, '2022-11-09 11:44:53', '2022-11-09 11:57:40'),
(592, 4, 'Window Door Entry Alarm', 'window-door-entry-alarm', '<p>Window Door Alarm (MC06-1)</p>\r\n<p>1 ইলেকট্রনিক ম্যাগনেটিক সেন্সর এন্ট্রি সনাক্ত করে।</p>\r\n<p>2 দুটি টুকরা আলাদা করা হলে অ্যালার্ম সক্রিয় হয়।</p>\r\n<p>3 কেউ দরজা বা জানালা খুললে একটি অ্যালার্ম দেয়।</p>\r\n<p>4 দুটি অংশ পুনরায় মিলিত হলে অ্যালার্ম বন্ধ হয়ে যায়।</p>\r\n<p>5 সহজ অপারেশনের জন্য চালু/বন্ধ সুইচ সহ অ্যালার্ম।</p>\r\n<p>6 সুপার লাউড 105 ডিবি অ্যালার্ম সাউন্ড।</p>\r\n<p>7 বাড়ি, অ্যাপার্টমেন্ট, মোবাইল হোম, ডর্ম, অফিস, হোটেল রুম, গ্যারেজ এবং আরও অনেক কিছুর জন্য আদর্শ প্রবেশ সতর্কতা!...</p>', 690, 490, 'BD33', 0, 0, 1, '2022-11-10 07:58:44', '2022-11-10 07:59:04'),
(594, 4, 'Bumping Maker', 'bumping-maker', '<p>ডাম্পলিং মেকার মেশিন প্রেস ডাম্পলিংস মোল্ড কিচেন অ্যাকসেসরিজ স্বয়ংক্রিয় প্রেসিং টুল DIY Empanadas Ravioli Mold Home Gadget ব্র্যান্ডের নাম:RIGWARL Origin:Mainland China Speciality Tools Type:Other Type:Speciality Tools certification:CE / EU Material:Plastic Plastic Type:pc</p>\r\n<p><span class=\"x3nfvp2 x1j61x8r x1fcty0u xdj266r xhhsvwb xat24cr xgzva0m xxymvpz xlup9mm x1kky2od\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t6a/1/16/2b1b.png\" alt=\"⬛\" width=\"16\" height=\"16\" /></span>&nbsp; দেশের যে কোন প্রান্ত থেকে প্রোডাক্টটি অর্ডার করতে পারেন। ডেলিভারী চার্জ: ঢাকা সিটির মধ্যে: ৭০/- টাকা ঢাকার বাহিরে ১৫০/- টাকা</p>', 1390, 950, 'BD34', 0, 0, 1, '2022-11-13 09:24:35', '2022-12-23 02:18:09'),
(595, 4, 'Mini Sewing Machine', 'mini-sewing-machine', '<p>Mini sewing machine Price -1050 tk</p>\r\n<p>Call-01870-824009</p>\r\n<p>1)স্মার্ট নারীদের জন্য স্মার্ট গেজেট। এসে গেল vof brand Hi Quality 8 in 1 ইলেকট্রিক সেলাই মেশিন... কাপড় সেলাই করা অনেক পরিশ্রমের কাজ। অবসর সময়ে এই বিশাল পরিশ্রমের কাজ করতে যেয়ে আমাদের আরো ঝামেলায় পড়তে হয় 2) আপনাদের কাজ অর্ধেক কমিয়ে দিতে এই সেলাই মেশিনটিতে আপনি পাবেন কোন রকম পরিশ্রম ছাড়াই বিদ্যুৎ সংযোগ অথবা ব্যাটারির মাধ্যমে কাজ করার সুবিধা, যা আপনাকে স্বল্প সময়ে অল্প পরিশ্রমে অধিক কাজ করতে সহায়তা করবে 3) মিনি এই সেলাই মেশিন দিয়ে আপনি ঘরে বা বাইরে যেকোন ধরনের কাপড় খুব সহজেই সেলাই করতে পারবেন। তাই রেখে দিন আপনার পুরনো ভারি মেশিন আর যুগের সাথে তাল মিলিয়ে কিনে ফেলুন এই আধুনিক সিলাই মেশিন 4) সুবিধাসমূহঃ দ্বিগুন গতি 5) সহজে বহনযোগ্য এবং হালকা 6) সামনে-পিছনে সমানভাবে সিলাই 7) সুইচ অথবা পেডেলের মাধ্যমে চালনা ৪)এডাপ্টার দিয়েও চালনা করা যায়। (৬ ভোল্ট ডিসি ৬০০মিলিএম্প) 9) ওজনঃ ৬৪৮ গ্রাম 10) সাইজঃ ২১&times;১২.৫x২০ সেন্টিমিটার 11) মেশিনের সাথে আপনি আরো যা যা পাচ্ছেন ১টি সুই 12) এডাপ্টার 13) একটি ফুট পেডেল 14) ববিন ৪ টা</p>', 1200, 999, 'BD135', 0, 0, 1, '2022-11-14 17:31:19', '2023-02-01 01:30:54'),
(596, 4, '3D Colorful LED Light', '3d-colorful-led-light', '<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>I<span style=\"text-decoration: underline;\">tem Description</span></strong></span></p>\r\n<p>3D Colorful LED Edison Light Bulb E27 220V Vintage</p>\r\n<p>Fireworks Decoration Bulb ST64 G95 A60 Christmas</p>\r\n<p>Ampoule LED Lamp Lighting</p>\r\n<p><strong> Specification:</strong></p>\r\n<p><strong> Base</strong>: <strong>E27</strong></p>\r\n<p><strong> Voltage:</strong><strong>220V 50/60Hz</strong></p>\r\n<p><strong>Color Temperature: Multiple Color </strong></p>\r\n<p><strong> Materia</strong>l<strong>:Silver Plated Glass Cover</strong></p>\r\n<p><strong>Packing: 1x 3D Bulb(not including the lamp holder)</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 999, 799, 'BD239', 0, 0, 1, '2022-11-20 23:25:16', '2022-11-20 23:25:27'),
(597, 4, 'I Baby Rocker', 'i-baby-rocker', '<div class=\"product-name\">\r\n<h1>iBaby Infant to Toddler Rocker with Musical Toy Bar &amp; Vibrations</h1>\r\n</div>\r\n<p class=\"sku\">Product Code :BD250</p>\r\n<div class=\"short-description\">\r\n<div class=\"std\">● Product :&nbsp; I Baby Rocker<br />● Color Family : Pink/Blue<br />● Age group : 0 months to 3 year<br />● Maximum weight : 18 kg<br />● Battery Operated Vibration &amp; Music<br />● Dimensions : 47 x 9 x 42.8 cm<br />● Removable, machine washable pad<br />● Deep cradle seat with calming vibrations<br />● It becomes a toddler rocking chair !<br />● Extra accessories: 3 detachable fun toys</div>\r\n</div>', 3450, 3000, 'BD250', 0, 0, 1, '2022-11-25 01:37:15', '2022-11-25 01:37:26'),
