(612, 9, '3pcs combo Hemorrhoi Pilse Ointment DICTAMIN Cream', '3pcs-combo-hemorrhoi-pilse-ointment-dictamin-cream', '<div id=\"featurebullets_feature_div\" class=\"celwidget\" data-feature-name=\"featurebullets\" data-csa-c-type=\"widget\" data-csa-c-content-id=\"featurebullets\" data-csa-c-slot-id=\"featurebullets_feature_div\" data-csa-c-asin=\"B07T9JXQVG\" data-csa-c-is-in-initial-active-row=\"false\" data-csa-c-id=\"f0c0s-etfu07-xjb9nb-c2uwqd\" data-cel-widget=\"featurebullets_feature_div\">\r\n<div id=\"feature-bullets\" class=\"a-section a-spacing-medium a-spacing-top-small\">\r\n<table class=\"a-normal a-spacing-micro\">\r\n<tbody>\r\n<tr class=\"a-spacing-small po-brand\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Brand</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base po-break-word\">CX-YOU</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-item_form\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Item Form</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base po-break-word\">Cream</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-product_benefit\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Product Benefits</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base po-break-word\">Itch Control</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-active_ingredients\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Active Ingredients</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base po-break-word\">白鲜皮（CORTEX DICTAMNI)，苦参(SOPHORA)，黄柏(TRACTAT)，蛇床子(CNIDIUM)，土槿皮(PSEUDOLARIC)，樟脑，羊毛脂，凡士林，醋酸氯己定，水。</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-age_range_description\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Age Range (Description)</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base po-break-word\">Adult</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h1 class=\"a-size-base-plus a-text-bold\">About this item</h1>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n<li><span class=\"a-list-item\">1.Chinese Herbal Hemorrhoids Cream can help relieve itching, burning, discomfort caused by hemorrhoids.</span></li>\r\n<li><span class=\"a-list-item\">2.Quickly stop the pain! Hemorrhoids Cream is the solution!</span></li>\r\n<li><span class=\"a-list-item\">3.Hemorrhoids Ointment Cream provides soothing relief to the area of the anus. Anti-inflammatory properties - Restores dilated and inflamed veins and restores them to normal</span></li>\r\n<li><span class=\"a-list-item\">4.Anti-inflammatory properties - Restores dilated and inflamed veins and restores them to normal</span></li>\r\n<li><span class=\"a-list-item\">5.How to use : For external use. After cleaning the anus,take this dictamni hemorrhoids cream apply on affected area, 1-2 times a day.</span></li>\r\n<li><span class=\"a-list-item\">6.Repair cracks and damaged tissue - Stimulate the healing process faster as it softens and moisturizes the anal area to remove damaged tissue and promote regrowth of new healthy skin.</span></li>\r\n<li><span class=\"a-list-item\">7.We are so confident our products high quality and work, if for any reason you don\'t love it, Please send me an email and we will give you a satisfactory answer.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div id=\"provenanceCertifications_feature_div\" class=\"celwidget\" data-feature-name=\"provenanceCertifications\" data-csa-c-type=\"widget\" data-csa-c-content-id=\"provenanceCertifications\" data-csa-c-slot-id=\"provenanceCertifications_feature_div\" data-csa-c-asin=\"B07T9JXQVG\" data-csa-c-is-in-initial-active-row=\"false\" data-csa-c-id=\"1nvdjm-pgs17a-spzrm6-cd78yp\" data-cel-widget=\"provenanceCertifications_feature_div\"></div>\r\n<div id=\"serviceCapabilities_feature_div\" class=\"celwidget\" data-feature-name=\"serviceCapabilities\" data-csa-c-type=\"widget\" data-csa-c-content-id=\"serviceCapabilities\" data-csa-c-