(613, 10, 'Vitamin C Brightening Eye Serum', 'vitamin-c-brightening-eye-serum', '<h1><strong><span lang=\"EN-US\" data-spm-anchor-id=\"a2g0o.detail.1000023.i0.658a529dE8mPh7\">Name</span>:<span lang=\"EN-US\">VITAMIN C Brightening Eye Serum</span></strong></h1>\r\n<p><span lang=\"EN-US\">Net Weight</span>:<span lang=\"EN-US\">20g</span></p>\r\n<p><span lang=\"EN-US\">Shelf time</span>:<span lang=\"EN-US\">3 years</span></p>\r\n<p><span lang=\"EN-US\">Ingredients:Vitamin c,Hyaluronic acid,Leonurus sibiricus,Oryza sativa,Dendrobium candidum,Cynanchum atratum.</span></p>\r\n<p><span lang=\"EN-US\">Dscription:</span></p>\r\n<ol>\r\n<li><span lang=\"EN-US\">Lighten dark circle</span></li>\r\n<li><span lang=\"EN-US\">Improve crows feel</span></li>\r\n<li><span lang=\"EN-US\">Brightening skin tone</span></li>\r\n<li><span lang=\"EN-US\">Hydrate and moisturizing</span></li>\r\n</ol>\r\n<p><span lang=\"EN-US\">How to use</span></p>\r\n<ol>\r\n<li data-spm-anchor-id=\"a2g0o.detail.1000023.i2.658a529dE8mPh7\"><span lang=\"EN-US\">After cleansing, take an appropriate amount of Vitamin C brightening eye serum and apply it to the skin around the eyes</span></li>\r\n<li><span lang=\"EN-US\">Gently tap the skin around the eyes with finger tips at the corners of the eyes to help absorption.</span></li>\r\n</ol>', 950, 699, 'BD777', 0, 0, 1, '2023-02-06 01:34:54', '2023-02-12 01:08:48'),
