(621, 4, 'DIGITAL TASBIH WITH COMPASS', 'digital-tasbih-with-compass', '<p><strong>ডিজিটাল তাসবিহ সাথে দিক নির্দেশনার কম্পাস।</strong></p>\r\n<ul>\r\n<li>পবিত্র মাহে রমজানে সকাল সন্ধ্যা জিকির করতে আমরা নিয়ে এসেছি ডিজিটাল কাউন্টার ইসলামিক স্মার্ট তাসবিহ।</li>\r\n<li><strong>আপনার দাদা-দাদী নানা-নানী মা বাবা আত্মীয়-স্বজনকে উপহার দিতে পারেন // সর্বোচ্চ মানের উপর হতে পারে এই প্রোডাক্টটি।</strong></li>\r\n<li>সাথে রয়েছে দিক নির্দেশনার কম্পাস। ভ্রমণে নামাজের সময় কেবলার দিক নির্দেশনা করতে পারবেন সহজেই হাতে থাকা কম্পাস টির মাধ্যমে।</li>\r\n<li>সাথে রয়েছে ডিজিটাল ডিসপ্লে কাউন্টার। যতবার আপনি আল্লাহর নাম জপ করবেন বা দোয়া দরুদ পড়বেন ততবার এই ডিজিটাল ডিসপ্লে তে প্রদর্শিত হবে। দোয়া-দুরুদ হিসাব রাখার সহজ এক মাধ্যম।</li>\r\n<li><strong>এই ডিজিটাল তাসবিহ সাথে থাকলে আপনার আল্লাহর নাম দোয়া দরুদ বেশি বেশি পড়তে মন চাইবে।</strong></li>\r\n</ul>', 1000, 649, 'BD36589', 0, 0, 1, '2023-03-25 15:43:20', '2023-03-28 19:10:25'),
(622, 4, 'ORTHODONTIC TEETH TRAINER -ALIGNMENT MERAPIHKAN GIGI - BEHEL GIGI', 'orthodontic-teeth-trainer-alignment-merapihkan-gigi-behel-gigi', '<ul class=\"css-yxla8g eytdjj02\" data-testid=\"lblPDPInfoProduk\">\r\n<li class=\"css-bwcbiv\">Kondisi:&nbsp;<span class=\"main\">Baru</span></li>\r\n<li class=\"css-bwcbiv\">Berat Satuan:&nbsp;<span class=\"main\">20 g</span></li>\r\n<li class=\"css-bwcbiv\">Waktu Preorder:&nbsp;<span class=\"main\">2 Hari</span></li>\r\n<li class=\"css-bwcbiv\">Kategori:&nbsp;<a href=\"https://www.tokopedia.com/p/kesehatan/perlengkapan-medis/behel\" target=\"_blank\" rel=\"noopener noreferrer\"><strong>Behel</strong></a></li>\r\n<li class=\"css-bwcbiv\">Etalase:&nbsp;<a href=\"https://www.tokopedia.com/jasmine36/etalase/terlaris\" target=\"_blank\" rel=\"noopener noreferrer\"><strong>terlaris</strong></a></li>\r\n</ul>\r\n<div class=\"css-16inwn4\">\r\n<div data-testid=\"lblPDPDescriptionProduk\"><br />WARNA BIRU ..<br /><br /><br />HENTIKAN MEMAKAI BEHEL GIGI! Selain mahal, perawatan yang sulit membuatnya rawan menjadi sarang bakteri/virus sehingga justru beresiko merusak gigi anda.<br /><br />Solusinya lebih baik gunakan TEETH TRAINER ! Merupakan alat yang lebih simple, murah dan yang terpenting aman dari pada behel gigi.<br /><br /><br />ORTHODONTIC TEETH TRAINER de sa USA (Original)<br /><br /><br />Teeth trainer ini terbuat dari \"Polyurethane\" semacam karet silicone yang nyaman dipakai di mulut dan tidak sakit, namun tetap bisa menciptakan tekanan yang mengarahkan gigi pada posisi ideal.<br /><br /><br /><br />Telah di riset oleh banyak pakar ortho/gigi dunia sehingga bentuk dan ukurannya telah di sesuaikan dengan bentuk gigi dan mulut.<br /><br /><br />Cukup cepat terlihat perbaikan asalkan rutin MULAI TERLIHAT DENGAN PEMAKAIAN MINIMAL 3-6 BULAN. Lebih baik lagi hingga 1 tahun. WORK &amp; SAFETY !<br /><br /><br /><br />BEKERJA OPTIMAL PADA :<br />1. Treating Malocclusion : Kelainan susunan bagian atas dan bawah rahang yg mencegah gigi bertemu dengan semestinya<br /><br />2. Mild to medium upper and lower Anterior Crowding : Memperbaiki pada kasus gigi berkurumun atas/bawah<br /><br />3. Treatment of Relapse of Anterior Alignment After Treatment with braces : Sebagai perawatan setelah pemakaian kawat gigi permanen<br /><br /><br />CARA PEMAKAIAN :<br /><br /><br />Pakai selama 1 - 2 jam setiap pagi/siang dan 8 jam dimalam hari saat tidur dan selalu ingat untuk mengikuti beberapa langkah sederhana ini :<br />1. Bibir didekap saat pemakaian kecuali ketika berbicara<br /><br />2. Bernapas melalui hidung untuk mencapai gigitan yang benar<br /><br />3. Jangan ada aktivitas bibir saat pemakaian<br /><br />4. Pada Minggu pertama akan terasa sakit, ini wajar, gunakan terus setiap hari. Biasanya baru akan nyaman setelah beberapa minggu pemakaian.<br /><br /><br />PERAWATAN :<br />Sebelum dan sesudah Pemakaian selalu sikat dengan sikat gigi, bisa menggunakan air dingin ataupun hangat. JANGAN GUNAKAN AIR PANAS ! Kemudian keringkan dan simpan kembali di kotaknya.</div>\r\n</div>', 1000, 699, 'BD4444', 0, 0, 1, '2023-03-26 18:02:43', '2023-03-26 18:02:49'),
